,"address":[],"length":0,"stats":{"Line":3},"fn_name":null},{"line":76,"address":[],"length":0,"stats":{"Line":3},"fn_name":null},{"line":77,"address":[],"length":0,"stats":{"Line":6},"fn_name":null},{"line":80,"address":[],"length":0,"stats":{"Line":3},"fn_name":null},{"line":81,"address":[],"length":0,"stats":{"Line":11},"fn_name":null},{"line":82,"address":[],"length":0,"stats":{"Line":4},"fn_name":null},{"line":85,"address":[],"length":0,"stats":{"Line":3},"fn_name":null},{"line":86,"address":[],"length":0,"stats":{"Line":2},"fn_name":null},{"line":89,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line":92,"address":[],"length":0,"stats":{"Line":2},"fn_name":null},{"line":93,"address":[],"length":0,"stats":{"Line":4},"fn_name":null},{"line":94,"address":[],"length":0,"stats":{"Line":4},"fn_name":null},{"line":95,"address":[],"length":0,"stats":{"Line":2},"fn_name":null}],"covered":40,"coverable":46},{"path":["C:","\\","Users","rcarson1","Repositories","lavendeux_workspace","lavendeux_parser","src","syntax_tree","node","assignment.rs"],"content":"//! Assignment Nodes\r\n//!\r\n//! Nodes for assignment statements.\r\n//! To variables, functions and compound values\r\n//!\r\nuse super::*;\r\nuse crate::{parse_input, user_function::UserFunction, Error, Rule, State, ToToken, Value};\r\nuse pest::iterators::Pair;\r\nuse polyvalue::{operations::IndexingMutationExt, types::Array, ValueTrait};\r\n\r\n// identifier ~ \"(\" ~ \")\" ~ \"=\" ~ TOPLEVEL_EXPRESSION |\r\n// identifier ~ \"(\" ~ identifier ~ (\",\" ~ identifier)* ~ \")\" ~ \"=\" ~ TOPLEVEL_EXPRESSION\r\ndefine_node!(\r\n    FunctionAssignment {\r\n        name: String,\r\n        arguments: Vec\u003cString\u003e,\r\n        expression: String\r\n    },\r\n    rules = [FUNCTION_ASSIGNMENT_STATEMENT],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        // Name of the function is the first child\r\n        let name = children.next().unwrap().as_str().to_string();\r\n\r\n        // Parse arguments\r\n        let mut arguments = Vec::new();\r\n        while children.peek().is_some() {\r\n            let arg = children.next().unwrap();\r\n            arguments.push(arg.as_str().to_string());\r\n        }\r\n\r\n        // Confirm validity of the function body by parsing it here\r\n        let expression = arguments.pop().unwrap();\r\n        parse_input(\u0026expression, Rule::TOPLEVEL_EXPRESSION)?;\r\n\r\n        Ok(Self {\r\n            name,\r\n            arguments,\r\n            expression,\r\n            token\r\n        }.boxed())\r\n    },\r\n\r\n    value = |assignment: \u0026FunctionAssignment, state: \u0026mut State| {\r\n        let function = UserFunction::new(\u0026assignment.name, assignment.arguments.clone(), assignment.expression.clone())?;\r\n        state.set_user_function(function);\r\n        Ok(Value::from(assignment.expression.clone()))\r\n    }\r\n);\r\n\r\n// identifier ~ \"=\" ~ TOPLEVEL_EXPRESSION\r\ndefine_node!(\r\n    VariableAssignment {\r\n        name: String,\r\n        value: Node\r\n    },\r\n    rules = [VARIABLE_ASSIGNMENT_STATEMENT],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let name = children.next().unwrap().as_str().to_string();\r\n        let value = children.next().unwrap().to_ast_node()?;\r\n        Ok(Self { name, value, token }.boxed())\r\n    },\r\n    value = |assignment: \u0026VariableAssignment, state: \u0026mut State| {\r\n        let value = (*assignment.value).get_value(state)?;\r\n        state.set_variable(\u0026assignment.name, value.clone());\r\n        Ok(value)\r\n    }\r\n);\r\n\r\n// identifier ~ (\"[\" ~ TOPLEVEL_EXPRESSION ~ \"]\")+ ~ \"=\" ~ TOPLEVEL_EXPRESSION\r\ndefine_node!(\r\n    IndexAssignment {\r\n        name: String,\r\n        indices: Vec\u003cNode\u003e,\r\n        value: Node\r\n    },\r\n    rules = [INDEX_ASSIGNMENT_STATEMENT],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let name = children.next().unwrap().as_str().to_string();\r\n        let mut indices = Vec::new();\r\n        while children.peek().is_some() {\r\n            let index = children.next().unwrap();\r\n            indices.push(index.to_ast_node()?);\r\n        }\r\n\r\n        let value = indices.pop().unwrap();\r\n\r\n        Ok(Self {\r\n            name,\r\n            indices,\r\n            value,\r\n            token,\r\n        }.boxed())\r\n    },\r\n\r\n    value = |assignment: \u0026IndexAssignment, state: \u0026mut State| {\r\n        let value = (*assignment.value).get_value(state)?;\r\n\r\n        // The last index is the one that will be used to set the value\r\n        let mut indices = assignment.indices.iter().map(|node| node.get_value(state)).collect::\u003cResult\u003cVec\u003c_\u003e, _\u003e\u003e()?;\r\n        let final_index = indices.pop().unwrap();\r\n\r\n        // Move through the indices to get the final pointer\r\n        let mut dst = state.get_variable(\u0026assignment.name).ok_or(Error::VariableName {\r\n            name: assignment.name.clone(),\r\n            token: assignment.token().clone(),\r\n        })?;\r\n        let mut ptr = \u0026mut dst;\r\n        for index in \u0026indices {\r\n            ptr = ptr.get_index_mut(index)?;\r\n        }\r\n\r\n        // Set the value\r\n        ptr.set_index(\u0026final_index, value.clone())?;\r\n\r\n        // Set state and return\r\n        state.set_variable(\u0026assignment.name, dst);\r\n        Ok(value)\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    DestructuringAssignment {\r\n        names: Vec\u003cString\u003e,\r\n        value: Node\r\n    },\r\n    rules = [DESTRUCTURING_ASSIGNMENT_STATEMENT],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner().rev();\r\n\r\n        let value = children.next().unwrap().to_ast_node()?; // last child is the value\r\n\r\n        let mut children = children.rev();\r\n\r\n        let mut names = Vec::new();\r\n        while let Some(next) = children.next() {\r\n            let name = next.as_str().to_string();\r\n            names.push(name);\r\n        }\r\n\r\n        Ok(Self {\r\n            names,\r\n            value,\r\n            token,\r\n        }.boxed())\r\n    },\r\n\r\n    value = |assignment: \u0026DestructuringAssignment, state: \u0026mut State| {\r\n        let value = (*assignment.value).get_value(state)?;\r\n        let values = value.as_a::\u003cArray\u003e()?.inner().clone();\r\n        if values.len() != assignment.names.len() {\r\n            return Err(Error::DestructuringAssignment {\r\n                expected_length: assignment.names.len(),\r\n                actual_length: values.len(),\r\n                token: assignment.token().clone(),\r\n            });\r\n        }\r\n\r\n        for (name, value) in assignment.names.iter().zip(values) {\r\n            state.set_variable(name, value);\r\n        }\r\n\r\n        Ok(value)\r\n    }\r\n);\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use crate::{assert_tree, assert_tree_error};\r\n\r\n    use super::*;\r\n\r\n    #[test]\r\n    fn test_destructuring_assignment() {\r\n        assert_tree!(\r\n            \"(a, b, c) = a\",\r\n            DESTRUCTURING_ASSIGNMENT_STATEMENT,\r\n            DestructuringAssignment,\r\n            |tree: \u0026mut DestructuringAssignment| {\r\n                assert_eq!(tree.names.len(), 3);\r\n                assert_eq!(tree.names[0], \"a\");\r\n                assert_eq!(tree.names[1], \"b\");\r\n                assert_eq!(tree.names[2], \"c\");\r\n                assert_eq!(tree.value.to_string(), \"a\");\r\n\r\n                let mut state = State::new();\r\n                state.set_variable(\r\n                    \"a\",\r\n                    Value::from(vec![Value::from(1), Value::from(2), Value::from(3)]),\r\n                );\r\n                tree.get_value(\u0026mut state).unwrap();\r\n                assert_eq!(state.get_variable(\"a\").unwrap().to_string(), \"1\");\r\n                assert_eq!(state.get_variable(\"b\").unwrap().to_string(), \"2\");\r\n                assert_eq!(state.get_variable(\"c\").unwrap().to_string(), \"3\");\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_function_assignment() {\r\n        assert_tree!(\r\n            \"test() = 1\",\r\n            FUNCTION_ASSIGNMENT_STATEMENT,\r\n            FunctionAssignment,\r\n            |tree: \u0026mut FunctionAssignment| {\r\n                assert_eq!(tree.name, \"test\");\r\n                assert_eq!(0, tree.arguments.len());\r\n                assert_eq!(tree.expression, \"1\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"test(a) = 2*a\",\r\n            FUNCTION_ASSIGNMENT_STATEMENT,\r\n            FunctionAssignment,\r\n            |tree: \u0026mut FunctionAssignment| {\r\n                assert_eq!(tree.name, \"test\");\r\n                assert_eq!(tree.arguments[0], \"a\");\r\n                assert_eq!(tree.expression, \"2*a\");\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_variable_assignment() {\r\n        assert_tree!(\r\n            \"a = 1\",\r\n            VARIABLE_ASSIGNMENT_STATEMENT,\r\n            VariableAssignment,\r\n            |tree: \u0026mut VariableAssignment| {\r\n                assert_eq!(tree.name, \"a\");\r\n                assert_eq!(tree.value.to_string(), \"1\");\r\n\r\n                let mut state = State::new();\r\n                tree.get_value(\u0026mut state).unwrap();\r\n                assert_eq!(state.get_variable(\"a\").unwrap().to_string(), \"1\");\r\n            }\r\n        );\r\n\r\n        assert_tree_error!(\"pi = 2\", Pest);\r\n    }\r\n\r\n    #[test]\r\n    fn test_index_assignment() {\r\n        assert_tree!(\r\n            \"a[-1] = 1\",\r\n            INDEX_ASSIGNMENT_STATEMENT,\r\n            IndexAssignment,\r\n            |tree: \u0026mut IndexAssignment| {\r\n                assert_eq!(tree.name, \"a\");\r\n                assert_eq!(tree.indices.len(), 1);\r\n                assert_eq!(tree.indices[0].to_string(), \"-1\");\r\n                assert_eq!(tree.value.to_string(), \"1\");\r\n\r\n                let mut state = State::new();\r\n                state.set_variable(\"a\", Value::from(vec![Value::from(0), Value::from(1)]));\r\n                let value = tree.get_value(\u0026mut state).unwrap();\r\n                assert_eq!(value.to_string(), \"1\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"a[2] = 1\",\r\n            INDEX_ASSIGNMENT_STATEMENT,\r\n            IndexAssignment,\r\n            |tree: \u0026mut IndexAssignment| {\r\n                assert_eq!(tree.name, \"a\");\r\n                assert_eq!(tree.indices.len(), 1);\r\n                assert_eq!(tree.indices[0].to_string(), \"2\");\r\n\r\n                let mut state = State::new();\r\n                state.set_variable(\"a\", Value::from(vec![Value::from(0)]));\r\n                tree.get_value(\u0026mut state)\r\n                    .expect_err(\"Should not be able to assign to out-of-bounds index\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"a[0] = 1\",\r\n            INDEX_ASSIGNMENT_STATEMENT,\r\n            IndexAssignment,\r\n            |tree: \u0026mut IndexAssignment| {\r\n                assert_eq!(tree.name, \"a\");\r\n                assert_eq!(tree.indices.len(), 1);\r\n                assert_eq!(tree.indices[0].to_string(), \"0\");\r\n                assert_eq!(tree.value.to_string(), \"1\");\r\n\r\n                let mut state = State::new();\r\n                state.set_variable(\"a\", Value::from(vec![Value::from(0)]));\r\n                tree.get_value operands = this.operand_stack.iter().rev().peekable();\r\n        let mut operators = this.operator_stack.iter().rev().peekable();\r\n\r\n        let mut left = operands.next().unwrap().get_value(state)?;\r\n        while let Some(op) = operators.next() {\r\n            let right = operands.next().unwrap().get_value(state)?;\r\n            left = Value::bitwise_op(\u0026left, \u0026right, *op)?;\r\n        }\r\n\r\n        Ok(left)\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    BitwiseNotExpression { expression: Node },\r\n    rules = [BITWISE_NOT_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner().rev();\r\n        let expression = children.next().unwrap().to_ast_node()?;\r\n\r\n        // If there are an odd number of negations, we need to invert the value\r\n        let mut do_invert = false;\r\n        while children.next().is_some() {\r\n            do_invert = !do_invert;\r\n        }\r\n\r\n        if do_invert {\r\n            Ok(Self { expression, token }.boxed())\r\n        } else {\r\n            // If there are an even number of negations, we can just return the inner expression\r\n            Ok(expression)\r\n        }\r\n    },\r\n    value = |this: \u0026BitwiseNotExpression, state: \u0026mut State| {\r\n        let value = this.expression.get_value(state)?;\r\n        let value = Value::bitwise_op(\u0026value, \u0026value.clone(), BitwiseOperation::Not)?;\r\n        Ok(value)\r\n    }\r\n);\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use super::*;\r\n    use crate::assert_tree;\r\n\r\n    #[test]\r\n    fn test_bitwise_expr() {\r\n        assert_tree!(\r\n            \"0x0A | 0x05\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BitwiseExpression,\r\n            |tree: \u0026mut BitwiseExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"15\");\r\n            }\r\n ack of operands and operators\r\n        expr.operand_stack.push(children.next().unwrap().to_ast_node()?);\r\n        while children.peek().is_some() {\r\n            let operation = children.next().unwrap().as_str();\r\n            let operation = match operation {\r\n                \"==\" =\u003e BooleanOperation::EQ,\r\n                \"!=\" =\u003e BooleanOperation::NEQ,\r\n                \"\u003c\" =\u003e BooleanOperation::LT,\r\n                \"\u003c=\" =\u003e BooleanOperation::LTE,\r\n                \"\u003e\" =\u003e BooleanOperation::GT,\r\n                \"\u003e=\" =\u003e BooleanOperation::GTE,\r\n                \"\u0026\u0026\" =\u003e BooleanOperation::And,\r\n                \"||\" =\u003e BooleanOperation::Or,\r\n                _ =\u003e {\r\n                    return Err(Error::Internal(format!(\r\n                        \"Invalid boolean operation {:?}\",\r\n                        operation\r\n                    )))\r\n                }\r\n            };\r\n            expr.operator_stack.push(operation);\r\n\r\n            let operand = children.next().unwrap().to_ast_node()?;\r\n            expr.operand_stack.push(operand);\r\n        }\r\n\r\n        Ok(expr.boxed())\r\n    },\r\n    value = |this: \u0026BooleanExpression, state: \u0026mut State| {\r\n        let mut operands = this.operand_stack.iter().rev().peekable();\r\n        let mut operators = this.operator_stack.iter().rev().peekable();\r\n\r\n        let mut left = operands.next().unwrap().get_value(state)?;\r\n        while let Some(op) = operators.next() {\r\n            let ss_eval_op = *left.as_a::\u003cBool\u003e()?.inner();\r\n            if *op == BooleanOperation::And \u0026\u0026 !ss_eval_op {\r\n                // Short circuit\r\n                left = Value::from(false);\r\n            } else if *op == BooleanOperation::Or \u0026\u0026 ss_eval_op {\r\n                // Short circuit\r\n                left = Value::from(true);\r\n            } else {\r\n                let right = operands.next().unwrap().get_value(state)?;\r\n                left = Value::boolean_op(\u0026left, \u0026right, *op)?;\r\n            }\r\n        }\r\n\r\n        Ok(left)\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    BooleanNotExpression { expression: Node },\r\n    rules = [BOOLEAN_NOT_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner().rev();\r\n        let expression = children.next().unwrap().to_ast_node()?;\r\n\r\n        // If there are an odd number of negations, we need to invert the value\r\n        let mut do_invert = false;\r\n        while children.next().is_some() {\r\n            do_invert = !do_invert;\r\n        }\r\n\r\n        if do_invert {\r\n            Ok(Self { expression, token }.boxed())\r\n        } else {\r\n            // If there are an even number of negations, we can just return the inner expression\r\n            Ok(expression)\r\n        }\r\n    },\r\n    value = |this: \u0026BooleanNotExpression, state: \u0026mut State| {\r\n        let value = this.expression.get_value(state)?;\r\n        let value = Value::boolean_op(\u0026value, \u0026value.clone(), BooleanOperation::Not)?;\r\n        Ok(value)\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    MatchingExpression {\r\n        value: Node,\r\n        operation: MatchingOperation,\r\n        pattern: Node\r\n    },\r\n    rules = [MATCHING_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let value = children.next().unwrap().to_ast_node()?;\r\n        let operation = children.next().unwrap().as_str();\r\n        let operation = match operation {\r\n            \"contains\" =\u003e MatchingOperation::Contains,\r\n            \"matches\" =\u003e MatchingOperation::Matches,\r\n            \"is\" =\u003e MatchingOperation::Is,\r\n            \"startswith\" | \"starts_with\" =\u003e MatchingOperation::StartsWith,\r\n            \"endswith\" | \"ends_with\" =\u003e MatchingOperation::EndsWith,\r\n            _ =\u003e {\r\n                return Err(Error::Internal(format!(\r\n                    \"Invalid matching operation {:?}\",\r\n                    operation\r\n                )))\r\n            }\r\n        };\r\n        let pattern = children.next().ok_or(Error::IncompleteMatchingExpression {\r\n            token: token.clone(),\r\n        })?;\r\n\r\n        // is is a special case because it is the only operation that can accept an identifier\r\n        // as a pattern - the type name can be a string, but does not need to be\r\n        let pattern = if operation == MatchingOperation::Is {\r\n            let s = pattern.as_str().to_string();\r\n            ValueLiteral::new(Value::from(s), pattern.to_token()).boxed()\r\n        } else {\r\n            pattern.to_ast_node()?\r\n        };\r\n\r\n        Ok(Self {\r\n            value,\r\n            operation,\r\n            pattern,\r\n            token,\r\n        }\r\n        .boxed())\r\n    },\r\n    value = |this: \u0026MatchingExpression, state: \u0026mut State| {\r\n        let value = this.value.get_value(state)?;\r\n        let pattern = this.pattern.get_value(state)?;\r\n        Ok(Value::matching_op(\u0026value, \u0026pattern, this.operation)?)\r\n    }\r\n);\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use super::*;\r\n    use crate::assert_tree;\r\n\r\n    #[test]\r\n    fn test_matching_expr() {\r\n        assert_tree!(\r\n            \"'a' contains 'b'\",\r\n            MATCHING_EXPRESSION,\r\n            MatchingExpression,\r\n            |tree: \u0026mut MatchingExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"false\");\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_boolean_expr() {\r\n        assert_tree!(\r\n            \"true \u0026\u0026 false\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"false\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"true || false\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"true \u0026\u0026 false || true\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"3 \u003e 1\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"3 \u003e= 3\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"3 \u003c 1\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"false\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"3 \u003c= 3\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"3 == 3\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"3 != 3\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"false\");\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_boolean_not_expr() {\r\n        assert_tree!(\r\n            \"!true\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanNotExpression,\r\n            |tree: \u0026mut BooleanNotExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"false\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"!!true\",\r\n            TOPLEVEL_EXPRESSION,\r\n            ValueLiteral,\r\n            |tree: \u0026mut ValueLiteral| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n    }\r\n}\r\n","traces":[{"line":17,"address":[],"length":0,"stats":{"Lin Core Node\r\n//!\r\n//! High-level nodes that are used to build the syntax tree.\r\n//! These nodes are how the user will interact with the syntax tree.\r\n//!\r\nuse super::*;\r\nuse crate::{Error, Rule, State, ToToken, Value};\r\nuse pest::iterators::Pair;\r\nuse polyvalue::types::{Array, Bool, Range};\r\nuse polyvalue::{ValueTrait, ValueType};\r\n\r\n// LINE* ~ EOI\r\ndefine_node!(\r\n    Script {\r\n        statements: Vec\u003cNode\u003e\r\n    },\r\n    rules = [SCRIPT],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n\r\n\r\n        let statements = input\r\n            .into_inner()\r\n            .filter(|child| child.as_rule() != Rule::EOI \u0026\u0026 child.as_rule() != Rule::EOL)\r\n            .map(|child| Ok(child.to_ast_node()?))\r\n            .collect::\u003cResult\u003cVec\u003cNode\u003e, Error\u003e\u003e()?;\r\n\r\n        Ok(Self {\r\n            statements,\r\n            token\r\n        }.boxed())\r\n    },\r\n\r\n    value = |script: \u0026Script, state: \u0026mut State| {\r\n        let values = script.statements.iter().map(|node| node.get_value(state)).collect::\u003cResult\u003cVec\u003c_\u003e, _\u003e\u003e()?;\r\n        Ok(Value::Array(values.into()))\r\n    }\r\n);\r\n\r\n// EXPRESSION ~ \"@\" ~ identifier ~ EOL\r\n// | EXPRESSION ~ EOL\r\n// | EOL\r\ndefine_node!(\r\n    Line {\r\n        expression: Option\u003cNode\u003e,\r\n        decorator: Option\u003cString\u003e\r\n    },\r\n    rules = [LINE],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let next = children.next();\r\n        if next.is_none() {\r\n            return Ok(Self {\r\n                expression: None,\r\n                decorator: None,\r\n                token\r\n            }.boxed());\r\n        } else {\r\n            let expression = next.unwrap().to_ast_node()?;\r\n            let decorator = children.next().and_then(|c| Some(c.as_str().to_string()));\r\n\r\n            Ok(Self {\r\n                expression: Some(expression),\r\n                decorator,\r\n                token\r\n            }.boxed())\r\n        }\r\n    },\r\n\r\n    value = |line: \u0026Line, state: \u0026mut State| {\r\n        if let Some(expression) = \u0026line.expression {\r\n            let value = expression.get_value(state)?;\r\n            if let Some(decorator) = \u0026line.decorator {\r\n                let result = state.decorate(decorator, line.token(), value)?;\r\n                Ok(Value::from(result).into())\r\n            } else {\r\n                Ok(value)\r\n            }\r\n        } else {\r\n            Ok(Value::from(\"\").into())\r\n        }\r\n    }\r\n);\r\n\r\n// BOOLEAN_OR_EXPRESSION ~ (\"?\" ~ BOOLEAN_OR_EXPRESSION ~ \":\" ~ BOOLEAN_OR_EXPRESSION)*\r\ndefine_node!(\r\n    TernaryExpression {\r\n        condition: Node,\r\n        if_true: Node,\r\n        if_false: Node\r\n    },\r\n    rules = [TERNARY_EXPRESSION, IF_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner().rev().peekable();\r\n\r\n        // We will begin at the end, the final right-side expression\r\n        // Then we will work backwards, grabbing pairs of expressions\r\n        // And turning them into ternary expressions with the previous\r\n        // iteration as the false side until we run out of children\r\n        let mut if_false = children.next().unwrap().to_ast_node()?;\r\n        while children.peek().is_some() {\r\n            let if_true = children.next().unwrap().to_ast_node()?;\r\n            let condition = children.next().unwrap().to_ast_node()?;\r\n\r\n            if_false = Box::new(Self {\r\n                condition,\r\n                if_true,\r\n                if_false,\r\n                token: token.clone(),\r\n            });\r\n        }\r\n\r\n        Ok(if_false)\r\n    },\r\n    value = |ternary: \u0026TernaryExpression, state: \u0026mut State| {\r\n        let condition = ternary.condition.get_value(state)?;\r\n        let condition = *condition.as_a::\u003cBool\u003e()?.inner();\r\n        if condition {\r\n            ternary.if_true.get_value(state)\r\n        } else {\r\n            ternary.if_false.get_value(state)\r\n        }\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    ForLoopExpression {\r\n        variable: Option\u003cString\u003e,\r\n        iterable: Node,\r\n        body: Node\r\n    },\r\n    rules = [FOR_LOOP_EXPRESSION],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner().rev();\r\n\r\n        let body = children.next().unwrap().to_ast_node()?;\r\n        let iterable = children.next().unwrap().to_ast_node()?;\r\n        let variable = children.next().map(|c| c.as_str().to_string());\r\n\r\n        Ok(Self {\r\n            variable,\r\n            iterable,\r\n            body,\r\n            token\r\n        }.boxed())\r\n    },\r\n\r\n    value = |for_loop: \u0026ForLoopExpression, state: \u0026mut State| {\r\n        let iterable = for_loop.iterable.get_value(state)?;\r\n\r\n        match iterable.own_type() {\r\n            ValueType::Range =\u003e {\r\n                let iterable = iterable.as_a::\u003cRange\u003e()?;\r\n                let mut result = vec![];\r\n                state.scope_into(for_loop.token())?;\r\n                for i in iterable.inner().clone() {\r\n                    let value = Value::from(i);\r\n                    if let Some(variable) = \u0026for_loop.variable {\r\n                        state.set_variable(variable, value.clone());\r\n                    }\r\n\r\n                    let value = for_loop.body.get_value(state).or_else(|e| {\r\n                        state.scope_out();\r\n                        Err(e)\r\n                    })?;\r\n                    result.push(value);\r\n                }\r\n                state.scope_out();\r\n\r\n                Ok(Value::Array(result.into()).into())\r\n            },\r\n\r\n            _ =\u003e {\r\n                let iterable = iterable.as_a::\u003cArray\u003e()?;\r\n\r\n                let mut result = vec![];\r\n                state.scope_into(for_loop.token())?;\r\n                for value in iterable.inner() {\r\n                    if let Some(variable) = \u0026for_loop.variable {\r\n                        state.set_variable(variable, value.clone());\r\n                    }\r\n\r\n                    let value = for_loop.body.get_value(state).or_else(|e| {\r\n                        state.scope_out();\r\n                        Err(e)\r\n                    })?;\r\n                    result.push(value);\r\n                }\r\n                state.scope_out();\r\n\r\n                Ok(Value::Array(result.into()).into())\r\n            }\r\n        }\r\n    }\r\n);\r\n\r\n#[derive(Debug)]\r\npub enum SwitchCase {\r\n    Default(Node),\r\n    Case(Node, Node),\r\n}\r\n\r\ndefine_node!(\r\n    SwitchExpression {\r\n        match_on: Node,\r\n        cases: Vec\u003cSwitchCase\u003e\r\n    },\r\n    rules = [SWITCH_EXPRESSION],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let match_on = children.next().unwrap().to_ast_node()?;\r\n        let mut cases = vec![];\r\n\r\n        while let Some(case) = children.next() {\r\n            let body = children.next().unwrap().to_ast_node()?;\r\n\r\n            if case.as_str() == \"_\" {\r\n                cases.push(SwitchCase::Default(body));\r\n                if children.next().is_some() {\r\n                    return Err(Error::UnreachableSwitchCase {\r\n                        token: token.clone(),\r\n                    });\r\n                }\r\n\r\n                break;\r\n            } else {\r\n                cases.push(SwitchCase::Case(case.to_ast_node()?, body));\r\n            }\r\n        }\r\n\r\n        Ok(Self {\r\n            match_on,\r\n            cases,\r\n            token\r\n        }.boxed())\r\n    },\r\n\r\n    value = |switch: \u0026SwitchExpression, state: \u0026mut State| {\r\n        let match_on = switch.match_on.get_value(state)?;\r\n\r\n        for case in \u0026switch.cases {\r\n            match case {\r\n                SwitchCase::Default(body) =\u003e {\r\n                    return body.get_value(state);\r\n                },\r\n\r\n                SwitchCase::Case(value, body) =\u003e {\r\n                    let value = value.get_value(state)?;\r\n                    if value.own_type() != match_on.own_type() {\r\n                        return Err(Error::SwitchCaseTypeMismatch {\r\n                            case: value,\r\n                            expected_type: match_on.own_type(),\r\n                            token: switch.token.clone(),\r\n                        });\r\n                    }\r\n\r\n                    if value == match_on {\r\n                        return body.get_value(state);\r\n                    }\r\n                }\r\n            }\r\n        }\r\n\r\n        Err(Error::NonExhaustiveSwitch {\r\n            token: switch.token.clone(),\r\n        })\r\n    }\r\n);\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use super::*;\r\n    use crate::assert_tree;\r\n\r\n    #[test]\r\n    fn test_for() {\r\n        assert_tree!(\r\n            \"for a in [1, 2, 3] do a\",\r\n            FOR_LOOP_EXPRESSION,\r\n            ForLoopExpression,\r\n            |node: \u0026mut ForLoopExpression| {\r\n                assert_eq!(node.variable.as_ref().unwrap(), \"a\");\r\n                assert_eq!(node.iterable.to_string(), \"[1, 2, 3]\");\r\n                assert_eq!(node.body.to_string(), \"a\");\r\n\r\n                assert_eq!(\r\n                    node.get_value(\u0026mut State::new()).unwrap().to_string(),\r\n                    \"[1, 2, 3]\"\r\n                );\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"for a in [1, 2, 3] do a + 1\",\r\n            FOR_LOOP_EXPRESSION,\r\n            ForLoopExpression,\r\n            |node: \u0026mut ForLoopExpression| {\r\n                assert_eq!(node.variable.as_ref().unwrap(), \"a\");\r\n                assert_eq!(node.iterable.to_string(), \"[1, 2, 3]\");\r\n                assert_eq!(node.body.to_string(), \"a + 1\");\r\n\r\n                assert_eq!(\r\n                    node.get_value(\u0026mut State::new()).unwrap().to_string(),\r\n                    \"[2, 3, 4]\"\r\n                );\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"for a in [1, 2, 3] do a + 1\",\r\n            FOR_LOOP_EXPRESSION,\r\n            ForLoopExpression,\r\n            |node: \u0026mut ForLoopExpression| {\r\n                assert_eq!(node.variable.as_ref().unwrap(), \"a\");\r\n                assert_eq!(node.iterable.to_string(), \"[1, 2, 3]\");\r\n                assert_eq!(node.body.to_string(), \"a + 1\");\r\n\r\n                assert_eq!(\r\n                    node.get_value(\u0026mut State::new()).unwrap().to_string(),\r\n                    \"[2, 3, 4]\"\r\n                );\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"for a in [1, 2, 3] do a + 1\",\r\n            FOR_LOOP_EXPRESSION,\r\n            ForLoopExpression,\r\n            |node: \u0026mut ForLoopExpression| {\r\n                assert_eq!(node.variable.as_ref().unwrap(), \"a\");\r\n                assert_eq!(node.iterable.to_string(), \"[1, 2, 3]\");\r\n                assert_eq!(node.body.to_string(), \"a + 1\");\r\n\r\n                assert_eq!(\r\n                    node.get_value(\u0026mut State::new()).unwrap().to_string(),\r\n                    \"[2, 3, 4]\"\r\n                );\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_ternary_expr() {\r\n        assert_tree!(\r\n            \"true ? 1 : 0\",\r\n            TERNARY_EXPRESSION,\r\n            TernaryExpression,\r\n            |node: \u0026mut TernaryExpression| {\r\n                assert_eq!(node.condition.to_string(), \"true\");\r\n                assert_eq!(node.if_true.to_string(), \"1\");\r\n                assert_eq!(node.if_false.to_string(), \"0\");\r\n\r\n                assert_eq!(node.get_value(\u0026mut State::new()).unwrap().to_string(), \"1\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"false ? 1 : 0\",\r\n            TERNARY_EXPRESSION,\r\n            TernaryExpression,\r\n            |node: \u0026mut TernaryExpression| {\r\n                assert_eq!(node.condition.to_string(), \"false\");\r\n                assert_eq!(node.if_true.to_string(), \"1\");\r\n                assert_eq!(node.if_false.to_string(), \"0\");\r\n\r\n                assert_eq!(node.get_value(\u0026mut State::new()).unwrap().to_string(), \"0\");\r\n            }\r\n        );\r\n\r\n        // Test that short-circuiting works, to prevent a side-effect\r\n        assert_tree!(\r\n            \"true ? 0 : pop(a)\",\r\n            TERNARY_EXPRESSION,\r\n            TernaryExpression,\r\n            |node: \u0026mut TernaryExpression| {\r\n                assert_eq!(node.condition.to_string(), \"true\");\r\n                assert_eq!(node.if_true.to_string(), \"0\");\r\n                assert_tree!(\r\n                    \u0026mut node.if_false,\r\n                    FunctionCall,\r\n                    |node: \u0026mut FunctionCall| {\r\n                        assert_eq!(node.name, \"pop\");\r\n                        assert_eq!(node.arguments.len(), 1);\r\n                        assert_eq!(node.arguments[0].to_string(), \"a\");\r\n                    }\r\n                );\r\n\r\n                let mut state = State::new();\r\n                state.set_variable(\"a\", Value::from(vec![Value::from(\"0\")]));\r\n\r\n                assert_eq!(node.get_value(\u0026mut State::new()).unwrap().to_string(), \"0\");\r\n\r\n                assert_eq!(state.get_variable(\"a\").unwrap().to_string(), \"[0]\");\r\n            }\r\n        )\r\n    }\r\n\r\n    #[test]\r\n    fn test_line() {\r\n        assert_tree!(\"1\", LINE, Line, |node: \u0026mut Line| {\r\n            assert_eq!(node.expression.as_ref().unwrap().to_string(), \"1\");\r\n            assert_eq!(node.decorator, None);\r\n            assert_eq!(node.get_value(\u0026mut State::new()).unwrap().to_string(), \"1\");\r\n        });\r\n\r\n        assert_tree!(\"1 @bool\", LINE, Line, |node: \u0026mut Line| {\r\n            assert_eq!(node.expression.as_ref().unwrap().to_string(), \"1\");\r\n            assert_eq!(node.decorator.as_ref().unwrap(), \"bool\");\r\n            assert_eq!(\r\n                node.get_value(\u0026mut State::new()).unwrap().to_string(),\r\n                \"true\"\r\n            );\r\n        });\r\n\r\n        assert_tree!(\"\\n\", LINE, Line, |node: \u0026mut Line| {\r\n            assert!(node.expression.as_ref().is_none());\r\n            assert_eq!(node.decorator.as_ref(), None);\r\n            assert_eq!(node.get_value(\u0026mut State::new()).unwrap().to_string(), \"\");\r\n        });\r\n    }\r\n\r\n    #[test]\r\n    fn test_script() {\r\n        assert_tree!(\"1\\n2\", SCRIPT, Script, |node: \u0026mut Script| {\r\n            assert_eq!(node.statements.len(), 2);\r\n            assert_eq!(node.statements[0].to_string(), \"1\\n\");\r\n            assert_eq!(node.statements[1].to_string(), \"2\");\r\n            assert_eq!(\r\n                node.get_value(\u0026mut State::new()).unwrap().to_string(),\r\n                \"[1, 2]\"\r\n            );\r\n        });\r\n\r\n        assert_tree!(\"1 \\\\\\n@bool\", SCRIPT, Script, |node: \u0026mut Script| {\r\n            assert_eq!(node.statements.len(), 1);\r\n            assert_eq!(\r\n                node.get_value(\u0026mut State::new()).unwrap().to_string(),\r\n \n//! more useful way\r\nuse crate::token::ToToken;\r\nuse crate::{AstNode, Error, Rule};\r\n\r\nmacro_rules! error_node {\r\n    ($name:ident, $rule:ident) =\u003e {\r\n        define_node!(\r\n            $name,\r\n            rules = [$rule],\r\n            new = |input: pest::iterators::Pair\u003cRule\u003e| {\r\n                Err(Error::$name {\r\n                    token: input.to_token(),\r\n                })\r\n            },\r\n            value = |_: \u0026Self, _state: \u0026mut crate::State| {\r\n                Err(Error::Internal(\r\n                    \"Attempt to get value from an error\".to_string(),\r\n                ))\r\n            }\r\n        );\r\n    };\r\n}\r\n\r\nerror_node!(UnterminatedLinebreak, ERROR_UNTERMINATED_LINEBREAK);\r\nerror_node!(UnterminatedLiteral, ERROR_UNTERMINATED_LITERAL);\r\nerror_node!(UnterminatedComment, ERROR_UNTERMINATED_COMMENT);\r\nerror_node!(UnexpectedDecorator, ERROR_UNEXPECTED_DECORATOR);\r\nerror_node!(IncompleteRangeExpression, RANGE_OPERATOR);\r\nerror_node!(IncompleteObject, ERROR_INCOMPLETE_OBJECT);\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use super::*;\r\n    use crate::assert_tree_error;\r\n\r\n    #[test]\r\n    fn test_errors() {\r\n        assert_tree_error!(\"1 +\\\\\", UnterminatedLinebreak);\r\n        assert_tree_error!(\"1 + \\\"\", UnterminatedLiteral);\r\n        assert_tree_error!(\"1 + /*\", UnterminatedComment);\r\n        assert_tree_error!(\"@1 + 1\", UnexpectedDecorator);\r\n        assert_tree_error!(\"..\", IncompleteRangeExpression);\r\n        assert_tree_error!(\"..1\", IncompleteRangeExpression);\r\n        assert_tree_error!(\"1 + 1 matches\", IncompleteMatchingExpression);\r\n        assert_tree_error!(\"{0}\", IncompleteObject);\r\n    }\r\n}\r\n","traces":[{"line":28,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line":29,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line":30,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line": oToken};\r\nuse pest::iterators::Pair;\r\nuse polyvalue::{\r\n    operations::*,\r\n    types::{Array, Str},\r\n    Value, ValueTrait, ValueType,\r\n};\r\n\r\ndefine_node!(\r\n    IndexingExpression {\r\n        base: Node,\r\n        index: Node\r\n    },\r\n    rules = [INDEXING_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let mut base = children.next().unwrap().to_ast_node()?;\r\n        for index in children {\r\n            let index = index.to_ast_node()?;\r\n            base = Self {\r\n                base,\r\n                index,\r\n                token: token.clone(),\r\n            }\r\n            .boxed();\r\n        }\r\n\r\n        Ok(base)\r\n    },\r\n    value = |this: \u0026IndexingExpression, state: \u0026mut State| {\r\n        let base = this.base.get_value(state)?;\r\n        let index = this.index.get_value(state)?;\r\n\r\n        match base {\r\n            // String indexing is separate because it cannot follow\r\n            // the trait used by other types\r\n            Value::String(s) =\u003e {\r\n                let range = Str::index_value_to_range(\u0026index)?;\r\n                let value = s.substr(\u0026range.start()..=\u0026range.end())?;\r\n                Ok(Value::from(value))\r\n            }\r\n\r\n            // Range op indexing\r\n            _ if index.is_a(ValueType::Array) =\u003e {\r\n                let results = base.get_indices(\u0026index)?.as_a::\u003cArray\u003e()?;\r\n                let results = results.inner().iter().cloned().collect::\u003cVec\u003c_\u003e\u003e();\r\n                Ok(Value::from(results))\r\n            }\r\n\r\n            // Normal indexing\r\n            _ =\u003e Ok(base.get_index(\u0026index)?),\r\n        }\r\n    }\r\n);\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use super::*;\r\n    use crate::assert_tree;\r\n\r\n    #[test]\r\n    fn test_indexing_expr() {\r\n        assert_tree!(\r\n            \"a[0]\",\r\n            INDEXING_EXPRESSION,\r\n            IndexingExpression,\r\n            |node: \u0026mut IndexingExpression| {\r\n                assert_eq!(node.base.to_string(), \"a\");\r\n                assert_eq!(node.index.to_string(), \"0\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"a[0][1]\",\r\n            INDEXING_EXPRESSION,\r\n            IndexingExpression,\r\n            |node: \u0026mut IndexingExpression| {\r\n                assert_tree!(\r\n                    \u0026mut node.base,\r\n                    IndexingExpression,\r\n                    |node: \u0026mut IndexingExpression| {\r\n                        assert_eq!(node.base.to_string(), \"a\");\r\n                        assert_eq!(node.index.to_string(), \"0\");\r\n                    }\r\n                );\r\n                assert_eq!(node.index.to_string(), \"1\");\r\n            }\r\n        );\r\n    }\r\n}\r\n","traces":[{"line":20,"address":[],"length":0,"stats":{"Line":2},"fn_name":null},{"line":21,"address":[],"length":0,"stats":{"Line":2},"fn_name":null},{"line":22,"address":[],"length":0,"stats":{"Line":2},"fn_name":null},{"line":24,"address":[],"length":0,"stats":{"Line":4},"fn_name":null},{"line":25,"address":[],"length":0,"stats":{"Line":11},"fn_name":null},{"line":26,"address":[],"length":0,"stats":{"Line":6},"fn_name":null},{"line":27,"address":[],"length":0,"stats":{"Line":3},"fn_name":null},{"line":28,"address":[],"length":0,"stats":{"Line":3},"fn_name":null},{"line":29,"address":[],"length":0,"stats":{"Line":3},"fn_name":null},{"line":30,"address":[],"length":0,"stats":{"Line":3},"fn_name":null},{"line":32,"address":[],"length":0,"stats":{"Line":3},"fn_name":null},{"line":35,"address":[],"length":0,"stats":{"Line":2},"fn_name":null},{"line":37,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":38,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":39,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":41,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":44,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":45,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":46,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":47,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":51,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":52,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":53,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":54,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":58,"address":[],"length":0,"stats":{"Line":0},"fn_name":null}],"covered":12,"coverable":25},{"path":["C:","\\","Users","rcarson1","Repositories","lavendeux_workspace","lavendeux_parser","src","syntax_tree","node","values.rs"],"content":"//! Value Nodes\r\n//!\r\n//! High-level nodes that are used to build the syntax tree.\r\n//! These nodes are how the user will interact with the syntax tree.\r\n//!\r\nuse super::*;\r\nuse crate::{Error, Rule, State, ToToken, Token, Value};\r\nuse pest::iterators::Pair;\r\nuse polyvalue::operations::IndexingMutationExt;\r\nuse polyvalue::{types::*, ValueTrait, ValueType};\r\nuse std::str::FromStr;\r\n\r\nfn parse_string(input: \u0026str) -\u003e String {\r\n    // Sanity check\r\n    if input.len() \u003c 2 {\r\n        return String::new();\r\n    }\r\n\r\n    // Remove the first and last characters - the quotes around our string\r\n    // This would not work great with graphemes like , but we know that it's\r\n    // either ' or \" so this should be safe\r\n    let mut c = input.chars();\r\n    c.next();\r\n    c.next_back();\r\n\r\n    // Now we split along our \\\\ backslash escapes, and rejoin after\r\n    // to prevent going over them twice. This method isn't super\r\n    // neat, there's likely a better way\r\n    c.as_str()\r\n        .split(\"\\\\\\\\\")\r\n        .map(|s| {\r\n            s.replace(\"\\\\'\", \"\\'\")\r\n                .replace(\"\\\\\\\"\", \"\\\"\")\r\n                .replace(\"\\\\n\", \"\\n\")\r\n                .replace(\"\\\\\\n\", \"\\n\")\r\n                .replace(\"\\\\\\r\", \"\\r\")\r\n                .replace(\"\\\\r\", \"\\r\")\r\n                .replace(\"\\\\t\", \"\\t\")\r\n        })\r\n        .collect::\u003cVec\u003cString\u003e\u003e()\r\n        .join(\"\\\\\")\r\n}\r\n\r\ndefine_node!(\r\n    ValueLiteral { value: Value },\r\n    rules = [\r\n        currency_literal,\r\n        fixed_literal,\r\n        sci_literal,\r\n        float_literal,\r\n        bool_literal,\r\n        regex_literal,\r\n        sized_literal,\r\n        string_literal\r\n    ],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let value = match input.as_rule() {\r\n            Rule::int_literal =\u003e I64::from_str(input.as_str())?.into(),\r\n            Rule::float_literal | Rule::sci_literal =\u003e Float::from_str(input.as_str())?.into(),\r\n\r\n            Rule::hex_literal | Rule::bin_literal | Rule::oct_literal =\u003e {\r\n                I64::from_str_radix(input.as_str())?.into()\r\n            }\r\n\r\n            Rule::string_literal =\u003e parse_string(input.as_str()).into(),\r\n            Rule::bool_literal =\u003e Bool::from_str(input.as_str())?.into(),\r\n\r\n            Rule::regex_literal =\u003e Str::new(input.as_str().to_string()).into(),\r\n\r\n            Rule::sized_literal =\u003e {\r\n                let input = input.as_str();\r\n\r\n                if let Some(integer) = input.strip_suffix(\"u8\") {\r\n                    polyvalue::types::U8::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"u16\") {\r\n                    polyvalue::types::U16::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"u32\") {\r\n                    polyvalue::types::U32::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"u64\") {\r\n                    polyvalue::types::U64::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"i8\") {\r\n                    polyvalue::types::I8::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"i16\") {\r\n                    polyvalue::types::I16::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"i32\") {\r\n                    polyvalue::types::I32::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"i64\") {\r\n                    polyvalue::types::I64::from_str(integer)?.into()\r\n                } else {\r\n                    polyvalue::types::I64::from_str(input)?.into()\r\n                }\r\n            }\r\n\r\n            Rule::fixed_literal =\u003e {\r\n                // remove the D suffix first\r\n                let input = \u0026input.as_str()[..input.as_str().len() - 1];\r\n                Fixed::from_str(input)?.into()\r\n            }\r\n            Rule::currency_literal =\u003e Currency::from_str(input.as_str())?.into(),\r\n\r\n            _ =\u003e Err(Error::Internal(format!(\r\n                \"Unexpected rule {:?} in ValueLiteral\",\r\n                input.as_rule()\r\n            )))?,\r\n        };\r\n\r\n        Ok(Self { value, token }.boxed())\r\n    },\r\n    value = |this: \u0026ValueLiteral, _state: \u0026mut State| { Ok(this.value.clone()) }\r\n);\r\n\r\nimpl ValueLiteral {\r\n    pub fn new(value: Value, token: Token) -\u003e Self {\r\n        Self { value, token }\r\n    }\r\n}\r\n\r\ndefine_node!(\r\n    ConstantValue { value: Value },\r\n    rules = [const_literal],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let text = input.as_str();\r\n\r\n        let value = match text {\r\n            \"pi\" =\u003e Value::from(std::f64::consts::PI),\r\n            \"e\" =\u003e Value::from(std::f64::consts::E),\r\n            \"tau\" =\u003e Value::from(std::f64::consts::TAU),\r\n\r\n            _ =\u003e {\r\n                return Err(Error::Internal(format!(\r\n                    \"Unexpected const literal {}\",\r\n                    text\r\n                )));\r\n            }\r\n        };\r\n\r\n        Ok(Self { value, token }.boxed())\r\n    },\r\n    value = |this: \u0026ConstantValue, _state: \u0026mut State| { Ok(this.value.clone()) }\r\n);\r\n\r\ndefine_node!(\r\n    Identifier { name: String },\r\n    rules = [identifier],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let mut token = input.to_token();\r\n        let name = input.as_str().to_string();\r\n        token.references = Some(name.clone());\r\n\r\n        Ok(Self { name, token }.boxed())\r\n    },\r\n    value = |this: \u0026Identifier, state: \u0026mut State| {\r\n        let value = state.get_variable(\u0026this.name).ok_or(Error::VariableName {\r\n            name: this.name.clone(),\r\n            token: this.token.clone(),\r\n        })?;\r\n        Ok(value)\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    ArrayValue {\r\n        elements: Vec\u003cNode\u003e\r\n    },\r\n    rules = [array_literal],\r\n\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let elements = input\r\n            .into_inner()\r\n            .map(|child| Ok(child.to_ast_node()?))\r\n            .collect::\u003cResult\u003cVec\u003cNode\u003e, Error\u003e\u003e()?;\r\n\r\n        Ok(Self { elements, token }.boxed())\r\n    },\r\n\r\n    value = |this: \u0026ArrayValue, state: \u0026mut State| {\r\n        let values = this.elements.iter().map(|node| node.get_value(state)).collect::\u003cResult\u003cVec\u003c_\u003e, _\u003e\u003e()?;\r\n        Ok(Value::Array(values.into()))\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    ObjectValue {\r\n        pairs: Vec\u003c(Node, Node)\u003e\r\n    },\r\n    rules = [object_literal],\r\n\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let mut pairs: Vec\u003c(Node, Node)\u003e = Vec::new();\r\n        while children.peek().is_some() {\r\n            let key = children.next().unwrap().to_ast_node()?;\r\n            let value = children.next().unwrap().to_ast_node()?;\r\n            pairs.push((key, value));\r\n        }\r\n\r\n        Ok(Self { pairs, token }.boxed())\r\n    },\r\n\r\n    value = |this: \u0026ObjectValue, state: \u0026mut State| {\r\n        let mut object = ObjectInner::new();\r\n        for (key, value) in \u0026this.pairs {\r\n            let key = key.get_value(state)?;\r\n            let value = value.get_value(state)?;\r\n            object.insert(key, value)?;\r\n        }\r\n\r\n        Ok(Value::Object(object.into()))\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    RangeValue {\r\n        start: Node,\r\n        end: Node\r\n    },\r\n    rules = [RANGE_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let start = children\r\n            .next()\r\n            .ok_or(Error::IncompleteRangeExpression {\r\n                token: token.clone(),\r\n            })?\r\n            .to_ast_node()?;\r\n\r\n        children.next().unwrap(); // Skip the ..\r\n\r\n        let end = children\r\n            .next()\r\n            .ok_or(Error::IncompleteRangeExpression {\r\n                token: token.clone(),\r\n            })?\r\n            .to_ast_node()?;\r\n\r\n        Ok(Self { start, end, token }.boxed())\r\n    },\r\n    value = |this: \u0026RangeValue, state: \u0026mut State| {\r\n        let start = this.start.get_value(state)?;\r\n        let end = this.end.get_value(state)?;\r\n\r\n        // We will enforce 3 things here:\r\n        // 1. The start and end must be the same type\r\n        // 2. The start and end must be integer or single character strings\r\n        // 3. The start must be less than or equal to the end\r\n        match (\u0026start, \u0026end) {\r\n            (Value::String(start), Value::String(end)) =\u003e {\r\n                if start.inner().len() != 1 || end.inner().len() != 1 {\r\n                    return Err(Error::InvalidRange {\r\n                        start: start.to_string(),\r\n                        end: end.to_string(),\r\n                        token: this.token.clone(),\r\n                    });\r\n                }\r\n\r\n                let start = start.inner().chars().next().unwrap();\r\n                let end = end.inner().chars().next().unwrap();\r\n\r\n                if start \u003e end {\r\n                    return Err(Error::InvalidRange {\r\n                        start: start.to_string(),\r\n                        end: end.to_string(),\r\n                        token: this.token.clone(),\r\n                    });\r\n                }\r\n\r\n                // as array spanning the range inclusively\r\n                let array = (start..=end)\r\n                    .map(|i| Value::from(i.to_string()))\r\n                    .collect::\u003cVec\u003c_\u003e\u003e();\r\n                Ok(Value::from(array))\r\n            }\r\n\r\n            (Value::I64(start), Value::I64(end)) =\u003e {\r\n                if start \u003e end {\r\n                    return Err(Error::InvalidRange {\r\n                        start: start.to_string(),\r\n                        end: end.to_string(),\r\n                        token: this.token.clone(),\r\n                    });\r\n                }\r\n\r\n                Ok(Value::from(*start.inner()..=*end.inner()))\r\n            }\r\n\r\n            _ =\u003e Err(Error::RangeTypeMismatch {\r\n                token: this.token.clone(),\r\n            }),\r\n        }\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    CastingExpression {\r\n        value: Node,\r\n        target_type: ValueType\r\n    },\r\n    rules = [CASTING_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let value = children.next().unwrap().to_ast_node()?;\r\n        let target_type = children.next().unwrap().as_str();\r\n        let target_type: ValueType = target_type.try_into()?;\r\n\r\n        Ok(Self {\r\n            value,\r\n            target_type,\r\n            token,\r\n        }\r\n        .boxed())\r\n    },\r\n    value = |this: \u0026CastingExpression, state: \u0026mut State| {\r\n        let value = this.value.get_value(state)?;\r\n        Ok(value.as_type(this.target_type)?)\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    DeleteExpression {\r\n        src: String,\r\n        indices: Vec\u003cNode\u003e\r\n    },\r\n    rules = [DELETE_EXPRESSION],\r\n\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        children.next(); // Skip the delete keyword\r\n        let src = children.next().unwrap().as_str().to_string();\r\n        let indices = children\r\n            .map(|child| Ok(child.to_ast_node()?))\r\n            .collect::\u003cResult\u003cVec\u003cNode\u003e, Error\u003e\u003e()?;\r\n\r\n        Ok(Self {\r\n            src,\r\n            indices,\r\n            token,\r\n        }\r\n        .boxed())\r\n    },\r\n\r\n    value = |this: \u0026DeleteExpression, state: \u0026mut State| {\r\n        let mut indices = this.indices.iter().map(|i| i.get_value(state)).collect::\u003cResult\u003cVec\u003c_\u003e, _\u003e\u003e()?;\r\n        if let Some(final_idx) = indices.pop() {\r\n            let mut value = state.get_variable(\u0026this.src).ok_or(Error::VariableName {\r\n                name: this.src.clone(),\r\n                token: this.token.clone(),\r\n            })?;\r\n\r\n            let mut pos = \u0026mut value;\r\n            for index in \u0026mut indices {\r\n                pos = pos.get_index_mut(index)?;\r\n            }\r\n\r\n            let removed = pos.delete_index(\u0026final_idx)?;\r\n            state.set_variable(\u0026this.src, value);\r\n            Ok(removed)\r\n        } else {\r\n            if let Some(function) = state.delete_user_function(\u0026this.src) {\r\n                Ok(function.to_std_function().signature().into())\r\n            } else {\r\n                state.delete_variable(\u0026this.src).ok_or(Error::VariableName {\r\n                    name: this.src.clone(),\r\n                    token: this.token.clone(),\r\n                })\r\n            }\r\n        }\r\n    }\r\n);\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use polyvalue::{\r\n        types::{Object, I64},\r\n        ValueTrait,\r\n    };\r\n\r\n    use super::*;\r\n    use crate::assert_tree;\r\n\r\n    macro_rules! assert_value {\r\n        ($input:literal, $rule:ident, $expected:literal) =\u003e {\r\n            assert_tree!($input, $rule, ValueLiteral, |tree: \u0026mut ValueLiteral| {\r\n                assert_eq!($expected, tree.value.to_string());\r\n            });\r\n        };\r\n    }\r\n\r\n    #[test]\r\n    fn test_currency_literal() {\r\n        assert_value!(\"$1\", currency_literal, \"$1\");\r\n        assert_value!(\"$1.20\", currency_literal, \"$1.20\");\r\n        assert_value!(\"1.20$\", currency_literal, \"$1.20\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_sci_literal() {\r\n        assert_value!(\"1e2\", sci_literal, \"100.0\");\r\n        assert_value!(\"1e-2\", sci_literal, \"0.01\");\r\n        assert_value!(\"1.2e2\", sci_literal, \"120.0\");\r\n        assert_value!(\"1.2e+2\", sci_literal, \"120.0\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_float_literal() {\r\n        assert_value!(\"1.2\", float_literal, \"1.2\");\r\n        assert_value!(\".2\", float_literal, \"0.2\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_hex_literal() {\r\n        assert_value!(\"0x1\", sized_literal, \"1\");\r\n        assert_value!(\"0x1a\", sized_literal, \"26\");\r\n        assert_value!(\"0x1A\", sized_literal, \"26\");\r\n        assert_value!(\"0x1Aa\", sized_literal, \"426\");\r\n        assert_value!(\"0xA0\", sized_literal, \"160\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_bin_literal() {\r\n        assert_value!(\"0b1\", sized_literal, \"1\");\r\n        assert_value!(\"0b10\", sized_literal, \"2\");\r\n        assert_value!(\"0b101\", sized_literal, \"5\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_oct_literal() {\r\n        assert_value!(\"0o1\", sized_literal, \"1\");\r\n        assert_value!(\"0o10\", sized_literal, \"8\");\r\n        assert_value!(\"0o101\", sized_literal, \"65\");\r\n        assert_value!(\"0101\", sized_literal, \"65\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_sized_literal() {\r\n        assert_value!(\"1\", sized_literal, \"1\");\r\n        assert_value!(\"10\", sized_literal, \"10\");\r\n        assert_value!(\"100\", sized_literal, \"100\");\r\n        assert_value!(\"100_000\", sized_literal, \"100000\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_bool_literal() {\r\n        assert_value!(\"true\", bool_literal, \"true\");\r\n        assert_value!(\"false\", bool_literal, \"false\");\r\n        assert_value!(\"TRUe\", bool_literal, \"true\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_string_literal() {\r\n        assert_value!(\"\\\"\\\"\", string_literal, \"\");\r\n        assert_value!(\"\\\"hello\\\"\", string_literal, \"hello\");\r\n        assert_value!(\"\\\"hello world\\\"\", string_literal, \"hello world\");\r\n        assert_value!(\"\\\"hello \\\\\\\"world\\\\\\\"\\\"\", string_literal, \"hello \\\"world\\\"\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_identifier() {\r\n        assert_tree!(\"hello\", identifier, Identifier, |tree: \u0026mut Identifier| {\r\n            assert_eq!(\"hello\", tree.name);\r\n\r\n            let state = \u0026mut State::new();\r\n            state.set_variable(\"hello\", Value::from(1));\r\n            let value = tree.get_value(state).unwrap();\r\n            assert_eq!(1, *value.as_a::\u003cI64\u003e().unwrap().inner());\r\n        });\r\n    }\r\n\r\n    #[test]\r\n    fn test_array_literal() {\r\n        assert_tree!(\r\n            \"[1, 2, 3]\",\r\n            array_literal,\r\n            ArrayValue,\r\n            |tree: \u0026mut ArrayValue| {\r\n                assert_eq!(3, tree.elements.len());\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(\"[1, 2, 3]\", value.to_string());\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_object_literal() {\r\n        assert_tree!(\r\n            \"{'a': 1, 'b': 2, 3: 3}\",\r\n            object_literal,\r\n            ObjectValue,\r\n            |tree: \u0026mut ObjectValue| {\r\n                assert_eq!(3, tree.pairs.len());\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                let obj = value.as_a::\u003cObject\u003e().unwrap();\r\n                assert!(obj.inner().contains_key(\u0026Value::from(\"a\")));\r\n                assert!(obj.inner().contains_key(\u0026Value::from(\"b\")));\r\n                assert!(obj.inner().contains_key(\u0026Value::from(3i64)));\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_range_expression() {\r\n        assert_tree!(\r\n            \"1..3\",\r\n            RANGE_EXPRESSION,\r\n            RangeValue,\r\n            |tree: \u0026mut RangeValue| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(\"1..3\", value.to_string());\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"'a'..'c'\",\r\n            RANGE_EXPRESSION,\r\n            RangeValue,\r\n            |tree: \u0026mut RangeValue| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(\"[a, b, c]\", value.to_string());\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"1..1\",\r\n            RANGE_EXPRESSION,\r\n            RangeValue,\r\n            |tree: \u0026mut RangeValue| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(\"1..1\", value.to_string());\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"'a'..'a'\",\r\n            RANGE_EXPRESSION,\r\n            RangeValue,\r\n            |tree: \u0026mut RangeValue| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(\"[a]\", value.to_string());\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"1..0\",\r\n            RANGE_EXPRESSION,\r\n            RangeValue,\r\n            |tree: \u0026mut RangeValue| {\r\n                let value = tree.get_value(\u0026mut State::new());\r\n                assert!(value.is_err());\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"'c'..'a'\",\r\n            RANGE_EXPRESSION,\r\n            RangeValue,\r\n            |tree: \u0026mut RangeValue| {\r\n                let value = tree.get_value(\u0026mut State::new());\r\n                assert!(value.is_err());\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"1..1.5\",\r\n            RANGE_EXPRESSION,\r\n            RangeValue,\r\n            |tree: \u0026mut RangeValue| {\r\n                let value = tree.get_value(\u0026mut State::new());\r\n                assert!(value.is_err());\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_delete() {\r\n        let mut state = State::new();\r\n        state.set_variable(\"a\", Value::from(1));\r\n        state.set_variable(\"b\", Value::from(vec![Value::from(2)]));\r\n        state.set_variable(\r\n            \"c\",\r\n            Value::from(vec![Value::from(2), Value::from(vec![Value::from(2)])]),\r\n        );\r\n\r\n        assert_tree!(\r\n            \"delete a\",\r\n            DELETE_EXPRESSION,\r\n            DeleteExpression,\r\n            |tree: \u0026mut DeleteExpression| {\r\n                let value = tree.get_value(\u0026mut state).unwrap();\r\n                assert_eq!(Value::from(1), value);\r\n                assert!(state.get_variable(\"a\").is_none());\r\n            }\r\n        );\r\n        assert_tree!(\r\n            \"delete b[0]\",\r\n            DELETE_EXPRESSION,\r\n            DeleteExpression,\r\n            |tree: \u0026mut DeleteExpression| {\r\n                let value = tree.get_value(\u0026mut state).unwrap();\r\n                assert_eq!(Value::from(2), value);\r\n                assert_eq!(state.get_variable(\"b\").unwrap().to_string(), \"[]\");\r\n            }\r\n        );\r\n        assert_tree!(\r\n            \"delete c[1][0]\",\r\n            DELETE_EXPRESSION,\r\n            DeleteExpression,\r\n            |tree: \u0026mut DeleteExpression| {\r\n                let value = tree.get_value(\u0026mut state).unwrap();\r\n                assert_eq!(Value::from(2), value);\r\n                assert_eq!(state.get_variable(\"c\").unwrap().to_string(), \"[2, []]\");\r\n            }\r\n        );\r\n    }\r\n}\r\n","traces":[{"line":13,"address":[],"length":0,"stats":{"Line":14},"fn_name":null},{"line":15,"address":[],"length":0,"stats":{"Line":14},"fn_name":null},{"line":16,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":22,"address":[],"length":0,"stats":{"Line":14},"fn_name":null},{"line":23,"address":[],"length":0,"stats":{"Line":14},"fn_name":null},{"line":24,"address":[],"length":0,"stats":{"Line":14},"fn_name":null},{"line":29,"address":[],"length":0,"stats":{"Line":14},"fn_name":null},{"line":31,"address":[],"length":0,"stats":{"Line":28},"fn_name":null},{"line":32,"address":[]," 03e, src: String) -\u003e Result\u003cSelf, Error\u003e {\r\n        // Check that the function is valid\r\n        cached_fn_compile(\u0026src)?;\r\n\r\n        let inst = Self {\r\n            name: name.to_string(),\r\n            arguments,\r\n            src,\r\n        };\r\n\r\n        Ok(inst)\r\n    }\r\n\r\n    /// Returns the name of this function\r\n    pub fn name(\u0026self) -\u003e \u0026str {\r\n        \u0026self.name\r\n    }\r\n\r\n    /// Returns the arguments of this function\r\n    pub fn arguments(\u0026self) -\u003e \u0026[String] {\r\n        \u0026self.arguments\r\n    }\r\n\r\n    /// Returns the source of this function\r\n    pub fn src(\u0026self) -\u003e \u0026str {\r\n        \u0026self.src\r\n    }\r\n\r\n    /// Returns the body of this function\r\n    pub fn body(\u0026self) -\u003e Rc\u003cNode\u003e {\r\n        cached_fn_compile(\u0026self.src).unwrap()\r\n    }\r\n\r\n    /// Executes this function\r\n    pub fn execute(\r\n        \u0026self,\r\n        state: \u0026mut State,\r\n        arguments: Vec\u003cValue\u003e,\r\n        token: \u0026Token,\r\n    ) -\u003e Result\u003cValue, Error\u003e {\r\n        // Create a new scope\r\n        state.scope_into(token)?;\r\n\r\n        // Set the arguments\r\n        for (name, value) in self.arguments.iter().zip(arguments) {\r\n            state.set_variable(name, value);\r\n        }\r\n\r\n        // Execute the body - this is checked in the constructor\r\n        // so we can unwrap here\r\n        let body_result = self.body().get_value(state);\r\n        state.scope_out();\r\n\r\n        body_result\r\n    }\r\n\r\n    /// Converts this function into a standard function\r\n    pub fn to_std_function(\u0026self) -\u003e Function {\r\n        Function::new(\r\n            \u0026self.name,\r\n            \u0026self.src(),\r\n            \"user-defined\",\r\n            self.arguments()\r\n                .iter()\r\n                .map(|s| required_argument!(s, ValueType::Any)) ebug)]\r\npub struct ErrorWithToken {\r\n    /// Token that caused the error\r\n    pub token: Token,\r\n\r\n    /// Error that occurred\r\n    pub source: Error,\r\n}\r\nimpl std::error::Error for ErrorWithToken {}\r\nimpl std::fmt::Display for ErrorWithToken {\r\n    fn fmt(\u0026self, f: \u0026mut std::fmt::Formatter\u003c'_\u003e) -\u003e std::fmt::Result {\r\n        write!(f, \"\\n| {}\\n= {}\", self.token, self.source)\r\n    }\r\n}\r\n\r\nconst BUG_REPORT_URL : \u0026str = \"https://github.com/rscarson/lavendeux-parser/issues/new?assignees=\u0026labels=\u0026template=bug_report.md\u0026title=\";\r\n\r\n/// Represents the errors that can occur during parsing\r\n#[derive(Error, Debug)]\r\n#[rustfmt::skip]\r\npub enum Error {\r\n    /// An error caused by a problem with the parser itself\r\n    #[error(\r\n        \"Internal parser issue: {0}\\nPlease report this problem at {}\",\r\n        BUG_REPORT_URL\r\n    )]\r\n    Internal(String),\r\n\r\n    /// Error causing the parser thread to panic\r\n    #[error(\"Fatal error: {0}\")]\r\n    Fatal(String),\r\n\r\n    /// A timeout error caused by a script taking too long to execute\r\n    #[error(\"Script execution timed out\")]\r\n    Timeout,\r\n\r\n    /// An error caused by a custom error message\r\n    #[error(\"{0}\")]\r\n    Custom(String),\r\n\r\n    ///////////////////////////////////////////////////////////////////////////\r\n    // Syntax Errors\r\n    // Deals with issues during Pest tree parsing\r\n    ///////////////////////////////////////////////////////////////////////////\r\n\r\n    /// An error caused by using a decorator in the wrong place\r\n    #[error(\"\\n| {token}\\n= @decorators must be at the end of a statement\")]\r\n    UnexpectedDecorator {\r\n        token: Token,\r\n    },\r\n\r\n    /// An error caused by using a postfix operator without an operand\r\n    #[error(\"\\n| {token}\\n= Expected '*/'\")]\r\n    UnterminatedComment{\r\n        token: Token,\r\n    },\r\n\r\n    /// An error caused by a missing bracket\r\n    #[error(\"\\n| {token}\\n= Expected ']'\")]\r\n    UnterminatedArray{\r\n        token: Token,\r\n    },\r\n\r\n    /// An error caused by a missing brace\r\n    #[error(\"\\n| {token}\\n= Expected '}}'\")]\r\n    UnterminatedObject{\r\n        token: Token,\r\n    },\r\n\r\n    /// An error caused by ending a script on a backslash\r\n    #[error(\"\\n| {token}\\n= Missing linebreak after '\\\\'\")]\r\n    UnterminatedLinebreak{\r\n        token: Token,\r\n    },\r\n\r\n    /// An error caused by a missing quote\r\n    #[error(\"\\n| {token}\\n= Expected ' or \\\"\")]\r\n    UnterminatedLiteral{\r\n        token: Token,\r\n    },\r\n\r\n    /// An error caused by a missing parentheses\r\n    #[error(\"\\n| {token}\\n= Expected ')'\")]\r\n    UnterminatedParen{\r\n        token: Token,\r\n    },\r\n\r\n    #[error(\"\\n| {token}\\n= Expected a pattern to match against (an array, value, or regex literal)\")]\r\n    IncompleteMatchingExpression{\r\n        token: Token,\r\n    },\r\n\r\n    #[error(\"\\n| {token}\\n= Expected 2 bounds for range expression, for example: 1..2 or 'a'..'z'\")]\r\n    IncompleteRangeExpression{\r\n        token: Token,\r\n    },\r\n\r\n    #[error(\"\\n| {token}\\n= Expected a key-value pair, for example: {{0: 'test'}}\")]\r\n    IncompleteObject {\r\n        token: Token,\r\n    },\r\n\r\n    #[error(\"\\n| {token}\\n= Match expression is not exhaustive. Add a default case '_' to match all values\")]\r\n    NonExhaustiveSwitch {\r\n        token: Token,\r\n    },\r\n\r\n    #[error(\"\\n| {token}\\n= All cases after the default case '_' are unreachable\")]\r\n    UnreachableSwitchCase {\r\n        token: Token,\r\n    },\r\n\r\n    #[error(\"\\n| {token}\\n= {case} is not valid for this switch statement. Expected a {expected_type}\")]\r\n    SwitchCaseTypeMismatch {\r\n        case: Value,\r\n        expected_type: ValueType,\r\n        token: Token,\r\n    },\r\n\r\n    ////////////////////////////// OnceLock\u003cMutex\u003cExtensionController\u003e\u003e = OnceLock::new();\r\n\r\npub struct ExtensionController {\r\n    /// Stores the actual extension worker threads\r\n    /// indexed by filename\r\n    extensions: HashMap\u003cString, ExtensionWorker\u003e,\r\n\r\n    /// Maps function names to their respective extensions\r\n    /// for faster lookup\r\n    function_map: HashMap\u003cString, String\u003e,\r\n}\r\n\r\nimpl ExtensionController {\r\n    /// Create a new extension controller\r\n    pub fn new() -\u003e Self {\r\n        Self {\r\n            extensions: HashMap::new(),\r\n            function_map: HashMap::new(),\r\n        }\r\n    }\r\n\r\n    /// Execute some code on the runtime instance\r\n    pub fn exec(code: \u0026str) -\u003e Result\u003cValue, Error\u003e {\r\n        let result: serde_json::Value = rustyscript::evaluate(code)?;\r\n        Ok(Value::try_from(result)?)\r\n    }\r\n\r\n    /// Perform an operation on the runtime instance\r\n    /// Will return T if we can get access to the runtime\r\n    /// or panic went wrong\r\n    pub fn with\u003cT, F: FnOnce(\u0026mut ExtensionController) -\u003e T\u003e(callback: F) -\u003e T {\r\n        let mutex = RUNTIME_CELL.get_or_init(|| Mutex::new(ExtensionController::new()));\r\n        let mut guard = mutex.lock().unwrap();\r\n        callback(\u0026mut *guard)\r\n    }\r\n\r\n    pub fn add_extension(\u0026mut self, module: Module) -\u003e Result\u003cExtensionDetails, Error\u003e {\r\n        let filename = module.filename().to_string();\r\n        let worker = ExtensionWorker::new(module)?;\r\n\r\n        // Update the function map\r\n        for name in \u0026worker.extension().function_names() {\r\n            self.function_map.insert(name.clone(), filename.clone());\r\n        }\r\n\r\n        let extension = worker.extension().clone();\r\n        self.extensions.insert(filename, worker);\r\n        Ok(extension)\r\n    }\r\n\r\n    /// Register an extension\r\n    pub fn register(\u0 ame\r\n    }\r\n\r\n    pub fn arguments(\u0026self) -\u003e \u0026[ValueType] {\r\n        \u0026self.arguments\r\n    }\r\n\r\n    pub fn returns(\u0026self) -\u003e \u0026ValueType {\r\n        \u0026self.returns\r\n    }\r\n\r\n    pub fn description(\u0026self) -\u003e \u0026str {\r\n        \u0026self.description\r\n    }\r\n\r\n    pub fn signature(\u0026self) -\u003e String {\r\n        if self.name.starts_with('@') {\r\n            return format!(\"\u003c{}\u003e @{}\", self.arguments[0], self.name);\r\n        } else {\r\n            let str_args = self\r\n                .arguments\r\n                .iter()\r\n                .map(|a| a.to_string())\r\n                .collect::\u003cVec\u003cString\u003e\u003e()\r\n                .join(\", \");\r\n            format!(\"{}({}) -\u003e {}\", self.name, str_args, self.returns)\r\n        }\r\n    }\r\n\r\n    pub fn call(\r\n        \u0026self,\r\n        runtime: \u0026mut Runtime,\r\n        handle: \u0026ModuleHandle,\r\n        args: \u0026[Value],\r\n        variables: \u0026mut HashMap\u003cString, Value\u003e,\r\n        token: \u0026Token,\r\n    ) -\u003e Result\u003cValue, Error\u003e {\r\n        if args.len() \u003c self.arguments.len() {\r\n            return Err(Error::FunctionArguments {\r\n                min: self.arguments.len(),\r\n                max: self.arguments.len(),\r\n                signature: self.signature(),\r\n                token: token.clone(),\r\n            });\r\n        }\r\n\r\n        for (i, arg) in self.arguments.iter().enumerate() {\r\n            let actual_type = \u0026args[i];\r\n            if !actual_type.is_a(*arg) {\r\n                return Err(Error::FunctionArgumentType {\r\n                    arg: i + 1,\r\n                    expected_type: *arg,\r\n                    signature: self.signature(),\r\n                    token: token.clone(),\r\n                });\r\n            }\r\n        }\r\n\r\n        // Fixed and currency types will be pass
