r\n    }\r\n\r\n    pub fn all_functions(\u0026self) -\u003e \u0026HashMap\u003cString, FunctionDefinition\u003e {\r\n        \u0026self.functions\r\n    }\r\n\r\n    pub fn function_names(\u0026self) -\u003e Vec\u003cString\u003e {\r\n        self.functions.keys().cloned().collect()\r\n    }\r\n\r\n    pub fn call_function(\r\n        \u0026self,\r\n        runtime: \u0026mut Runtime,\r\n        handle: \u0026ModuleHandle,\r\n        name: \u0026str,\r\n        args: \u0026[Value],\r\n        variables: \u0026mut HashMap\u003cString, Value\u003e,\r\n        token: \u0026Token,\r\n    ) -\u003e Result\u003cValue, Error\u003e {\r\n        let function = self.functions.get(name).ok_or(Error::FunctionName {\r\n            name: name.to_string(),\r\n            token: token.clone(),\r\n        })?;\r\n\r\n        function.call(runtime, handle, args, variables, token)\r\n    }\r\n}\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use rustyscript::Module;\r\n\r\n    use super::super::runtime::ExtensionRuntime;\r\n    use super::*;\r\n\r\n    fn fake_token() -\u003e Token {\r\n        Token {\r\n            rule: crate::pest::Rule::ATOMIC_VALUE,\r\n            input: \"fake\".to_string(),\r\n            references: None,\r\n        }\r\n    }\r\n\r\n    #[test]\r\n    fn test_load_simple() {\r\n        let module = Module::load(\"example_extensions/simple_extension.js\").unwrap();\r\n        let mut runtime = ExtensionRuntime::new(module).unwrap();\r\n        assert_eq!(runtime.extension_details().name(), \"Simple Extension\");\r\n        assert_eq!(runtime.extension_details().author(), \"@rscarson\");\r\n        assert_eq!(runtime.extension_details().version(), \"1.0.0\");\r\n        assert_eq!(runtime.extension_details().function_names().len(), 2);\r\n\r\n        let mut variables = HashMap::new();\r\n\r\n        let result = runtime\r\n            .call_function(\r\n                \"add\",\r\n                \u0026[super::Value::from(1.0), super::Value::from(2.0)],\r\n content":"mod error;\nmod lavendeux;\nmod pest;\nmod state;\nmod std_functions;\nmod syntax_tree;\nmod token;\nmod user_function;\n\n#[cfg(feature = \"network-functions\")]\nmod network_utils;\n\n#[cfg(feature = \"extensions\")]\npub use rustyscript;\n\n#[cfg(feature = \"extensions\")]\nmod extensions;\n\nuse pest::{parse_input, AstNode, Rule, ToAstNode};\nuse syntax_tree::Node;\nuse token::ToToken;\n\n#[cfg(feature = \"extensions\")]\npub use extensions::ExtensionDetails;\n\npub use error::{Error, ErrorWithToken};\npub use lavendeux::{Lavendeux, ParserOptions};\npub use polyvalue::Value;\npub use state::State;\npub use token::Token;\n","traces":[],"covered":0,"coverable":0},{"path":["C:","\\","Users","rcarson1","Repositories","lavendeux_workspace","lavendeux_parser","src","network_utils.rs"],"content":"use polyvalue::types::{Object, ObjectInner, Str};\r\nuse polyvalue::{Value, ValueTrait};\r\nuse std::collections::HashMap;\r\nuse std::net::ToSocketAddrs;\r\nuse std::str::FromStr;\r\nuse std::time::Duration;\r\n\r\n/// Resolve a hostname to an IP address\r\n///\r\n/// # Arguments\r\n/// * `hostname` - Host to resolve\r\npub fn resolve(hostname: \u0026str) -\u003e Result\u003cValue, std::io::Error\u003e {\r\n    match (hostname, 0).to_socket_addrs() {\r\n        Ok(mut addresses) =\u003e {\r\n            let address = addresses.next().unwrap().to_string();\r\n            let suffix = \":\".to_string() + address.split(':').last().unwrap_or(\"80\");\r\n\r\n            Ok(Value::from(address.replace(\u0026suffix, \"\")))\r\n        }\r\n        Err(e) =\u003e Err(e),\r\n    }\r\n}\r\n\r\nfn decode_response(response: \u0026str, headers: \u0026HashMap\u003cString, String\u003e) -\u003e Value {\r\n    let json_decode = headers.get(\"Content-Type\").cloned().unwrap_or_default()\r\n        == \"application/json\"\r\n        || headers.get(\"content-type\").cloned().unwrap_or_default() == \"application/json\";\r\n    if json_decode {\r\n        if let Ok(v) = serde_json::Value::from_str(response) {\r\n            if let Ok(v) = Value::try_from(v) {\r\n                return v;\r\n            }\r\n        }\r\n    }\r\n\r\n    Value::from(response)\r\n}\r\n\r\n/// Fetch from a given URL\r\n///\r\n/// # Arguments\r\n/// * `url` - Target URL\r\n/// * `body` - Body if POST\r\n/// * `headers` - Array of header=value strings\r\npub fn request(\r\n    url: \u0026str,\r\n    body: Option\u003cString\u003e,\r\n    headers: HashMap\u003cString, String\u003e,\r\n) -\u003e Result\u003cValue, reqwest::Error\u003e {\r\n    match reqwest::blocking::Client::builder()\r\n        .timeout(Duration::from_millis(1500))\r\n        .build()\r\n    {\r\n        Ok(client) =\u003e {\r\n            let mut request = match body {\r\n                None =\u003e client.get(url),\r\n                Some(s) =\u003e client.post(url).body(s),\r\n            };\r\n\r\n            for (header, value) in headers.iter() {\r\n                request = request.header(header, value);\r\n            }\r\n\r\n            match request.send() {\r\n                Ok(res) =\u003e match res.text() {\r\n                    Ok(s) =\u003e {\r\n                        let value = decode_response(\u0026s, \u0026headers);\r\n                        Ok(value)\r\n                    }\r\n                    Err(e) =\u003e Err(e),\r\n                },\r\n                Err(e) =\u003e Err(e),\r\n            }\r\n        }\r\n        Err(e) =\u003e Err(e),\r\n    }\r\n}\r\n\r\n#[derive(Debug, Clone)]\r\npub struct ApiDefinition {\r\n    pub base_url: String,\r\n    pub additional_headers: HashMap\u003cString, String\u003e,\r\n    pub description: String,\r\n    pub examples: String,\r\n    pub auth_key: Option\u003cString\u003e,\r\n}\r\n\r\nimpl ApiDefinition {\r\n    pub fn base_url(\u0026self) -\u003e \u0026str {\r\n        \u0026self.base_url\r\n    }\r\n    pub fn additional_headers(\u0026self) -\u003e \u0026HashMap\u003cString, String\u003e {\r\n        \u0026self.additional_headers\r\n    }\r\n    pub fn description(\u0026self) -\u003e \u0026str {\r\n        \u0026self.description\r\n    }\r\n    pub fn examples(\u0026self) -\u003e \u0026str {\r\n        \u0026self.examples\r\n    }\r\n    pub fn auth_key(\u0026self) -\u003e \u0026Option\u003cString\u003e {\r\n        \u0026self.auth_key\r\n    }\r\n\r\n    pub fn to_polyvalue(\u0026self) -\u003e Result\u003cValue, crate::Error\u003e {\r\n        let mut value = Object::try_from(vec![\r\n            (Value::from(\"url\"), Value::from(self.base_url())),\r\n            (\r\n                Value::from(\"headers\"),\r\n                Value::try_from(\r\n                    self.additional_headers()\r\n                        .iter()\r\n                        .map(|(k, v)| (Value::from(k.as_str()), Value::from(v.as_str())))\r\n                        .collect::\u003cVec\u003c(Value, Value)\u003e\u003e(),\r\n                )?,\r\n            ),\r\n            (Value::from(\"description\"), Value::from(self.description())),\r\n            (Value::from(\"examples\"), Value::from(self.examples())),\r\n        ])?;\r\n\r\n        if let Some(auth_key) = self.auth_key() {\r\n            value.insert(Value::from(\"auth_key\"), Value::from(auth_key.as_str()))?;\r\n        }\r\n\r\n        Ok(value.into())\r\n    }\r\n\r\n    pub fn from_value(value: Value) -\u003e Option\u003cSelf\u003e {\r\n        match value {\r\n            Value::String(url) =\u003e Some(ApiDefinition {\r\n                base_url: url.to_string(),\r\n                additional_headers: HashMap::new(),\r\n                description: \"\".to_string(),\r\n                examples: \"\".to_string(),\r\n                auth_key: None,\r\n            }),\r\n\r\n            Value::Object(mut obj) =\u003e {\r\n                let base_url = obj\r\n                    .remove(\u0026Value::from(\"url\"))\r\n                    .unwrap_or(Value::from(\"\"))\r\n                    .as_a::\u003cStr\u003e()\r\n                    .ok()?\r\n                    .to_string();\r\n                let description = obj\r\n                    .remove(\u0026Value::from(\"description\"))\r\n                    .unwrap_or(Value::from(\"\"))\r\n                    .as_a::\u003cStr\u003e()\r\n                    .ok()?\r\n                    .to_string();\r\n                let examples = obj\r\n                    .remove(\u0026Value::from(\"examples\"))\r\n                    .unwrap_or(Value::from(\"\"))\r\n                    .as_a::\u003cStr\u003e()\r\n                    .ok()?\r\n                    .to_string();\r\n                let auth_key = obj\r\n                    .remove(\u0026Value::from(\"auth_key\"))\r\n                    .and_then(|v| Some(v.as_a::\u003cStr\u003e().unwrap().to_string()));\r\n\r\n                let additional_headers = obj\r\n                    .remove(\u0026Value::from(\"headers\"))\r\n                    .unwrap_or(Value::from(ObjectInner::new()))\r\n                    .as_a::\u003cObject\u003e()\r\n                    .ok()?\r\n                    .inner()\r\n                    .iter()\r\n                    .map(|(k, v)| {\r\n                        (\r\n                            k.as_a::\u003cStr\u003e().unwrap().to_string(),\r\n                            v.as_a::\u003cStr\u003e().unwrap().to_string(),\r\n                        )\r\n                    })\r\n                    .collect::\u003cHashMap\u003cString, String\u003e\u003e();\r\n\r\n                Some(ApiDefinition {\r\n                    base_url,\r\n                    additional_headers,\r\n                    description,\r\n                    examples,\r\n                    auth_key,\r\n                })\r\n            }\r\n\r\n            _ =\u003e None,\r\n        }\r\n    }\r\n\r\n    pub fn call(\r\n        \u0026self,\r\n        endpoint: Option\u003c\u0026str\u003e,\r\n        body: Option\u003cString\u003e,\r\n        mut headers: HashMap\u003cString, String\u003e,\r\n    ) -\u003e Result\u003cValue, reqwest::Error\u003e {\r\n        let target = format!(\"{}{}\", self.base_url(), endpoint.unwrap_or_default());\r\n        if let Some(auth_key) = \u0026self.auth_key {\r\n            headers.insert(\"Authorization\".to_string(), format!(\"Bearer {}\", auth_key));\r\n        }\r\n\r\n        request(\u0026target, body, headers)\r\n    }\r\n}\r\n\r\nmacro_rules! define_api {\r\n    ($state:expr, name = $name:literal, url = $url:literal, additional_headers = [$($key:literal:$value:literal),*], description = $description:literal, examples = $examples:literal) =\u003e {\r\n        ApiManager::set(\r\n            $state,\r\n            $name,\r\n            ApiDefinition {\r\n                base_url: $url.to_string(),\r\n                additional_headers: HashMap::from([$((\r\n                    $key.to_string(),\r\n                    $value.to_string(),\r\n                )),*]),\r\n                description: $description.to_string(),\r\n                examples: $examples.to_string(),\r\n                auth_key: None,\r\n            },\r\n        )\r\n        .ok();\r\n    };\r\n}\r\n\r\n/// Manager that stores API definitions within the program state\r\n///\r\npub struct ApiManager();\r\nimpl ApiManager {\r\n    const STORE_NAME: \u0026'static str = \"__api_definitions\";\r\n    pub fn retrieve_store(state: \u0026crate::State) -\u003e HashMap\u003cString, ApiDefinition\u003e {\r\n        let store = state\r\n            .get_variable(Self::STORE_NAME)\r\n            .unwrap_or(Object::default().into())\r\n            .as_a::\u003cObject\u003e()\r\n            .unwrap()\r\n            .inner()\r\n            .clone();\r\n        store\r\n            .iter()\r\n            .map(|(k, v)| {\r\n                (\r\n                    k.as_a::\u003cStr\u003e().unwrap().to_string(),\r\n                    ApiDefinition::from_value(v.clone()),\r\n                )\r\n            })\r\n            .filter(|(_, v)| v.is_some())\r\n            .map(|(k, v)| (k, v.unwrap()))\r\n            .collect::\u003cHashMap\u003cString, ApiDefinition\u003e\u003e()\r\n    }\r\n\r\n    pub fn store(\r\n        state: \u0026mut crate::State,\r\n        api_definitions: HashMap\u003cString, ApiDefinition\u003e,\r\n    ) -\u003e Result\u003c(), crate::Error\u003e {\r\n        let mut store = Object::default();\r\n        for (k, v) in api_definitions.iter() {\r\n            store.insert(Value::from(k.as_str()), v.to_polyvalue()?)?;\r\n        }\r\n        state.set_variable(Self::STORE_NAME, store.into());\r\n        Ok(())\r\n    }\r\n\r\n    pub fn get(state: \u0026crate::State, name: \u0026str) -\u003e Option\u003cApiDefinition\u003e {\r\n        Self::retrieve_store(state).get(name).cloned()\r\n    }\r\n\r\n    pub fn set(\r\n        state: \u0026mut crate::State,\r\n        name: \u0026str,\r\n        api_definition: ApiDefinition,\r\n    ) -\u003e Result\u003c(), crate::Error\u003e {\r\n        let mut store = Self::retrieve_store(state);\r\n        store.insert(name.to_string(), api_definition);\r\n        Self::store(state, store)\r\n    }\r\n\r\n    pub fn delete(state: \u0026mut crate::State, name: \u0026str) -\u003e Result\u003c(), crate::Error\u003e {\r\n        let mut store = Self::retrieve_store(state);\r\n        store.remove(name);\r\n        Self::store(state, store)\r\n    }\r\n\r\n    pub fn list(state: \u0026crate::State) -\u003e Result\u003cVec\u003cString\u003e, crate::Error\u003e {\r\n        Ok(Self::retrieve_store(state)\r\n            .keys()\r\n            .map(|k| k.to_string())\r\n            .collect::\u003cVec\u003cString\u003e\u003e())\r\n    }\r\n\r\n    pub fn add_key_for(state: \u0026mut crate::State, name: \u0026str, key: \u0026str) {\r\n        if let Some(mut api_definition) = Self::get(state, name) {\r\n            api_definition.auth_key = Some(key.to_string());\r\n            Self::set(state, name, api_definition).ok();\r\n        }\r\n    }\r\n\r\n    pub fn default_apis(state: \u0026mut crate::State) {\r\n        define_api!(\r\n            state,\r\n            name = \"httpbin\",\r\n            url = \"https://httpbin.org\",\r\n            additional_headers = [],\r\n            description = \"A simple HTTP Request \u0026 Response Service.\",\r\n            examples = \"https://httpbin.org\"\r\n        );\r\n\r\n        define_api!(\r\n            state,\r\n            name = \"ipify\",\r\n            url = \"https://api.ipify.org\",\r\n            additional_headers = [],\r\n            description = \"A simple public IP address API.\",\r\n            examples = \"https://api.ipify.org\"\r\n        );\r\n\r\n        define_api!(\r\n            state,\r\n            name = \"ipinfo\",\r\n            url = \"https://ipinfo.io\",\r\n            additional_headers = [],\r\n            description = \"Find out your public and private IP addresses.\",\r\n            examples = \"https://ipinfo.io\"\r\n        );\r\n\r\n        define_api!(\r\n            state,\r\n            name = \"ipapi\",\r\n            url = \"https://ipapi.co\",\r\n            additional_headers = [],\r\n            description = \"IP address location API and geolocation service.\",\r\n            examples = \"https://ipapi.co\"\r\n        );\r\n\r\n        define_api!(\r\n            state,\r\n            name = \"chatgpt\",\r\n            url = \"https://api.openai.com/v1/chat/completions\",\r\n            additional_headers = [\r\n                \"Content-Type\": \"application/json\"\r\n            ],\r\n            description = \"Chat with GPT-3.5\",\r\n            examples = \"chatgpt('hello world')\"\r\n        );\r\n    }\r\n}\r\n#[cfg(test)]\r\nmod test {\r\n    use super::*;\r\n\r\n    #[test]\r\n    fn test_api_definition() {\r\n        let api = ApiDefinition {\r\n            base_url: \"https://example.com\".to_string(),\r\n            additional_headers: HashMap::from([(\"key\".to_string(), \"value\".to_string())]),\r\n            description: \"A test API\".to_string(),\r\n            examples: \"https://example.com\".to_string(),\r\n            auth_key: Some(\"test_key\".to_string()),\r\n        };\r\n\r\n        let value = api.to_polyvalue().unwrap();\r\n        let api2 = ApiDefinition::from_value(value).unwrap();\r\n\r\n        assert_eq!(api.base_url, api2.base_url);\r\n        assert_eq!(api.additional_headers, api2.additional_headers);\r\n        assert_eq!(api.description, api2.description);\r\n        assert_eq!(api.examples, api2.examples);\r\n        assert_eq!(api.auth_key, api2.auth_key);\r\n\r\n        let value = Value::from(\"https://example.com\");\r\n        let api2 = ApiDefinition::from_value(value).unwrap();\r\n        assert_eq!(api2.base_url, \"https://example.com\");\r\n\r\n        // mock server with mockito\r\n        let mut server = mockito::Server::new();\r\n        let mock = server\r\n            .mock(\"GET\", \"/\")\r\n            .with_status(200)\r\n            .with_header(\"content-type\", \"text/plain\")\r\n            .with_body(\"hello world\")\r\n            .create();\r\n\r\n        let url = format!(\"http://{}\", server.host_with_port());\r\n        let result = ApiDefinition::from_value(url.into())\r\n            .unwrap()\r\n            .call(None, None, Default::default())\r\n            .unwrap();\r\n        assert_eq!(result.to_string(), \"hello world\");\r\n\r\n        mock.assert();\r\n\r\n        let mock = server\r\n            .mock(\"GET\", \"/json\")\r\n            .with_status(200)\r\n            .with_header(\"content-type\", \"text/plain\")\r\n            .with_body(\"{\\\"hello\\\": \\\"world\\\"}\")\r\n            .create();\r\n\r\n        // create headers hashmap with content-type json\r\n        let mut headers = HashMap::new();\r\n        headers.insert(\"content-type\".to_string(), \"application/json\".to_string());\r\n\r\n        let url = format!(\"http://{}\", server.host_with_port());\r\n        let result = ApiDefinition::from_value(url.into())\r\n ctly expose this to the user, but instead use it to\r\n/// parse the input into a syntax tree\r\n#[derive(Parser)]\r\n#[grammar = \"grammar.pest\"]\r\nstruct LavendeuxParser;\r\n\r\n/// A macro to assert that the given input parses into the expected AST node\r\n/// # Arguments\r\n/// * `input` - The input to parse\r\n/// * `rule` - The rule to parse the input with\r\n/// * `expected` - The expected AST node\r\n/// * `hnd` - A handler to run on the AST node\r\n///\r\n/// You can also pass in an existing tree instead of an input and rule\r\n#[macro_export]\r\nmacro_rules! assert_tree {\r\n    ($input:literal, $rule:ident, $expected:ty, $hnd:expr) =\u003e {\r\n        match $crate::parse_input($input, Rule::$rule) {\r\n            Ok(mut tree) =\u003e {\r\n                $crate::assert_tree!(\u0026mut tree, $expected, $hnd);\r\n            }\r\n            Err(err) =\u003e panic!(\"Parsing error: {}\", err),\r\n        }\r\n    };\r\n\r\n    ($tree:expr, $expected:ty, $hnd:expr) =\u003e {\r\n        $tree\r\n            .as_any_mut()\r\n            .downcast_mut::\u003c$expected\u003e()\r\n            .ok_or(Error::Internal(format!(\r\n                \"Could not downcast to requested type\"\r\n            )))\r\n            .and_then(|tree| {\r\n                ($hnd)(tree);\r\n                Ok(())\r\n            })\r\n            .expect(\u0026format!(\r\n                \"Expected a {} but got a {:?}\",\r\n                stringify!($expected),\r\n                $tree.token().rule,\r\n            ))\r\n    };\r\n}\r\n\r\n#[macro_export]\r\nmacro_rules! node_is_type {\r\n    ($node:expr, $type:path) =\u003e {\r\n        $node.as_any().downcast_ref::\u003c$type\u003e().is_some()\r\n    };\r\n}\r\n\r\n/// A macro to assert that the given input parses into an error\r\n/// # Arguments\r\n/// * `input` - The input to parse\r\n/// * `err` - The expected error\r\n#[macro_export]\r\nmacro_rules! assert_tree_error {\r\n    ($input:literal, $err:ident) =\u003e {\r\n        if let Err(err) = $crate::parse_input($input, Rule::SCRIPT) {\r\n            if !matches!(err, Error::$err { .. }) {\r\n                panic!(\"Expected error {:?} but got {:?}\", stringify!($err), err);\r\n            }\r\n        } else {\r\n            panic!(\"Expected error\");\r\n        }\r\n    };\r\n}\r\n\r\n/// A trait for all nodes in the syntax tree\r\n/// The trait is used to build the AST, and to evaluate it by getting the\r\n/// value of each node\r\npub trait AstNode: std::fmt::Display + std::fmt::Debug {\r\n    fn from_pair(input: Pair\u003cRule\u003e) -\u003e Result\u003cNode, Error\u003e\r\n    where\r\n        Self: Sized;\r\n    fn get_value(\u0026self, state: \u0026mut State) -\u003e Result\u003cValue, Error\u003e;\r\n    fn token(\u0026self) -\u003e \u0026Token;\r\n    fn boxed(self) -\u003e Node\r\n    where\r\n        Self: Sized + 'static;\r\n\r\n    fn as_any(\u0026self) -\u003e \u0026dyn std::any::Any;\r\n    fn as_any_mut(\u0026mut self) -\u003e \u0026mut dyn std::any::Any;\r\n}\r\n\r\n/// A trait used to convert a pest pair into an AST node\r\n/// This is used to build the AST\r\npub trait ToAstNode {\r\n    fn to_ast_node(self) -\u003e Result\u003cBox\u003cdyn AstNode\u003e, Error\u003e;\r\n}\r\nimpl ToAstNode for Pair\u003c'_, Rule\u003e {\r\n    /// Convert a pest pair into an AST node\r\n    /// This maps all the rules to AST Node structures\r\n    fn to_ast_node(self) -\u003e Result\u003cBox\u003cdyn AstNode\u003e, Error\u003e {\r\n        let mut target = self;\r\n\r\n        // Bypass single-child nodes\r\n        // They should not be parsed into a node directly\r\n        // Except for the script and line nodes, which are allowed to be single-child\r\n        // objects and arrays are also allowed to be single-child, as they can have one element\r\n        while target.clone().into_inner().count() == 1\r\n            \u0026\u0026 target.as_rule() != Rule::SCRIPT\r\n            \u0026\u0026 target.as_rule() != Rule::LINE\r\n            \u0026\u0026 target.as_rule() != Rule::object_literal\r\n            \u0026\u0026 target.as_rule() != Rule::array_literal\r\n        {\r\n            target = target.into_inner().next().unwrap();\r\n        }\r\n\r\n        node_map()\r\n            .get(\u0026target.as_rule())\r\n            .ok_or(Error::Internal(format!(\r\n                \"Grammar issue; rule {:?} is not mapped\",\r\n                target.as_rule()\r\n            )))?(target)\r\n    }\r\n}\r\n\r\n/// Main function to parse the input into a syntax tree\r\npub fn parse_input(input: \u0026str, rule: Rule) -\u003e Result\u003cNode, Error\u003e {\r\n    let mut pairs = LavendeuxParser::parse(rule, input)?.flatten();\r\n    if let Some(pair) = pairs.next() {\r\n        pair.to_ast_node()\r\n    } else {\r\n        Err(Error::Internal(format!(\r\n            \"Grammar issue; empty input should be valid\",\r\n        )))\r\n    }\r\n}\r\n","traces":[{"line":100,"address":[],"length":0,"stats":{"Line":314},"fn_name":null},{"line":101,"address":[],"length":0,"stats":{"Line":314},"fn_name":null},{"line":107,"address":[],"length":0,"stats":{"Line":3266},"fn_name":null},{"line":108,"address":[],"length":0,"stats":{"Line":2964},"fn_name":null},{"line":109,"address":[],"length":0,"stats":{"Line":2963},"fn_name":null},{"line":110,"address":[],"length":0,"stats":{"Line":2952},"fn_name":null},{"line":111,"address":[],"length":0,"stats":{"Line":2952},"fn_name":null},{"line":113,"address":[],"length":0,"stats":{"Line":2952},"fn_name":null},{"line":121,"address":[],"length":0,"stats":{"Line":628},"fn_name":null},{"line":126,"address":[],"length":0,"stats":{"Line":115},"fn_name":null},{"line":127,"address":[],"length":0,"stats":{"Line":341},"fn_name":null},{"line":128,"address":[],"length":0,"stats":{"Line":222},"fn_name":null},{"line":129,"address":[],"length":0,"stats":{"Line":111},"fn_name":null},{"line":131,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":132,"address":[],"length":0,"stats":{"Line":0},"fn_name":null}],"covered":13,"coverable":15},{"path":["C:","\\","Users","rcarson1","Repositories","lavendeux_workspace","lavendeux_parser","src","state.rs"],"content":"use crate::{\r\n    network_utils::ApiManager,\r\n    std_functions::{self, Function},\r\n    user_function::UserFunction,\r\n    Error, Token, Value,\r\n};\r\nuse std::collections::HashMap;\r\n\r\n#[derive(Debug, Clone)]\r\npub struct State {\r\n    /// Current depth of the parser\r\n    /// This is used to prevent infinite recursion\r\n    /// while parsing user_functions\r\n    depth: usize,\r\n\r\n    /// The time that the current parse started\r\n    /// This is used to prevent infinite loops\r\n    /// and implement a timeout\r\n    parse_starttime: std::time::Instant,\r\n    timeout: u64,\r\n\r\n    /// Registered variables\r\n    /// Used as a stack for scoping\r\n    variables: Vec\u003cHashMap\u003cString, Value\u003e\u003e,\r\n\r\n    /// Registered user functions\r\n    /// These are functions that are set with\r\n    /// `name(arguments) = body`\r\n    user_functions: HashMap\u003cString, UserFunction\u003e,\r\n\r\n    /// Registered std functions\r\n    /// These are functions that are built into the parser\r\n    /// and are not user defined\r\n    std_functions: HashMap\u003cString, Function\u003e,\r\n}\r\n\r\nimpl State {\r\n    const MAX_DEPTH: usize = 999;\r\n\r\n    pub fn with_timeout(ms: u64) -\u003e Self {\r\n        let mut instance = Self {\r\n            depth: 0,\r\n            parse_starttime: std::time::Instant::now(),\r\n            timeout: ms,\r\n            variables: vec![HashMap::new()],\r\n            user_functions: HashMap::new(),\r\n            std_functions: HashMap::new(),\r\n        };\r\n\r\n        ApiManager::default_apis(\u0026mut instance);\r\n        std_functions::register_all(\u0026mut instance.std_functions);\r\n\r\n        instance\r\n    }\r\n\r\n    /// Creates a new parser state\r\n    pub fn new() -\u003e Self {\r\n        Self::with_timeout(0)\r\n    }\r\n\r\n    /// Returns the current depth of the parser\r\n    pub fn current_depth(\u0026self) -\u003e usize {\r\n        self.depth\r\n    }\r\n\r\n    /// Sets the timeout of the parser\r\n    /// Used on parse start\r\n    pub fn start_timer(\u0026mut self) {\r\n        self.parse_starttime = std::time::Instant::now();\r\n    }\r\n\r\n    /// Checks the timeout of the parser\r\n    pub fn check_timer(\u0026self) -\u003e Result\u003c(), Error\u003e {\r\n        if self.timeout \u003e 0 \u0026\u0026 self.parse_starttime.elapsed().as_millis() \u003e self.timeout as u128 {\r\n            Err(Error::Timeout)\r\n        } else {\r\n            Ok(())\r\n        }\r\n    }\r\n\r\n    /// Sets the depth to 0, and destroys all scopes but the root scope\r\n    pub fn sanitize_scopes(\u0026mut self) {\r\n        self.depth = 0;\r\n        self.variables.truncate(1);\r\n    }\r\n\r\n    /// Creates a new scope from this state\r\n    /// A limit is placed on the depth of scopes that can be created\r\n    /// This is to prevent infinite recursion\r\n    pub fn scope_into(\u0026mut self, token: \u0026Token) -\u003e Result\u003c(), Error\u003e {\r\n        if self.depth \u003e= Self::MAX_DEPTH {\r\n            return Err(Error::StackOverflow {\r\n                token: token.clone(),\r\n            });\r\n        }\r\n\r\n        self.depth += 1;\r\n        //println!(\"Depth: {}\", self.depth);\r\n        self.variables.push(HashMap::new());\r\n        Ok(())\r\n    }\r\n\r\n    /// Removes the current scope from this state\r\n    pub fn scope_out(\u0026mut self) {\r\n        if self.depth == 0 {\r\n            return;\r\n        }\r\n        self.depth -= 1;\r\n        self.variables.pop();\r\n    }\r\n\r\n    /// Assigns a variable in the state, in the root scope\r\n    pub fn global_assign_variable(\u0026mut self, name: \u0026str, value: Value) {\r\n        self.variables[0].insert(name.to_string(), value);\r\n    }\r\n\r\n    /// Sets a variable in the state\r\n    pub fn set_variable(\u0026mut self, name: \u0026str, value: Value) {\r\n        self.variables\r\n            .last_mut()\r\n            .unwrap()\r\n            .insert(name.to_string(), value);\r\n    }\r\n\r\n    /// Returns the value of a variable\r\n    pub fn get_variable(\u0026self, name: \u0026str) -\u003e Option\u003cValue\u003e {\r\n        for scope in self.variables.iter().rev() {\r\n            if let Some(value) = scope.get(name) {\r\n                return Some(value.clone());\r\n            }\r\n        }\r\n        None\r\n    }\r\n\r\n    pub fn delete_variable(\u0026mut self, name: \u0026str) -\u003e Option\u003cValue\u003e {\r\n        for scope in self.variables.iter_mut().rev() {\r\n            if let Some(value) = scope.remove(name) {\r\n                return Some(value);\r\n            }\r\n        }\r\n        None\r\n    }\r\n\r\n    /// Returns all variables in the state\r\n    pub fn all_variables(\u0026self) -\u003e HashMap\u003cString, Value\u003e {\r\n        let mut variables = HashMap::new();\r\n        for scope in self.variables.iter().rev() {\r\n            variables.extend(scope.iter().map(|(k, v)| (k.clone(), v.clone())));\r\n        }\r\n\r\n        variables\r\n    }\r\n\r\n    /// Sets a user function in the state\r\n    pub fn set_user_function(\u0026mut self, function: UserFunction) {\r\n        self.user_functions\r\n            .insert(function.name().to_string(), function);\r\n    }\r\n\r\n    /// Deletes a user function from the state\r\n    pub fn delete_user_function(\u0026mut self, name: \u0026str) -\u003e Option\u003cUserFunction\u003e {\r\n        self.user_functions.remove(name)\r\n    }\r\n\r\n    /// Returns the user function with the given name\r\n    pub fn get_user_function(\u0026self, name: \u0026str) -\u003e Option\u003cUserFunction\u003e {\r\n        self.user_functions.get(name).cloned()\r\n    }\r\n\r\n    /// Returns the std function with the given name\r\n    pub fn get_std_function(\u0026self, name: \u0026str) -\u003e Option\u003cFunction\u003e {\r\n        self.std_functions.get(name).cloned()\r\n    }\r\n\r\n    /// Returns the extension function with the given name\r\n    /// If the `extensions` feature is not enabled, this function will always return `None`\r\n    #[allow(unused_variables)]\r\n    pub fn get_ext_function(\u0026self, name: \u0026str) -\u003e Option\u003cFunction\u003e {\r\n        #[cfg(not(feature = \"extensions\"))]\r\n        return None;\r\n\r\n        #[cfg(feature = \"extensions\")]\r\n        crate::extensions::ExtensionController::with(|controller| {\r\n            controller.get_function(name).clone()\r\n        })\r\n    }\r\n\r\n    /// Registers a function in the state\r\n    /// This function will overwrite any existing function with the same name\r\n    pub fn register_function(\u0026mut self, function: Function) {\r\n        self.std_functions\r\n            .insert(function.name().to_string(), function);\r\n    }\r\n\r\n    // We will have a function that searches the whole state for a matching function\r\n    // And builds a temporary Function object that calls the correct code\r\n    // this is where we should handle the special case of the `help` function\r\n\r\n    // We will search for functions in the following order:\r\n    // 1. The function named 'help' which is a special case\r\n    // 2. Standard library functions\r\n    // 3. User defined functions\r\n    // 4. JS Extension-provided functions\r\n    pub fn get_function(\u0026self, name: \u0026str) -\u003e Option\u003cFunction\u003e {\r\n        if name == \"help\" {\r\n            todo!();\r\n        } else if let Some(f) = self.get_std_function(name) {\r\n            Some(f)\r\n        } else if let Some(f) = self.get_user_function(name) {\r\n            Some(f.to_std_function())\r\n        } else if let Some(f) = self.get_ext_function(name) {\r\n            Some(f)\r\n        } else {\r\n            None\r\n        }\r\n    }\r\n\r\n    /// Decorates the given value with the given decorator\r\n    pub fn decorate(\u0026mut self, name: \u0026str, token: \u0026Token, value: Value) -\u003e Result\u003cString, Error\u003e {\r\n        let mut value = value;\r\n\r\n        if let Some(f) = self.get_function(\u0026format!(\"@{name}\")) {\r\n            value = f.execute(self, vec![value.clone()], token)?;\r\n            Ok(value.to_string())\r\n        } else {\r\n            // Check for extension decorators\r\n            #[cfg(feature = \"extensions\")]\r\n            if let Some(decorator) = self.get_ext_function(\u0026format!(\"@{name}\")) {\r\n                value = decorator.execute(self, vec![value.clone()], token)?;\r\n                return Ok(value.to_string());\r\n            }\r\n\r\n            Err(Error::DecoratorName {\r\n                name: name.to_string(),\r\n                token: token.clone(),\r\n            })\r\n        }\r\n    }\r\n\r\n    /// Returns a string containing the help for all functions\r\n    pub fn help(\u0026self, filter: Option\u003cString\u003e) -\u003e String {\r\n        let mut help = Vec::new();\r\n\r\n        let map = self.std_functions.clone();\r\n        let strings = std_functions::collect_help(map, filter.clone());\r\n        help.push(std_functions::help_to_string(strings));\r\n\r\n        #[cfg(feature = \"extensions\")]\r\n        help.push(crate::extensions::ExtensionController::with(|controller| {\r\n            let ext_fn_map = controller\r\n                .functions()\r\n                .iter()\r\n                .map(|f| (f.name().to_string(), f.clone()))\r\n                .collect::\u003cHashMap\u003cString, Function\u003e\u003e();\r\n            let ext_fn_strings = std_functions::collect_help(ext_fn_map, filter.clone());\r\n            std_functions::help_to_string(ext_fn_strings)\r\n        }));\r\n\r\n        let user_fn_map = self\r\n            .user_functions\r\n            .iter()\r\n            .filter(|(n, _)| !n.starts_with(\"_\"))\r\n            .map(|(n, f)| (n.clone(), f.to_std_function()))\r\n            .collect::\u003cHashMap\u003cString, Function\u003e\u003e();\r\n        let user_fn_strings = std_functions::collect_help(user_fn_map, filter.clone());\r\n        help.push(std_functions::help_to_string(user_fn_strings));\r\n\r\n        help.join(\"\\n\")\r\n    }\r\n}\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use super::*;\r\n    #[test]\r\n    fn test_scope() {\r\n        let mut state = State::new();\r\n        state.set_variable(\"a\", Value::from(2.0));\r\n        state\r\n            .scope_into(\u0026Token {\r\n                rule: crate::pest::Rule::ATOMIC_VALUE,\r\n                input: \"\".to_string(),\r\n                references: None,\r\n            })\r\n            .ok();\r\n        assert_eq!(state.delete_variable(\"a\"), Some(Value::from(2.0)));\r\n        assert_eq!(state.delete_variable(\"a\"), None);\r\n\r\n        state.global_assign_variable(\"b\", Value::from(2.0));\r\n\r\n        assert_eq!(state.current_depth(), 1);\r\n        state.scope_out();\r\n        assert_eq!(state.current_depth(), 0);\r\n\r\n        state.scope_out();\r\n        assert_eq!(state.current_depth(), 0);\r\n\r\n        assert_eq!(state.get_variable(\"a\"), None);\r\n        assert_eq!(state.get_variable(\"b\"), Some(Value::from(2.0)));\r\n\r\n        state.depth = State::MAX_DEPTH;\r\n        assert!(matches!(\r\n            state.scope_into(\u0026Token {\r\n                rule: crate::pest::Rule::ATOMIC_VALUE,\r\n                input: \"\".to_string(),\r\n                references: None,\r\n            }),\r\n            Err(Error::StackOverflow { .. })\r\n        ));\r\n    }\r\n\r\n    #[test]\r\n    fn test_timer() {\r\n        let mut state = State::with_timeout(200);\r\n        state.start_timer();\r\n        std::thread::sleep(std::time::Duration::from_millis(250));\r\n        assert!(matches!(state.check_timer().unwrap_err(), Error::Timeout));\r\n    }\r\n\r\n    #[test]\r\n    fn test_all_variables() {\r\n        let mut state = State::new();\r\n        state.set_variable(\"a\", Value::from(2.0));\r\n        state\r\n            .scope_into(\u0026Token {\r\n                rule: crate::pest::Rule::ATOMIC_VALUE,\r\n                input: \"\".to_string(),\r\n                references: None,\r\n            })\r\n            .ok();\r\n        state.set_variable(\"b\", Value::from(3.0));\r\n\r\n        let variables = state.all_variables();\r\n        assert!(variables.contains_key(\"a\"));\r\n        assert!(variables.contains_key(\"b\"));\r\n    }\r\n\r\n    #[test]\r\n    fn test_user_functions() {\r\n        let mut state = State::new();\r\n        let function = UserFunction::new(\"test\", vec![], \"2.0\".to_string()).unwrap();\r\n        state.set_user_function(function);\r\n        assert_eq!(state.get_user_function(\"test\").unwrap().name(), \"test\");\r\n        assert_eq!(state.get_function(\"test\").unwrap().name(), \"test\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_help() {\r\n        let mut state = State::new();\r\n        let function = UserFunction::new(\"testasdfasdf\", vec![], \"2.0\".to_string()).unwrap();\r\n        state.set_user_function(function);\r\n        assert!(state.help(None).contains(\"testasdfasdf\"));\r\n        assert!(state.help(None).contains(\"Bitwise\"));\r\n        assert!(!state\r\n            .help(Some(\"bitwise\".to_string()))\r\n            .contains(\"testasdfasdf\"));\r\n    }\r\n\r\n    #[cfg(feature = \"extensions\")]\r\n    #[test]\r\n    fn test_extensions() {\r\n        use crate::Lavendeux;\r\n\r\n        let state = State::new();\r\n        Lavendeux::load_extension(\"example_extensions/simple_extension.js\").unwrap();\r\n\r\n        assert!(state.get_ext_function(\"add\").is_some());\r\n        assert!(state.get_function(\"add\").is_some());\r\n    }\r\n}\r\n","traces":[{"line":40,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":43,"address":[],"length":0,"stats":{"Line       description: description.to_string(),\r\n            category: category.to_string(),\r\n            arguments,\r\n            returns,\r\n            handler,\r\n            data,\r\n        }\r\n    }\r\n\r\n    /// Returns the name of this function\r\n    pub fn name(\u0026self) -\u003e \u0026str {\r\n        \u0026self.name\r\n    }\r\n\r\n    /// Returns the description of this function\r\n    pub fn description(\u0026self) -\u003e \u0026str {\r\n        \u0026self.description\r\n    }\r\n\r\n    /// Returns the category of this function\r\n    pub fn category(\u0026self) -\u003e \u0026str {\r\n        \u0026self.category\r\n    }\r\n\r\n    /// Returns the arguments of this function\r\n    pub fn arguments(\u0026self) -\u003e \u0026[Argument] {\r\n        \u0026self.arguments\r\n    }\r\n\r\n    /// Returns the range of arguments that are required for this function.\r\n    pub fn argument_span(\u0026self) -\u003e Range\u003cusize\u003e {\r\n        let mut min = 0;\r\n        let mut max = 0;\r\n\r\n        for argument in self.arguments() {\r\n            max += 1;\r\n            if !argument.optional {\r\n                min += 1;\r\n            }\r\n        }\r\n\r\n        min..max\r\n    }\r\n\r\n    /// Returns the return type of this function\r\n    pub fn returns(\u0026self) -\u003e ValueType {\r\n        self.returns\r\n    }\r\n\r\n    /// Return the function's signature\r\n    pub fn signature(\u0026self) -\u003e String {\r\n        format!(\r\n            \"{}({}) -\u003e {}\",\r\n            self.name,\r\n            self.arguments()\r\n                .iter()\r\n                .map(|e| e.expects.to_string())\r\n                .collect::\u003cVec\u003cString\u003e\u003e()\r\n                .join(\", \"),\r\n            self.returns.to_string()\r\n        )\r\n    }\r\n\r\n    /// Returns the function's handler\r\n    pub fn handler(\u0026self) -\u003e FunctionHandler {\r\n        self.handler\r\n    }\r\n\r\n    /// Maps the given arguments to their names\r\n    /// while validating the arguments against this function's signature\r\n    pub fn map_arguments(\r\n        \u0026self,\r\n        arguments: Vec\u003cValue\u003e,\r\n        token: \u0026Token,\r\n    ) -\u003e Result\u003cHashMap\u003cString, Vec\u003cValue\u003e\u003e, Error\u003e {\r\n        let mut validated: HashMap\u003cString, Vec\u003cValue\u003e\u003e = HashMap::new();\r\n\r\n        let mut arg_iter = self.arguments.iter().peekable();\r\n        let mut in_iter = arguments.iter().peekable();\r\n        let mut arg_index = 0;\r\n        while arg_iter.peek().is_some() {\r\n            let next_expected = arg_iter.next().unwrap();\r\n\r\n            if next_expected.plural {\r\n                let mut values = vec![];\r\n                while in_iter.peek().is_some() {\r\n                    let next_argument = in_iter.next().unwrap();\r\n                    arg_index += 1;\r\n                    if let Ok(value) = next_argument.as_type(next_expected.expects) {\r\n                        values.push(value);\r\n                    } else {\r\n                        return Err(Error::FunctionArgumentType {\r\n                            arg: arg_index,\r\n                            expected_type: next_expected.expects,\r\n                            signature: self.signature(),\r\n                            token: token.clone(),\r\n                        });\r\n                    }\r\n                }\r\n                validated.insert(next_expected.name.clone(), values);\r\n                break;\r\n            }\r\n\r\n            if let Some(next_argument) = in_iter.next() {\r\n                arg_index += 1;\r\n                if let Ok(value) = next_argument.as_type(next_expected.expects) {\r\n                    validated.insert(next_expected.name.clone(), vec![value]);\r\n                } else if next_expected.optional {\r\n                    continue;\r\n                } else {\r\n                    return Err(Error::FunctionArgumentType {\r\n                        arg: arg_index,\r\n                        expected_type: next_expected.expects,\r\n                        signature: self.signature(),\r\n                        token: token.clone(),\r\n                    });\r\n                }\r\n            } else if next_expected.optional {\r\n                continue;\r\n            } else {\r\n                let s = self.argument_span();\r\n                return Err(Error::FunctionArguments {\r\n                    min: s.start,\r\n                    max: s.end,\r\n                    signature: self.signature(),\r\n                    token: token.clone(),\r\n                });\r\n            }\r\n        }\r\n\r\n        Ok(validated)\r\n    }\r\n\r\n    /// Executes this function\r\n    pub fn execute(\r\n        \u0026self,\r\n        state: \u0026mut State,\r\n        arguments: Vec\u003cValue\u003e,\r\n        token: \u0026Token,\r\n    ) -\u003e Result\u003cValue, Error\u003e {\r\n        let arguments = self.map_arguments(arguments, token)?;\r\n        (self.handler)(state, arguments, token, \u0026self.data)\r\n    }\r\n\r\n    /// Register this function in the given map\r\n    pub fn register(\u0026self, map: \u0026mut HashMap\u003cString, Function\u003e) {\r\n        map.insert(self.name.clone(), self.clone());\r\n    }\r\n}\r\n","traces":[{"line":33,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":34,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":35,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":36,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":37,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":38,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":39,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":40,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":47,"address":[],"length":0,"stats":{"Line":8369},"fn_name":n  ValueType,\r\n};\r\nuse std::collections::HashMap;\r\n\r\npub fn register_all(map: \u0026mut HashMap\u003cString, Function\u003e) {\r\n    static_function!(\r\n        registry = map,\r\n        name = \"len\",\r\n        description = \"Returns the length of the given array or object\",\r\n        category = \"arrays\",\r\n        arguments = [required_argument!(\"input\", ValueType::Any)],\r\n        returns = ValueType::Int,\r\n        handler = |_state: \u0026mut State, arguments, _token, _| {\r\n            let input = get_argument!(\"input\", arguments).as_a::\u003cArray\u003e()?;\r\n            let len = I64::from(input.inner().len() as i64);\r\n            Ok(Value::i64(len))\r\n        }\r\n    );\r\n\r\n    static_function!(\r\n        registry = map,\r\n        name = \"is_empty\",\r\n        description = \"Returns true if the given array or object is empty\",\r\n        category = \"arrays\",\r\n        arguments = [required_argument!(\"input\", ValueType::Any)],\r\n        returns = ValueType::Bool,\r\n        handler = |_state: \u0026mut State, arguments, _token, _| {\r\n            let input = get_argument!(\"input\", arguments).as_a::\u003cArray\u003e()?;\r\n            let is_empty = input.inner().is_empty();\r\n            Ok(Value::from(is_empty))\r\n        }\r\n    );\r\n\r\n    static_function!(\r\n        registry = map,\r\n        name = \"first\",\r\n        description = \"Returns the first element of the given array\",\r\n        category = \"arrays\",\r\n        arguments = [required_argument!(\"input\", ValueType::Array)],\r\n        returns = ValueType::Any,\r\n        handler = |_state: \u0026mut State, arguments, token, _| {\r\n            let input = get_argument!(\"input\", arguments).as_a::\u003cArray\u003e()?;\r\n            let first = input.inner().first().cloned().ok_or(Error::ArrayEmpty {\r\n                token: token.clone(),\r\n            })?;\r\n            Ok(first)\r\n        }\r\n    );\r\n\r\n    static_function!(\r\n        registry = map,\r\n        name = \"last\",\r\n        description = \"Returns the last element of the given array\",\r\n        category = \"arrays\",\r\n        arguments = [required_argument!(\"input\", ValueType::Array)],\r\n        returns = ValueType::Any,\r\n        handler = |_state: \u0026mut State, arguments, token, _| {\r\n            let input = get_argument!(\"input\", arguments).as_a::\u003cArray\u003e()?;\r\n            let last = input.inner().last().cloned().ok_or(Error::ArrayEmpty {\r\n                token: token.clone(),\r\n            })?;\r\n            Ok(last)\r\n        }\r\n    );\r\n\r\n    static_function!(\r\n        registry = map,\r\n        name = \"pop\",\r\n        description = \"Removes and returns the last element of the given array\",\r\n        category = \"arrays\",\r\n        arguments = [required_argument!(\"input\", ValueType::Array)],\r\n        returns = ValueType::Any,\r\n        handler = |state: \u0026mut State, arguments, token, _| {\r\n            let mut input = get_argument!(\"input\", arguments)\r\n                .as_a::\u003cArray\u003e()?\r\n                .inner()\r\n                .clone();\r\n            let last = input.pop().ok_or(Error::ArrayEmpty {\r\n                token: token.clone(),\r\n            })?;\r\n\r\n            // Update the array if it references a variable\r\n            let value = Value::Array(input.into());\r\n            if let Some(reference) = \u0026token.references {\r\n                state.set_variable(reference, value);\r\n            }\r\n\r\n            Ok(last)\r\n        }\r\n    );\r\n\r\n    static_function!(\r\n        registry = map,\r\n        name = \"push\",\r\n        description =\r\n            \"Adds the given element to the end of the given array, then returns the array\",\r\n        category = \"arrays\",\r\n        arguments = [\r\n            required_argument!(\"input\", ValueType::Array),\r\n            required_argument!(\"element\", ValueTyp  *input.as_a::\u003cI64\u003e()?.inner();\r\n            let ordinal = match input % 10 {\r\n                1 =\u003e format!(\"{}st\", input),\r\n                2 =\u003e format!(\"{}nd\", input),\r\n                3 =\u003e format!(\"{}rd\", input),\r\n                _ =\u003e format!(\"{}th\", input),\r\n            };\r\n            Ok(ordinal)\r\n        }\r\n    );\r\n\r\n    static_decorator!(\r\n        registry = map,\r\n        name = \"utc\",\r\n        description = \"Interprets an integer as a timestamp, and formats it in UTC standard\",\r\n        expected_type = ValueType::Numeric,\r\n        handler = \u0026|input, token| {\r\n            let input = input.as_a::\u003cI64\u003e()?;\r\n            let input = I64::arithmetic_op(\r\n                \u0026input,\r\n                \u0026I64::new(1000),\r\n                polyvalue::operations::ArithmeticOperation::Multiply,\r\n            )?;\r\n            let input = *input.inner();\r\n\r\n            match chrono::NaiveDateTime::from_timestamp_millis(input) {\r\n                Some(t) =\u003e {\r\n                    let datetime: chrono::DateTime\u003cchrono::Utc\u003e =\r\n                        chrono::DateTime::from_naive_utc_and_offset(t, chrono::Utc);\r\n                    Ok(datetime.format(\"%Y-%m-%d %H:%M:%S\").to_string())\r\n                }\r\n                None =\u003e Err(Error::Range {\r\n                    input: input.to_string(),\r\n                    token: token.clone(),\r\n                }),\r\n            }\r\n        }\r\n    );\r\n\r\n    static_decorator!(\r\n        registry = map,\r\n        name = \"percent\",\r\n        description = \"Interprets a number as a percentage\",\r\n        expected_type = ValueType::Numeric,\r\n        handler = \u0026|input, _token| {\r\n            let input = *input.as_a::\u003cFloat\u003e()?.inner();\r\n            Ok(format!(\"{}%\", input * 100.0))\r\n        }\r\n    );\r\n}\r\n\r\n//\r\n// Tests\r\n//\r\n\r\n#[cfg(test)]\r o}\", v.inner())),\r\n                Value::U64(v) =\u003e Ok(format!(\"{:#0o}\", v.inner())),\r\n                _ =\u003e {\r\n                    let input = *input.as_a::\u003cI64\u003e()?.inner();\r\n                    Ok(format!(\"{:#0o}\", input))\r\n                }\r\n            }\r\n        }\r\n    );\r\n\r\n    static_decorator!(\r\n        registry = map,\r\n        name = \"bin\",\r\n        description = \"Base 2 number formatting, such as 0b101\",\r\n        expected_type = ValueType::Numeric,\r\n        handler = \u0026|input, _token| {\r\n            match input {\r\n                Value::U8(v) =\u003e Ok(format!(\"{:#0b}\", v.inner())),\r\n                Value::I8(v) =\u003e Ok(format!(\"{:#0b}\", v.inner())),\r\n                Value::U16(v) =\u003e Ok(format!(\"{:#0b}\", v.inner())),\r\n                Value::I16(v) =\u003e Ok(format!(\"{:#0b}\", v.inner())),\r\n                Value::U32(v) =\u003e Ok(format!(\"{:#0b}\", v.inner())),\r\n                Value::I32(v) =\u003e Ok(format!(\"{:#0b}\", v.inner())),\r\n                Value::U64(v) =\u003e Ok(format!(\"{:#0b}\", v.inner())),\r\n                _ =\u003e {\r\n                    let input = *input.as_a::\u003cI64\u003e()?.inner();\r\n                    Ok(format!(\"{:#0b}\", input))\r\n                }\r\n            }\r\n        }\r\n    );\r\n\r\n    static_decorator!(\r\n        registry = map,\r\n        name = \"sci\",\r\n        description = \"Scientific notation formatting, such as 1.2e3\",\r\n        expected_type = ValueType::Numeric,\r\n        handler = \u0026|input, _token| {\r\n            let input = *input.as_a::\u003cI64\u003e()?.inner();\r\n            Ok(format!(\"{:e}\", input))\r\n        }\r\n    );\r\n\r\n    static_decorator!(\r\n        registry = map,\r\n        name = \"float\",\r\n        description = \"Formats a number as a floating point number\",\r\n        expected_type = ValueType::Numeric,\r\n        handler = \u0026|input, _token| {\r\n )]\r\n#[macro_export]\r\nmacro_rules! test_decorator {\r\n    ($name:literal, $input:expr, $expected:expr) =\u003e {\r\n        assert_eq!(\r\n            state::State::new()\r\n                .decorate(\r\n                    $name,\r\n                    \u0026Token {\r\n                        rule: crate::Rule::ATOMIC_VALUE,\r\n                        input: $input.to_string(),\r\n                        references: None,\r\n                    },\r\n                    $input\r\n                )\r\n                .unwrap(),\r\n            $expected\r\n        );\r\n    };\r\n    () =\u003e {};\r\n}\r\n","traces":[{"line":8,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":9,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":10,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":11,"address":[],"length":0,"stats":{"Line":82},"fn_name":null}],"covered":4,"coverable":4},{"path":["C:","\\","Users","rcarson1","Repositories","lavendeux_workspace","lavendeux_parser","src","std_functions","stdlib","dev.rs"],"content":"use crate::{\r\n    get_argument, get_optional_argument, optional_argument, required_argument, static_function,\r\n    std_functions::Function, Error, State,\r\n};\r\nuse polyvalue::{\r\n    types::{Array, Str, I64},\r\n    Value, ValueTrait, ValueType,\r\n};\r\nuse std::{collections::HashMap, fs::File, io::BufRead};\r\n\r\npub fn register_all(map: \u0026mut HashMap\u003cString, Function\u003e) {\r\n    static_function!(\r\n        registry = map,\r\n        name = \"time\",\r\n        description = \"Returns a unix timestamp for the current system time\",\r\n        category = \"dev\",\r\n        arguments = [],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, _arguments, _token, _| {\r\n            Ok(Value::from(\r\n                std::time::SystemTime::now()\r\n                    .duration_since(std::time::UNIX_EPOCH)\r\n                    .unwrap()\r\n                    .as_secs_f64(),\r\n            ))\r\n        }\r\n    );\r\n\r\n    static_function!(\r\n        registry = map,\r\n        name = \"tail\",\r\n        description = \"Returns the last [lines] lines from a given file\",\r\n        category = \"dev\",\r\n        arguments = [\r\n            required_argument!(\"file\", ValueType::String),\r\n            optional_argument!(\"lines\", ValueType::Int)\r\n        ],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let n = get_optional_argument!(\"lines\", arguments)\r\n                .unwrap_or(Value::from(1))\r\n                .as_a::\u003cI64\u003e()?\r\n                .inner()\r\n                .clone();\r\n            let file = get_argument!(\"file\", arguments)\r\n                .as_a::\u003cStr\u003e()?\r\n                .inner()\r\n                .clone();\r\n            let file = File::open(\u0026file)?;\r\n\r\n            let lines = std::io::BufReader::new(file)\r\n                .lines()\r\n                .map(|f| Ok::\u003cValue, Error\u003e(Value::from(f?)))\r\n                .collect::\u003cResult\u003cVec\u003c_\u003e, _\u003e\u003e()?;\r\n\r\n            // return last n\r\n            Ok(Value::from(Array::from(\r\n                lines\r\n                    .iter()\r\n                    .rev()\r\n                    .take(n as usize)\r\n                    .rev()\r\n                    .cloned()\r\n                    .collect::\u003cVec\u003c_\u003e\u003e(),\r\n            )))\r\n        }\r\n    );\r\n\r\n    #[cfg(feature = \"crypto-functions\")]\r\n    static_function!(\r\n        registry = map,\r\n        name = \"sha256\",\r\n        description = \"Returns the sha256 hash of a given string\",\r\n        category = \"dev\",\r\n        arguments = [required_argument!(\"input\", ValueType::String)],\r\n        returns = ValueType::String,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            use sha2::{Digest, Sha256};\r\n            let input = get_argument!(\"input\", arguments)\r\n                .as_a::\u003cStr\u003e()?\r\n                .inner()\r\n                .clone();\r\n\r\n            let mut hasher = Sha256::new();\r\n            hasher.update(input);\r\n\r\n            let s = format!(\"{:X}\", hasher.finalize());\r\n            Ok(Value::from(s))\r\n        }\r\n    );\r\n\r\n    #[cfg(feature = \"crypto-functions\")]\r\n    static_function!(\r\n        registry = map,\r\n        name = \"sha512\",\r\n        description = \"Returns the sha512 hash of a given string\",\r\n        category = \"dev\",\r\n        arguments = [required_argument!(\"input\", ValueType::String)],\r\n        returns = ValueType::String,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            use sha2::{Digest, Sha512};\r\n            let input = get_argument!(\"input\", arguments)\r\n                .as_a::\u003cStr\u003e()?\r\n                .inner()\r\n                .clone();\r\n\r\n            let mut hasher = Sha512::new();\r\n            hasher.update(input);\r\n\r\n            let s = format!(\"{:X}\", hasher.finalize());\r\n            Ok(Value::from(s))\r\n        }\r\n    );\r\n\r\n    #[cfg(feature = \"crypto-functions\")]\r\n    static_function!(\r\n        registry = map,\r\n        name = \"md5\",\r\n        description = \"Returns the md5 hash of a given string\",\r\n        category = \"dev\",\r\n        arguments = [required_argument!(\"input\", ValueType::String)],\r\n        returns = ValueType::String,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            use md5::{Digest, Md5};\r\n            let input = get_argument!(\"input\", arguments)\r\n                .as_a::\u003cStr\u003e()?\r\n                .inner()\r\n                .clone();\r\n\r\n            let mut hasher = Md5::new();\r\n            hasher.update(input);\r\n\r\n            let s = format!(\"{:X}\", hasher.finalize());\r\n            Ok(Value::from(s))\r\n        }\r\n    );\r\n\r\n    #[cfg(feature = \"crypto-functions\")]\r\n    static_function!(\r\n        registry = map,\r\n        name = \"choose\",\r\n        description = \"Returns a random element from a given array\",\r\n        category = \"dev\",\r\n        arguments = [required_argument!(\"array\", ValueType::Array)],\r\n        returns = ValueType::Any,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            use rand::seq::SliceRandom;\r\n            let input = get_argument!(\"array\", arguments)\r\n                .as_a::\u003cArray\u003e()?\r\n                .inner()\r\n                .clone();\r\n            let random = input.choose(\u0026mut rand::thread_rng()).unwrap();\r\n            Ok(random.clone())\r\n        }\r\n    );\r\n\r\n    #[cfg(feature = \"crypto-functions\")]\r\n    static_function!(\r\n        registry = map,\r\n        name = \"rand\",\r\n        description = \"With no arguments, return a float from 0 to 1. Otherwise return an integer from 0 to m, or m to n\",\r\n        category = \"dev\",\r\n        arguments = [optional_argument!(\"m\", ValueType::Int), optional_argument!(\"n\", ValueType::Int)],\r\n        returns = ValueType::Any,\r\n        handler = |_: \u0026mut State, arguments, token, _| {\r\n            use rand::Rng;\r\n            let m = get_optional_argument!(\"m\", arguments).and_then(|v| Some(*v.as_a::\u003cI64\u003e().unwrap().inner()));\r\n            let n = get_optional_argument!(\"n\", arguments).and_then(|v| Some(*v.as_a::\u003cI64\u003e().unwrap().inner()));\r\n\r\n            match (m, n) {\r\n                (None, None) =\u003e Ok(Value::from(rand::random::\u003cf64\u003e())),\r\n                (Some(m), None)|(None, Some(m)) =\u003e {\r\n                    if m == 0 {\r\n                        return Err(Error::Range {\r\n                            input: \"0\".to_string(),\r\n                            token: token.clone(),\r\n                        });\r\n                    }\r\n                    Ok(Value::from(rand::thread_rng().gen_range(0..(m+1))))\r\n                },\r\n                (Some(m), Some(n)) =\u003e {\r\n                    if m \u003e= n {\r\n                        return Err(Error::Range {\r\n                            input: format!(\"{}..{}\", m, n),\r\n                            token: token.clone(),\r\n                        });\r\n                    }\r\n                    Ok(Value::from(rand::thread_rng().gen_range(m..(n+1))))\r\n                },\r\n            }\r\n        }\r\n    );\r\n}\r\n","traces":[{"line":11,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":12,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":13,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":14,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":15,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":16,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":17,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":18,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":19,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":20,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":21,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":22,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":23,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":24,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":29,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":30,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":31,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":32,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":33,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":34,"addre \", ValueType::Compound)],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, token, _| {\r\n            let input = get_argument!(\"input\", arguments)\r\n                .as_a::\u003cArray\u003e()?\r\n                .inner()\r\n                .clone();\r\n            let max = input\r\n                .iter()\r\n                .max()\r\n                .ok_or(Error::ArrayEmpty {\r\n                    token: token.clone(),\r\n                })?\r\n                .clone();\r\n            Ok(max)\r\n        }\r\n    );\r\n\r\n    static_function!(\r\n        registry = map,\r\n        name = \"ceil\",\r\n        description = \"Rounds a number up to the nearest integer\",\r\n        category = \"math\",\r\n        arguments = [required_argument!(\"n\", ValueType::Numeric)],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let n = *get_argument!(\"n\", arguments).as_a::\u003cFloat\u003e()?.inner();\r\n            Ok(Value::from(n.ceil()))\r\n        }\r\n    );\r\n\r\n    static_function!(\r\n        registry = map,\r\n        name = \"floor\",\r\n        description = \"Rounds a number down to the nearest integer\",\r\n        category = \"math\",\r\n        arguments = [required_argument!(\"n\", ValueType::Numeric)],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let n = *get_argument!(\"n\", arguments).as_a::\u003cFloat\u003e()?.inner();\r\n            Ok(Value::from(n.floor()))\r\n        }\r\n    );\r\n\r\n    static_function!(\r\n        registry = map,\r\n        name = \"abs\",\r\n        description = \"Returns the absolute value of a number\",\r\n        category = \"math\",\r\n        arguments = [required_argument!(\"n\", ValueType::Numeric)],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            match \u0026get_argument!(\"n\", arguments) {\r\n                Value::Float(n) =\u003e Ok(Value::from(n.inner().abs())),\r\n                Value::I64(n) =\u003e Ok(Value::from(n.inner().abs())),\r\n                Value::Fixed(n) =\u003e Ok(Value::fixed(n.inner().abs())),\r\n                Value::Currency(n) =\u003e {\r\n                    let symbol = n.symbol().clone();\r\n                    let precision = n.precision();\r\n                    let value = n.inner().value().inner().abs();\r\n                    Ok(CurrencyInner::new(symbol, precision, value.into()).into())\r\n                }\r\n                _ =\u003e Err(Error::Internal(\"Invalid argument type\".to_string())),\r\n            }\r\n        }\r\n    );\r\n\r\n    static_function!(\r\n        registry = map,\r\n        name = \"round\",\r\n        description = \"Rounds a number to a given precision\",\r\n        category = \"math\",\r\n        arguments = [\r\n            required_argument!(\"n\", ValueType::Numeric),\r\n            required_argument!(\"precision\", ValueType::Int)\r\n        ],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let n = get_argument!(\"n\", arguments);\r\n            if n.is_a(ValueType::Int) {\r\n                return Ok(n);\r\n            }\r\n\r\n            let precision = *get_argument!(\"precision\", arguments).as_a::\u003cI64\u003e()?.inner();\r\n            match \u0026get_argument!(\"n\", arguments) {\r\n                // Round floats to n decimal places\r\n                Value::Float(n) =\u003e {\r\n                    let n = n.inner();\r\n                    let n = n * 10.0_f64.powi(precision as i32);\r\n                    let n = n.round();\r\n                    let n = n / 10.0_f64.powi(precision as i32);\r\n                    Ok(Value::from(n))\r\n                }\r\n\r\n                Value::Fixed(n) =\u003e Ok(Value::from(n.inner().clone().round(precision as i8))),\r\n                Value::Currency(n) =\u003e {\r\n                    let symbol = n.symbol().clone();\r\n                    let precision = n.precision();\r\n                    let value = n.inner().value().inner().clone().round(precision as i8);\r\n                    Ok(CurrencyInner::new(symbol, precision, value.into()).into())\r\n                }\r\n                _ =\u003e Err(Error::Internal(\"Invalid argument type\".to_string())),\r\n            }\r\n        }\r\n    );\r\n\r\n    // LOG2\r\n    static_function!(\r\n        registry = map,\r\n        name = \"log2\",\r\n        description = \"Returns the base 2 logarithm of a number\",\r\n        category = \"math\",\r\n        arguments = [required_argument!(\"n\", ValueType::Numeric)],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let n = *get_argument!(\"n\", arguments).as_a::\u003cFloat\u003e()?.inner();\r\n            Ok(Value::from(n.log2()))\r\n        }\r\n    );\r\n\r\n    // iLOG2\r\n    static_function!(\r\n        registry = map,\r\n        name = \"ilog2\",\r\n        description = \"Returns the base 2 logarithm of an integer\",\r\n        category = \"math\",\r\n        arguments = [required_argument!(\"n\", ValueType::Int)],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let n = *get_argument!(\"n\", arguments).as_a::\u003cI64\u003e()?.inner();\r\n            Ok(Value::from(\r\n                n.ilog2() as \u003cpolyvalue::types::I64 as ValueTrait\u003e::Inner\r\n            ))\r\n        }\r\n    );\r\n\r\n    // LOG10\r\n    static_function!(\r\n        registry = map,\r\n        name = \"log10\",\r\n        description = \"Returns the base 10 logarithm of a number\",\r\n        category = \"math\",\r\n        arguments = [required_argument!(\"n\", ValueType::Numeric)],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let n = *get_argument!(\"n\", arguments).as_a::\u003cFloat\u003e()?.inner();\r\n            Ok(Value::from(n.log10()))\r\n        }\r\n    );\r\n\r\n    // LN\r\n    static_function!(\r\n        registry = map,\r\n        name = \"ln\",\r\n        description = \"Returns the natural logarithm of a number\",\r\n        category = \"math\",\r\n        arguments = [required_argument!(\"n\", ValueType::Numeric)],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let n = *get_argument!(\"n\", arguments).as_a::\u003cFloat\u003e()?.inner();\r\n            Ok(Value::from(n.ln()))\r\n        }\r\n    );\r\n\r\n    // LOG\r\n    static_function!(\r\n        registry = map,\r\n        name = \"log\",\r\n        description = \"Returns the logarithm of a number with a given base\",\r\n        category = \"math\",\r\n        arguments = [\r\n            required_argument!(\"n\", ValueType::Numeric),\r\n            required_argument!(\"base\", ValueType::Numeric)\r\n        ],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let n = *get_argument!(\"n\", arguments).as_a::\u003cFloat\u003e()?.inner();\r\n            let base = *get_argument!(\"base\", arguments).as_a::\u003cFloat\u003e()?.inner();\r\n            Ok(Value::from(n.log(base)))\r\n        }\r\n    );\r\n\r\n    // SQRT\r\n    static_function!(\r\n        registry = map,\r\n        name = \"sqrt\",\r\n        description = \"Returns the square root of a number\",\r\n        category = \"math\",\r\n        arguments = [required_argument!(\"n\", ValueType::Numeric)],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let n = *get_argument!(\"n\", arguments).as_a::\u003cFloat\u003e()?.inner();\r\n            Ok(Value::from(n.sqrt()))\r\n        }\r\n    );\r\n\r\n    // ROOT\r\n    static_function!(\r\n        registry = map,\r\n        name = \"root\",\r\n        description = \"Returns the nth root of a number\",\r\n        category = \"math\",\r\n        arguments = [\r\n            required_argument!(\"n\", ValueType::Numeric),\r\n            required_argument!(\"root\", ValueType::Numeric)\r\n        ],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let n = *get_argument!(\"n\", arguments).as_a::\u003cFloat\u003e()?.inner();\r\n            let root = *get_argument!(\"root\", arguments).as_a::\u003cFloat\u003e()?.inner();\r\n            Ok(Value::from(n.powf(1.0 / root)))\r\n        }\r\n    );\r\n}\r\n","traces":[{"line":11,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":12,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":13,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":14,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":15,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":16,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":17,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":18,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":19,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":20,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":21,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":22,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":23,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":24,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":25,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":26,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":27,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":28,"address":[],"length":0,"stats":{"Line":0},"fn_name":null} ions::Function, Error, State,\r\n};\r\nuse polyvalue::{\r\n    types::{Object, Str},\r\n    Value, ValueTrait, ValueType,\r\n};\r\nuse serde_json::json;\r\nuse std::collections::HashMap;\r\n\r\npub fn register_all(map: \u0026mut HashMap\u003cString, Function\u003e) {\r\n    #[cfg(feature = \"network-functions\")]\r\n    static_function!(\r\n        registry = map,\r\n        name = \"resolve\",\r\n        description = \"Resolves a hostname to an IP address\",\r\n        category = \"network\",\r\n        arguments = [required_argument!(\"hostname\", ValueType::String)],\r\n        returns = ValueType::String,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let hostname = get_argument!(\"hostname\", arguments)\r\n                .as_a::\u003cStr\u003e()?\r\n                .inner()\r\n                .clone();\r\n            match crate::network_utils::resolve(\u0026hostname) {\r\n                Ok(v) =\u003e Ok(v),\r\n                Err(e) =\u003e Err(Error::Io(e)),\r\n            }\r\n        }\r\n    );\r\n\r\n    #[cfg(feature = \"network-functions\")]\r\n    static_function!(\r\n        registry = map,\r\n        name = \"get\",\r\n        description = \"Performs an HTTP GET request\",\r\n        category = \"network\",\r\n        arguments = [\r\n            required_argument!(\"url\", ValueType::String),\r\n            optional_argument!(\"headers\", ValueType::Object)\r\n        ],\r\n        returns = ValueType::String,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let url = get_argument!(\"url\", arguments)\r\n                .as_a::\u003cStr\u003e()?\r\n                .inner()\r\n                .clone();\r\n            let headers = get_argument!(\"headers\", arguments)\r\n                .as_a::\u003cObject\u003e()?\r\n                .inner()\r\n                .iter()\r\n                .map(|(k, v)| {\r\n                    (\r\n                        k.as_a::\u003cStr\u003e().unwrap().inner().clone(),\r\n                        v.as_a::\u003cStr\u003e().unwrap().inner().clone(),\r\n                    )\r\n                })\r\n                .collect::\u003cHashMap\u003cString, String\u003e\u003e();\r\n            match crate::network_utils::request(\u0026url, None, headers) {\r\n                Ok(v) =\u003e Ok(v),\r\n                Err(e) =\u003e Err(e)?,\r\n            }\r\n        }\r\n    );\r\n\r\n    #[cfg(feature = \"network-functions\")]\r\n    static_function!(\r\n        registry = map,\r\n        name = \"post\",\r\n        description = \"Performs an HTTP POST request\",\r\n        category = \"network\",\r\n        arguments = [\r\n            required_argument!(\"url\", ValueType::String),\r\n            required_argument!(\"body\", ValueType::String),\r\n            optional_argument!(\"headers\", ValueType::Object)\r\n        ],\r\n        returns = ValueType::String,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let url = get_argument!(\"url\", arguments)\r\n                .as_a::\u003cStr\u003e()?\r\n                .inner()\r\n                .clone();\r\n            let body = get_argument!(\"body\", arguments)\r\n                .as_a::\u003cStr\u003e()?\r\n                .inner()\r\n                .clone();\r\n            let headers = get_argument!(\"headers\", arguments)\r\n                .as_a::\u003cObject\u003e()?\r\n                .inner()\r\n                .iter()\r\n                .map(|(k, v)| {\r\n                    (\r\n                        k.as_a::\u003cStr\u003e().unwrap().inner().clone(),\r\n                        v.as_a::\u003cStr\u003e().unwrap().inner().clone(),\r\n                    )\r\n                })\r\n                .collect::\u003cHashMap\u003cString, String\u003e\u003e();\r\n            match crate::network_utils::request(\u0026url, Some(body), headers) {\r\n                Ok(v) =\u003e Ok(v),\r\n                Err(e) =\u003e Err(e)?,\r\n            }\r\n        }\r\n    );\r\n\r\n    #[cfg(feature = \"network-functions\")]\r\n    static_function!(\r\n        registry = map,\r\n        name = \"add_api\",\r\n        description = \"Registers an API. Accepts a string, or an object with the properties [ url, headers, description, examples, auth_key]\",\r\n        category = \"network\",\r\n        arguments = [\r\n            required_argument!(\"name\", ValueType::String),\r\n            required_argument!(\"endpoint\", ValueType::Any)\r\n        ],\r\n        returns = ValueType::String,\r\n        handler = |state: \u0026mut State, arguments, token, _| {\r\n            let name = get_argument!(\"name\", arguments)\r\n                .as_a::\u003cStr\u003e()?\r\n                .inner()\r\n                .clone();\r\n            let endpoint = get_argument!(\"endpoint\", arguments);\r\n\r\n            crate::network_utils::ApiManager::set(\r\n                state,\r\n                \u0026name,\r\n                crate::network_utils::ApiDefinition::from_value(endpoint).ok_or(Error::ValueFormat {\r\n                    expected_format: format!(\"\u003curl: string\u003e | {{\u003curl: string\u003e, \u003cdescription: string\u003e, \u003cexamples: string\u003e, \u003cauth_key: string\u003e, \u003cheaders: object\u003e}}\"),\r\n                    token: token.clone()\r\n                })?,\r\n            )?;\r\n            Ok(Value::from(name))\r\n        }\r\n    );\r\n\r\n    #[cfg(feature = \"network-functions\")]\r\n    static_function!(\r\n        registry = map,\r\n        name = \"del_api\",\r\n        description = \"Unregisters an API\",\r\n        category = \"network\",\r\n        arguments = [required_argument!(\"name\", ValueType::String)],\r\n        returns = ValueType::String,\r\n        handler = |state: \u0026mut State, arguments, _token, _| {\r\n            let name = get_argument!(\"name\", arguments)\r\n                .as_a::\u003cStr\u003e()?\r\n                .inner()\r\        );\r\n    };\r\n}\r\n\r\npub fn register_all(map: \u0026mut HashMap\u003cString, Function\u003e) {\r\n    // to_degrees converts radians to degrees\r\n    static_function!(\r\n        registry = map,\r\n        name = \"to_degrees\",\r\n        description = \"Converts radians to degrees\",\r\n        category = \"trig\",\r\n        arguments = [required_argument!(\"radians\", ValueType::Numeric)],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let radians = *get_argument!(\"radians\", arguments).as_a::\u003cFloat\u003e()?.inner();\r\n            Ok(Value::from(radians * 180.0 / std::f64::consts::PI))\r\n        }\r\n    );\r\n\r\n    // to_radians converts degrees to radians\r\n    static_function!(\r\n        registry = map,\r\n        name = \"to_radians\",\r\n        description = \"Converts degrees to radians\",\r\n        category = \"trig\",\r\n        arguments = [required_argument!(\"degrees\", ValueType::Numeric)],\r\n        returns = ValueType::Float,\r\n        handler = |_: \u0026mut State, arguments, _token, _| {\r\n            let degrees = *get_argument!(\"degrees\", arguments).as_a::\u003cFloat\u003e()?.inner();\r\n            Ok(Value::from(degrees * std::f64::consts::PI / 180.0))\r\n        }\r\n    );\r\n\r\n    trig_function!(map, sin);\r\n    trig_function!(map, asin);\r\n    trig_function!(map, sinh);\r\n    trig_function!(map, asinh);\r\n\r\n    trig_function!(map, cos);\r\n    trig_function!(map, acos);\r\n    trig_function!(map, cosh);\r\n    trig_function!(map, acosh);\r\n\r\n    trig_function!(map, tan);\r\n    trig_function!(map, atan);\r\n    trig_function!(map, tanh);\r\n    trig_function!(map, atanh);\r\n}\r\n","traces":[{"line":24,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":26,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":27,"address":[],"length":0,"stats":{"Line":82},"fn_name":null},{"line":28,"address":[],"
