":{"Line":82},"fn_name":null},{"line":66,"address":[],"length":0,"stats":{"Line":82},"fn_name":null}],"covered":29,"coverable":33},{"path":["C:","\\","Users","rcarson1","Repositories","lavendeux_workspace","lavendeux_parser","src","syntax_tree","mod.rs"],"content":"//mod element;\r\npub mod node;\r\npub use node::Node;\r\n","traces":[],"covered":0,"coverable":0},{"path":["C:","\\","Users","rcarson1","Repositories","lavendeux_workspace","lavendeux_parser","src","syntax_tree","node","arithmetic.rs"],"content":"//! Infix Nodes\r\n//!\r\n//! Nodes for infix mathematical operations\r\n//!\r\nuse super::*;\r\nuse crate::{Rule, State, ToToken, Value};\r\nuse pest::iterators::Pair;\r\nuse polyvalue::operations::*;\r\n\r\ndefine_node!(\r\n    ArithmeticExpression {\r\n        operand_stack: Vec\u003cNode\u003e,\r\n        operator_stack: Vec\u003cArithmeticOperation\u003e\r\n    },\r\n    rules = [\r\n        ARITHMETIC_AS_EXPRESSION,\r\n        ARITHMETIC_MD_EXPRESSION,\r\n        ARITHMETIC_EXPONENTIATION_EXPRESSION\r\n    ],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner().rev().peekable();\r\n\r\n        let mut expr = Self {\r\n            operand_stack: Vec::new(),\r\n            operator_stack: Vec::new(),\r\n            token: token.clone(),\r\n        };\r\n\r\n        // We will build up a stack of operands and operators\r\n        expr.operand_stack.push(children.next().unwrap().to_ast_node()?);\r\n        while children.peek().is_some() {\r\n            let operation = children.next().unwrap().as_str();\r\n            let operation = match operation {\r\n                \"+\" =\u003e ArithmeticOperation::Add,\r\n                \"-\" =\u003e ArithmeticOperation::Subtract,\r\n                \"*\" =\u003e ArithmeticOperation::Multiply,\r\n                \"/\" =\u003e ArithmeticOperation::Divide,\r\n                \"%\" =\u003e ArithmeticOperation::Modulo,\r\n                \"**\" =\u003e ArithmeticOperation::Exponentiate,\r\n                _ =\u003e {\r\n                    return Err(Error::Internal(format!(\r\n                        \"Invalid arithmetic operation {:?}\",\r\n                        operation\r\n                    )))\r\n                }\r\n            };\r\n\r\n            expr.operator_stack.push(operation);\r\n            let operand = children.next().unwrap().to_ast_node()?;\r\n            expr.operand_stack.push(operand);\r\n        }\r\n\r\n        Ok(expr.boxed())\r\n    },\r\n\r\n    value = |this: \u0026ArithmeticExpression, state: \u0026mut State| {\r\n        let mut operands = this.operand_stack.iter().rev().peekable();\r\n        let mut operators = this.operator_stack.iter().rev().peekable();\r\n\r\n        let mut left = operands.next().unwrap().get_value(state)?;\r\n        while let Some(op) = operators.next() {\r\n            let right = operands.next().unwrap().get_value(state)?;\r\n            left = Value::arithmetic_op(\u0026left, \u0026right, *op)?;\r\n        }\r\n\r\n        Ok(left)\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    ArithmeticNegExpression { expression: Node },\r\n    rules = [ARITHMETIC_NEG_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner().rev();\r\n        let expression = children.next().unwrap().to_ast_node()?;\r\n\r\n        // If there are an odd number of negations, we need to invert the value\r\n        let mut do_invert = false;\r\n        while children.next().is_some() {\r\n            do_invert = !do_invert;\r\n        }\r\n\r\n        if do_invert {\r\n            Ok(Self { expression, token }.boxed())\r\n        } else {\r\n            // If there are an even number of negations, we can just return the inner expression\r\n            Ok(expression)\r\n        }\r\n    },\r\n    value = |this: \u0026ArithmeticNegExpression, state: \u0026mut State| {\r\n        let value = this.expression.get_value(state)?;\r\n        let value = Value::arithmetic_op(\u0026value, \u0026value.clone(), ArithmeticOperation::Negate)?;\r\n        Ok(value)\r\n    }\r\n);\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use super::*;\r\n    use crate::assert_tree;\r\n\r\n    #[test]\r\n    fn test_arithmetic_expr() {\r\n        // Test a big ugly nested expression, to rule out stack overflows\r\n        assert_tree!(\r\n            \"2*(2*(2*(2*(2*(2*(2*(2*(2*(2*(2*(2*(22*(2*(2*(2*(2))))))))))))))))\",\r\n            TOPLEVEL_EXPRESSION,\r\n            ArithmeticExpression,\r\n            |_: \u0026mut ArithmeticExpression| {}\r\n        );\r\n\r\n        // Test precedence\r\n        assert_tree!(\r\n            \"2+2*2\",\r\n            TOPLEVEL_EXPRESSION,\r\n            ArithmeticExpression,\r\n            |tree: \u0026mut ArithmeticExpression| {\r\n                assert_eq!(tree.operand_stack.len(), 2);\r\n                assert_eq!(tree.operator_stack.len(), 1);\r\n                assert_eq!(tree.operator_stack[0], ArithmeticOperation::Add);\r\n\r\n                assert_tree!(\r\n                    \u0026mut tree.operand_stack[0],\r\n                    ArithmeticExpression,\r\n                    |tree: \u0026mut ArithmeticExpression| {\r\n                        assert_eq!(tree.operand_stack.len(), 2);\r\n                        assert_eq!(tree.operator_stack.len(), 1);\r\n                        assert_eq!(tree.operator_stack[0], ArithmeticOperation::Multiply);\r\n                    }\r\n                );\r\n\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"6\");\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_arithmetic_neg_expr() {\r\n        assert_tree!(\r\n            \"-2\",\r\n            TOPLEVEL_EXPRESSION,\r\n            ArithmeticNegExpression,\r\n            |tree: \u0026mut ArithmeticNegExpression| {\r\n                let value = tr To variables, functions and compound values\r\n//!\r\nuse super::*;\r\nuse crate::{parse_input, user_function::UserFunction, Error, Rule, State, ToToken, Value};\r\nuse pest::iterators::Pair;\r\nuse polyvalue::{operations::IndexingMutationExt, types::Array, ValueTrait};\r\n\r\n// identifier ~ \"(\" ~ \")\" ~ \"=\" ~ TOPLEVEL_EXPRESSION |\r\n// identifier ~ \"(\" ~ identifier ~ (\",\" ~ identifier)* ~ \")\" ~ \"=\" ~ TOPLEVEL_EXPRESSION\r\ndefine_node!(\r\n    FunctionAssignment {\r\n        name: String,\r\n        arguments: Vec\u003cString\u003e,\r\n        expression: String\r\n    },\r\n    rules = [FUNCTION_ASSIGNMENT_STATEMENT],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        // Name of the function is the first child\r\n        let name = children.next().unwrap().as_str().to_string();\r\n\r\n        // Parse arguments\r\n        let mut arguments = Vec::new();\r\n        while children.peek().is_some() {\r\n            let arg = children.next().unwrap();\r\n            arguments.push(arg.as_str().to_string());\r\n        }\r\n\r\n        // Confirm validity of the function body by parsing it here\r\n        let expression = arguments.pop().unwrap();\r\n        parse_input(\u0026expression, Rule::TOPLEVEL_EXPRESSION)?;\r\n\r\n        Ok(Self {\r\n            name,\r\n            arguments,\r\n            expression,\r\n            token\r\n        }.boxed())\r\n    },\r\n\r\n    value = |assignment: \u0026FunctionAssignment, state: \u0026mut State| {\r\n        let function = UserFunction::new(\u0026assignment.name, assignment.arguments.clone(), assignment.expression.clone())?;\r\n        state.set_user_function(function);\r\n        Ok(Value::from(assignment.expression.clone()))\r\n    }\r\n);\r\n\r\n// identifier ~ \"=\" ~ TOPLEVEL_EXPRESSION\r\ndefine_node!(\r\n    VariableAssignment {\r\n        name: String,\r\n        value: Node\r\n    },\r\n    rules = [VARIABLE_ASSIGNMENT_STATEMENT],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let name = children.next().unwrap().as_str().to_string();\r\n        let value = children.next().unwrap().to_ast_node()?;\r\n        Ok(Self { name, value, token }.boxed())\r\n    },\r\n    value = |assignment: \u0026VariableAssignment, state: \u0026mut State| {\r\n        let value = (*assignment.value).get_value(state)?;\r\n        state.set_variable(\u0026assignment.name, value.clone());\r\n        Ok(value)\r\n    }\r\n);\r\n\r\n// identifier ~ (\"[\" ~ TOPLEVEL_EXPRESSION ~ \"]\")+ ~ \"=\" ~ TOPLEVEL_EXPRESSION\r\ndefine_node!(\r\n    IndexAssignment {\r\n        name: String,\r\n        indices: Vec\u003cNode\u003e,\r\n        value: Node\r\n    },\r\n    rules = [INDEX_ASSIGNMENT_STATEMENT],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let name = children.next().unwrap().as_str().to_string();\r\n        let mut indices = Vec::new();\r\n        while children.peek().is_some() {\r\n            let index = children.next().unwrap();\r\n            indices.push(index.to_ast_node()?);\r\n        }\r\n\r\n        let value = indices.pop().unwrap();\r\n\r\n        Ok(Self {\r\n            name,\r\n            indices,\r\n            value,\r\n            token,\r\n        }.boxed())\r\n    },\r\n\r\n    value = |assignment: \u0026IndexAssignment, state: \u0026mut State| {\r\n        let value = (*assignment.value).get_value(state)?;\r\n\r\n        // The last index is the one that will be used to set the value\r\n        let mut indices = assignment.indices.iter().map(|node| node.get_value(state)).collect::\u003cResult\u003cVec\u003c_\u003e, _\u003e\u003e()?;\r\n        let final_index = indices.pop().unwrap();\r\n\r\n        // Move through the indices to get the final pointer\r\n        let mut dst = state.get_variable(\u0026assignment.name).ok_or(Error::VariableName {\r\n            name: assignment.name.clone(),\r\n            token: assignment.token().clone(),\r\n        })?;\r\n        let mut ptr = \u0026mut dst;\r\n        for index in \u0026indices {\r\n            ptr = ptr.get_index_mut(index)?;\r\n        }\r\n\r\n        // Set the value\r\n        ptr.set_index(\u0026final_index, value.clone())?;\r\n\r\n        // Set state and return\r\n        state.set_variable(\u0026assignment.name, dst);\r\n        Ok(value)\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    DestructuringAssignment {\r\n        names: Vec\u003cString\u003e,\r\n        value: Node\r\n    },\r\n    rules = [DESTRUCTURING_ASSIGNMENT_STATEMENT],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner().rev();\r\n\r\n        let value = children.next().unwrap().to_ast_node()?; // last child is the value\r\n\r\n        let mut children = children.rev();\r\n\r\n        let mut names = Vec::new();\r\n        while let Some(next) = children.next() {\r\n            let name = next.as_str().to_string();\r\n            names.push(name);\r\n        }\r\n\r\n        Ok(Self {\r\n            names,\r\n            value,\r\n            token,\r\n        }.boxed())\r\n    },\r\n\r\n    value = |assignment: \u0026DestructuringAssignment, state: \u0026mut State| {\r\n        let value = (*assignment.value).get_value(state)?;\r\n        let values = value.as_a::\u003cArray\u003e()?.inner().clone();\r\n        if values.len() != assignment.names.len() {\r\n            return Err(Error::DestructuringAssignment {\r\n                expected_length: assignment.names.len(),\r\n                actual_length: values.len(),\r\n                token: assignment.token().clone(),\r\n            });\r\n        }\r\n\r\n        for (name, value) in assignment.names.iter().zip(values) {\r\n            state.set_variable(name, value);\r\n        }\r\n\r\n        Ok(value)\r\n    }\r\n);\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use crate::{assert_tree, assert_tree_error};\r\n\r\n    use super::*;\r\n\r\n    #[test]\r\n    fn test_destructuring_assignment() {\r\n        assert_tree!(\r\n            \"(a, b, c) = a\",\r\n            DESTRUCTURING_ASSIGNMENT_STATEMENT,\r\n            DestructuringAssignment,\r\n            |tree: \u0026mut DestructuringAssignment| {\r\n                assert_eq!(tree.names.len(), 3);\r\n                assert_eq!(tree.names[0], \"a\");\r\n                assert_eq!(tree.names[1], \"b\");\r\n                assert_eq!(tree.names[2], \"c\");\r\n                assert_eq!(tree.value.to_string(), \"a\");\r\n\r\n                let mut state = State::new();\r\n                state.set_variable(\r\n                    \"a\",\r\n                    Value::from(vec![Value::from(1), Value::from(2), Value::from(3)]),\r\n                );\r\n                tree.get_value(\u0026mut state).unwrap();\r\n                assert_eq!(state.get_variable(\"a\").unwrap().to_string(), \"1\");\r\n                assert_eq!(state.get_variable(\"b\").unwrap().to_string(), \"2\");\r\n                assert_eq!(state.get_variable(\"c\").unwrap().to_string(), \"3\");\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_function_assignment() {\r\n        assert_tree!(\r\n            \"test() = 1\",\r\n            FUNCTION_ASSIGNMENT_STATEMENT,\r\n            FunctionAssignment,\r\n            |tree: \u0026mut FunctionAssignment| {\r\n                assert_eq!(tree.name, \"test\");\r\n                assert_eq!(0, tree.arguments.len());\r\n                assert_eq!(tree.expression, \"1\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"test(a) = 2*a\",\r\n            FUNCTION_ASSIGNMENT_STATEMENT,\r\n            FunctionAssignment,\r\n            |tree: \u0026mut FunctionAssignment| {\r\n                assert_eq!(tree.name, \"test\");\r\n                assert_eq!(tree.arguments[0], \"a\");\r\n                assert_eq!(tree.expression, \"2*a\");\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_variable_assignment() {\r\n        assert_tree!(\r\n            \"a = 1\",\r\n            VARIABLE_ASSIGNMENT_STATEMENT,\r\n            VariableAssignment,\r\n            |tree: \u0026mut VariableAssignment| {\r\n                assert_eq!(tree.name, \"a\");\r\n                assert_eq!(tree.value.to_string(), \"1\");\r\n\r\n                let mut state = State::new();\r\n                tree.get_value(\u0026mut state).unwrap();\r\n                assert_eq!(state.get_variable(\"a\").unwrap().to_string(), \"1\");\r\n            }\r\n        );\r\n\r\n        assert_tree_error!(\"pi = 2\", Pest);\r\n    }\r\n\r\n    #[test]\r\n    fn test_index_assignment() {\r\n        assert_tree!(\r\n            \"a[-1] = 1\",\r\n            INDEX_ASSIGNMENT_STATEMENT,\r\n            IndexAssignment,\r\n            |tree: \u0026mut IndexAssignment| {\r\n                assert_eq!(tree.name, \"a\");\r\n                assert_eq!(tree.indices.len(), 1);\r\n                assert_eq!(tree.indices[0].to_string(), \"-1\");\r\n                assert_eq!(tree.value.to_string(), \"1\");\r\n\r\n                let mut state = State::new();\r\n                state.set_variable(\"a\", Value::from(vec![Value::from(0), Value::from(1)]));\r\n                let value = tree.get_value(\u0026mut state).unwrap();\r\n                assert_eq!(value.to_string(), \"1\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"a[2] = 1\",\r\n            INDEX_ASSIGNMENT_STATEMENT,\r\n            IndexAssignment,\r\n            |tree: \u0026mut IndexAssignment| {\r\n                assert_eq!(tree.name, \"a\");\r\n                assert_eq!(tree.indices.len(), 1);\r\n                assert_eq!(tree.indices[0].to_string(), \"2\");\r\n\r\n                let mut state = State::n r,\r\n                \"\u0026\" =\u003e BitwiseOperation::And,\r\n                \"^\" =\u003e BitwiseOperation::Xor,\r\n                \"\u003c\u003c\" =\u003e BitwiseOperation::LeftShift,\r\n                \"\u003e\u003e\" =\u003e BitwiseOperation::RightShift,\r\n                _ =\u003e {\r\n                    return Err(Error::Internal(format!(\r\n                        \"Invalid bitwise operation {:?}\",\r\n                        operation\r\n                    )))\r\n                }\r\n            };\r\n            expr.operator_stack.push(operation);\r\n\r\n            let operand = children.next().unwrap().to_ast_node()?;\r\n            expr.operand_stack.push(operand);\r\n        }\r\n\r\n        Ok(expr.boxed())\r\n    },\r\n    value = |this: \u0026BitwiseExpression, state: \u0026mut State| {\r\n        let mut operands = this.operand_stack.iter().rev().peekable();\r\n        let mut operators = this.operator_stack.iter().rev().peekable();\r\n\r\n        let mut left = operands.next().unwrap().get_value(state)?;\r\n        while let Some(op) = operators.next() {\r\n            let right = operands.next().unwrap().get_value(state)?;\r\n            left = Value::bitwise_op(\u0026left, \u0026right, *op)?;\r\n        }\r\n\r\n        Ok(left)\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    BitwiseNotExpression { expression: Node },\r\n    rules = [BITWISE_NOT_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner().rev();\r\n        let expression = children.next().unwrap().to_ast_node()?;\r\n\r\n        // If there are an odd number of negations, we need to invert the value\r\n        let mut do_invert = false;\r\n        while children.next().is_some() {\r\n            do_invert = !do_invert;\r\n        }\r\n\r\n        if do_invert {\r\n            Ok(Self { expression, token }.boxed())\r\n        } else {\r\n            // If there are an even number of negations, we can just return the inner expression\r\n            Ok(expression)\r\n        }\r\n    },\r\n    value = |this: \u0026BitwiseNotExpression, state: \u0026mut State| {\r\n        let value = this.expression.get_value(state)?;\r\n        let value = Value::bitwise_op(\u0026value, \u0026value.clone(), BitwiseOperation::Not)?;\r\n        Ok(value)\r\n    }\r\n);\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use super::*;\r\n    use crate::assert_tree;\r\n\r\n    #[test]\r\n    fn test_bitwise_expr() {\r\n        assert_tree!(\r\n            \"0x0A | 0x05\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BitwiseExpression,\r\n            |tree: \u0026mut BitwiseExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"15\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"0x0A \u0026 0x05\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BitwiseExpression,\r\n            |tree: \u0026mut BitwiseExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"0\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"0x0A ^ 0x05\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BitwiseExpression,\r\n            |tree: \u0026mut BitwiseExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"15\");\r\n            }\r\n        );\r\n\r\n        // Test precedence\r\n        assert_tree!(\r\n            \"0x0A | 0x05 \u0026 0x0F\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BitwiseExpression,\r\n            |tree: \u0026mut BitwiseExpression| {\r\n                assert_eq!(BitwiseOperation::Or, tree.operator_stack[0]);\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_bitwise_not_expr() {\r\n        assert_tree!(\r\n            \"~0xA0\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BitwiseNotExpression,\r\n            |tree: \u0026mut BitwiseNotExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"-161\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"~~0x0A\",\r\n            TOPLEVEL_EXPRESSION,\r\n            ValueLiteral,\r\n            |tree: \u0026mut ValueLiteral| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"10\");\r\n            }\r\n        );\r\n    }\r\n}\r\n","traces":[{"line":16,"address":[],"length":0,"stats":{"Line":5},"fn_name":null},{"line":17,"address":[],"length":0,"stats":{"Line":5},"fn_name":null},{"line":18,"address":[],"length":0,"stats":{"Line":5},"fn_name":null},{"line":20,"address":[],"length":0,"stats":{"Line":5},"fn_name":null},{"line":21,"address":[],"length":0,"stats":{"Line":5},"fn_name":null},{"line":22,"address":[],"length":0,"stats":{"Line":5},"fn_name":null},{"line":23,"address":[],"length":0,"stats":{"Line":5},"fn_name":null},{"line":27,"address":[],"length":0,"stats":{"Line":5},"fn_name":null},{"line":28,"address":[],"length":0,"stats":{"Line":10},"fn_name":null},{"line":29,"address":[],"length":0,"stats":{"Line":5},"fn_name":null},{"line":30,"address":[],"length":0,"stats":{"Line":10},"fn_name":null},{"line":31,"address":[],"length":0,"stats":{"Line":7},"fn_name":null},{"line":32,"address":[],"length":0,"stats":{"Line":5},"fn_name":null},{"line":33,"address":[],"length":0,"stats":{"Line":2},"fn_name":null},{"line":34,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":35,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":37,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":38,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":39,"address":[],"length":0,"stats":{"Line":0},"fn_ ontent":"//! Unary Nodes\r\n//!\r\n//! Nodes for unary operations\r\n//!\r\nuse super::*;\r\nuse crate::{Rule, State, ToToken, Value};\r\nuse pest::iterators::Pair;\r\nuse polyvalue::types::Bool;\r\nuse polyvalue::{operations::*, ValueTrait};\r\n\r\ndefine_node!(\r\n    BooleanExpression {\r\n        operand_stack: Vec\u003cNode\u003e,\r\n        operator_stack: Vec\u003cBooleanOperation\u003e\r\n    },\r\n    rules = [BOOLEAN_AND_EXPRESSION, BOOLEAN_OR_EXPRESSION, BOOLEAN_CMP_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner().rev().peekable();\r\n\r\n        let mut expr = Self {\r\n            operand_stack: Vec::new(),\r\n            operator_stack: Vec::new(),\r\n            token,\r\n        };\r\n\r\n        // We will build up a stack of operands and operators\r\n        expr.operand_stack.push(children.next().unwrap().to_ast_node()?);\r\n        while children.peek().is_some() {\r\n            let operation = children.next().unwrap().as_str();\r\n            let operation = match operation {\r\n                \"==\" =\u003e BooleanOperation::EQ,\r\n                \"!=\" =\u003e BooleanOperation::NEQ,\r\n                \"\u003c\" =\u003e BooleanOperation::LT,\r\n                \"\u003c=\" =\u003e BooleanOperation::LTE,\r\n                \"\u003e\" =\u003e BooleanOperation::GT,\r\n                \"\u003e=\" =\u003e BooleanOperation::GTE,\r\n                \"\u0026\u0026\" =\u003e BooleanOperation::And,\r\n                \"||\" =\u003e BooleanOperation::Or,\r\n                _ =\u003e {\r\n                    return Err(Error::Internal(format!(\r\n                        \"Invalid boolean operation {:?}\",\r\n                        operation\r\n                    )))\r\n                }\r\n            };\r\n            expr.operator_stack.push(operation);\r\n\r\n            let operand = children.next().unwrap().to_ast_node()?;\r\n            expr.operand_stack.push(operand);\r\n        }\r\n\r\n        Ok(expr.boxed())\r\n    },\r\n    value = |this: \u0026BooleanExpression, state: \u0026mut State| {\r\n        let mut operands = this.operand_stack.iter().rev().peekable();\r\n        let mut operators = this.operator_stack.iter().rev().peekable();\r\n\r\n        let mut left = operands.next().unwrap().get_value(state)?;\r\n        while let Some(op) = operators.next() {\r\n            let ss_eval_op = *left.as_a::\u003cBool\u003e()?.inner();\r\n            if *op == BooleanOperation::And \u0026\u0026 !ss_eval_op {\r\n                // Short circuit\r\n                left = Value::from(false);\r\n            } else if *op == BooleanOperation::Or \u0026\u0026 ss_eval_op {\r\n                // Short circuit\r\n                left = Value::from(true);\r\n            } else {\r\n                let right = operands.next().unwrap().get_value(state)?;\r\n                left = Value::boolean_op(\u0026left, \u0026right, *op)?;\r\n            }\r\n        }\r\n\r\n        Ok(left)\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    BooleanNotExpression { expression: Node },\r\n    rules = [BOOLEAN_NOT_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner().rev();\r\n        let expression = children.next().unwrap().to_ast_node()?;\r\n\r\n        // If there are an odd number of negations, we need to invert the value\r\n        let mut do_invert = false;\r\n        while children.next().is_some() {\r\n            do_invert = !do_invert;\r\n        }\r\n\r\n        if do_invert {\r\n            Ok(Self { expression, token }.boxed())\r\n        } else {\r\n            // If there are an even number of negations, we can just return the inner expression\r\n            Ok(expression)\r\n        }\r\n    },\r\n    value = |this: \u0026BooleanNotExpression, state: \u0026mut State| {\r\n        let value = this.expression.get_value(state)?;\r\n        let value = Value::boolean_op(\u0026value, \u0026value.clone(), BooleanOperation::Not)?;\r\n        Ok(value)\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    MatchingExpression {\r\n        value: Node,\r\n        operation: MatchingOperation,\r\n        pattern: Node\r\n    },\r\n    rules = [MATCHING_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let value = children.next().unwrap().to_ast_node()?;\r\n        let operation = children.next().unwrap().as_str();\r\n        let operation = match operation {\r\n            \"contains\" =\u003e MatchingOperation::Contains,\r\n            \"matches\" =\u003e MatchingOperation::Matches,\r\n            \"is\" =\u003e MatchingOperation::Is,\r\n            \"startswith\" | \"starts_with\" =\u003e MatchingOperation::StartsWith,\r\n            \"endswith\" | \"ends_with\" =\u003e MatchingOperation::EndsWith,\r\n            _ =\u003e {\r\n                return Err(Error::Internal(format!(\r\n                    \"Invalid matching operation {:?}\",\r\n                    operation\r\n                )))\r\n            }\r\n        };\r\n        let pattern = children.next().ok_or(Error::IncompleteMatchingExpression {\r\n            token: token.clone(),\r\n        })?;\r\n\r\n        // is is a special case because it is the only operation that can accept an identifier\r\n        // as a pattern - the type name can be a string, but does not need to be\r\n        let pattern = if operation == MatchingOperation::Is {\r\n            let s = pattern.as_str().to_string();\r\n            ValueLiteral::new(Value::from(s), pattern.to_token()).boxed()\r\n        } else {\r\n            pattern.to_ast_node()?\r\n        };\r\n\r\n        Ok(Self {\r\n            value,\r\n            operation,\r\n            pattern,\r\n            token,\r\n        }\r\n        .boxed())\r\n    },\r\n    value = |this: \u0026MatchingExpression, state: \u0026mut State| {\r\n        let value = this.value.get_value(state)?;\r\n        let pattern = this.pattern.get_value(state)?;\r\n        Ok(Value::matching_op(\u0026value, \u0026pattern, this.operation)?)\r\n    }\r\n);\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use super::*;\r\n    use crate::assert_tree;\r\n\r\n    #[test]\r\n    fn test_matching_expr() {\r\n        assert_tree!(\r\n            \"'a' contains 'b'\",\r\n            MATCHING_EXPRESSION,\r\n            MatchingExpression,\r\n            |tree: \u0026mut MatchingExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"false\");\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_boolean_expr() {\r\n        assert_tree!(\r\n            \"true \u0026\u0026 false\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"false\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"true || false\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"true \u0026\u0026 false || true\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"3 \u003e 1\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"3 \u003e= 3\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"3 \u003c 1\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"false\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"3 \u003c= 3\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"3 == 3\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"3 != 3\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanExpression,\r\n            |tree: \u0026mut BooleanExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"false\");\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_boolean_not_expr() {\r\n        assert_tree!(\r\n            \"!true\",\r\n            TOPLEVEL_EXPRESSION,\r\n            BooleanNotExpression,\r\n            |tree: \u0026mut BooleanNotExpression| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"false\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"!!true\",\r\n            TOPLEVEL_EXPRESSION,\r\n            ValueLiteral,\r\n            |tree: \u0026mut ValueLiteral| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(value.to_string(), \"true\");\r\n            }\r\n        );\r\n    }\r\n}\r\n","traces":[{"line":17,"address":[],"length":0,"stats":{"Line":10},"fn_name":null},{"line":18,"address":[],"length":0,"stats":{"Line":10},"fn_name":null},{"line":19,"address":[],"length":0,"stats":{"Line":10},"fn_name":null},{"line":21,"address":[],"length":0,"stats":{"Line":10},"fn_name":null},{"line":22,"address":[],"length":0,"stats":{"Line":10},"fn_name":null},{"line":23,"address":[],"length":0,"stats":{"Line":10},"fn_name":null},{"line":24,"address":[],"length":0,"stats":{"Line":10},"fn_name":null},{"line":28,"address":[],"length":0,"stats":{"Line":10},"fn_name":null},{"line":29,"address":[],"length":0,"stats":{"Line":20},"fn_name":null},{"line":30,"address":[],"length":0,"stats":{"Line":10},"fn_name":null},{"line":31,"address":[],"length":0,"stats":{"Line":20},"fn_name":null},{"line":32,"address":[],"length":0,"stats":{"Line":11},"fn_name":null},{"line":33,"address":[],"length":0,"stats":{"Line":10},"fn_name":null},{"line":34,"address":[],"length":0,"stats":{"Line":9},"fn_name":null},{"line":35,"address":[],"length":0,"stats":{"Line":8},"fn_name":null},{"line":36,"address":[],"length":0,"stats":{"Line":7},"fn_name":null},{"line":37,"address":[],"length":0,"stats":{"Line":6},"fn_name":null}, ":{"Line":1},"fn_name":null},{"line":146,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line":147,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line":148,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line":149,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line":151,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line":153,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line":154,"address":[],"length":0,"stats":{"Line":2},"fn_name":null},{"line":155,"address":[],"length":0,"stats":{"Line":2},"fn_name":null},{"line":156,"address":[],"length":0,"stats":{"Line":1},"fn_name":null}],"covered":71,"coverable":83},{"path":["C:","\\","Users","rcarson1","Repositories","lavendeux_workspace","lavendeux_parser","src","syntax_tree","node","core.rs"],"content":"//! Core Node\r\n//!\r\n//! High-level nodes that are used to build the syntax tree.\r\n//! These nodes are how the user will interact with the syntax tree.\r\n//!\r\nuse super::*;\r\nuse crate::{Error, Rule, State, ToToken, Value};\r\nuse pest::iterators::Pair;\r\nuse polyvalue::types::{Array, Bool, Range};\r\nuse polyvalue::{ValueTrait, ValueType};\r\n\r\n// LINE* ~ EOI\r\ndefine_node!(\r\n    Script {\r\n        statements: Vec\u003cNode\u003e\r\n    },\r\n    rules = [SCRIPT],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n\r\n\r\n        let statements = input\r\n            .into_inner()\r\n            .filter(|child| child.as_rule() != Rule::EOI \u0026\u0026 child.as_rule() != Rule::EOL)\r\n            .map(|child| Ok(child.to_ast_node()?))\r\n            .collect::\u003cResult\u003cVec\u003cNode\u003e, Error\u003e\u003e()?;\r\n\r\n        Ok(Self {\r\n            statements,\r\n            token\r\n        }.boxed())\r\n    },\r\n\r\n    value = |script: \u0026Script, state: \u0026mut State| {\r\n        let values = script.statements.iter().map(|node| node.get_value(state)).collect::\u003cResult\u003cVec\u003c_\u003e, _\u003e\u003e()?;\r\n        Ok(Value::Array(values.into()))\r\n    }\r\n);\r\n\r\n// EXPRESSION ~ \"@\" ~ identifier ~ EOL\r\n// | EXPRESSION ~ EOL\r\n// | EOL\r\ndefine_node!(\r\n    Line {\r\n        expression: Option\u003cNode\u003e,\r\n        decorator: Option\u003cString\u003e\r\n    },\r\n    rules = [LINE],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let next = children.next();\r\n        if next.is_none() {\r\n            return Ok(Self {\r\n                expression: None,\r\n                decorator: None,\r\n                token\r\n            }.boxed());\r\n        } else {\r\n            let expression = next.unwrap().to_ast_node()?;\r\n            let decorator = children.next().and_then(|c| Some(c.as_str().to_string()));\r\n\r\n            Ok(Self {\r\n                expression: Some(expression),\r\n                decorator,\r\n                token\r\n            }.boxed())\r\n        }\r\n    },\r\n\r\n    value = |line: \u0026Line, state: \u0026mut State| {\r\n        if let Some(expression) = \u0026line.expression {\r\n            let value = expression.get_value(state)?;\r\n            if let Some(decorator) = \u0026line.decorator {\r\n                let result = state.decorate(decorator, line.token(), value)?;\r\n                Ok(Value::from(result).into())\r\n            } else {\r\n                Ok(value)\r\n            }\r\n        } else {\r\n            Ok(Value::from(\"\").into())\r\n        }\r\n    }\r\n);\r\n\r\n// BOOLEAN_OR_EXPRESSION ~ (\"?\" ~ BOOLEAN_OR_EXPRESSION ~ \":\" ~ BOOLEAN_OR_EXPRESSION)*\r\ndefine_node!(\r\n    TernaryExpression {\r\n        condition: Node,\r\n        if_true: Node,\r\n        if_false: Node\r\n    },\r\n    rules = [TERNARY_EXPRESSION, IF_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner().rev().peekable();\r\n\r\n        // We will begin at the end, the final right-side expression\r\n        // Then we will work backwards, grabbing pairs of expressions\r\n        // And turning them into ternary expressions with the previous\r\n        // iteration as the false side until we run out of children\r\n        let mut if_false = children.next().unwrap().to_ast_node()?;\r\n        while children.peek().is_some() {\r\n            let if_true = children.next().unwrap().to_ast_node()?;\r\n            let condition = children.next().unwrap().to_ast_node()?;\r\n\r\n            if_false = Box::new(Self {\r\n                condition,\r\n                if_true,\r\n                if_false,\r\n                token: token.clone(),\r\n            });\r\n        }\r\n\r\n        Ok(if_false)\r\n    },\r\n    value = |ternary: \u0026TernaryExpression, state: \u0026mut State| {\r\n        let condition = ternary.condition.get_value(state)?;\r\n        let condition = *condition.as_a::\u003cBool\u003e()?.inner();\r\n        if condition {\r\n            ternary.if_true.get_value(state)\r\n        } else {\r\n            ternary.if_false.get_value(state)\r\n        }\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    ForLoopExpression {\r\n        variable: Option\u003cString\u003e,\r\n        iterable: Node,\r\n        body: Node\r\n    },\r\n    rules = [FOR_LOOP_EXPRESSION],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner().rev();\r\n\r\n        let body = children.next().unwrap().to_ast_node()?;\r\n        let iterable = children.next().unwrap().to_ast_node()?;\r\n        let variable = children.next().map(|c| c.as_str().to_string());\r\n\r\n        Ok(Self {\r\n            variable,\r\n            iterable,\r\n            body,\r\n            token\r\n        }.boxed())\r\n    },\r\n\r\n    value = |for_loop: \u0026ForLoopExpression, state: \u0026mut St ::assert_tree_error;\r\n\r\n    #[test]\r\n    fn test_errors() {\r\n        assert_tree_error!(\"1 +\\\\\", UnterminatedLinebreak);\r\n        assert_tree_error!(\"1 + \\\"\", UnterminatedLiteral);\r\n        assert_tree_error!(\"1 + /*\", UnterminatedComment);\r\n        assert_tree_error!(\"@1 + 1\", UnexpectedDecorator);\r\n        assert_tree_error!(\"..\", IncompleteRangeExpression);\r\n        assert_tree_error!(\"..1\", IncompleteRangeExpression);\r\n        assert_tree_error!(\"1 + 1 matches\", IncompleteMatchingExpression);\r\n        assert_tree_error!(\"{0}\", IncompleteObject);\r\n    }\r\n}\r\n","traces":[{"line":28,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line":29,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line":30,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line":31,"address":[],"length":0,"stats":{"Line":1},"fn_name":null},{"line":32,"address":[],"length":0,"stats":{"Line":2},"fn_name":null},{"line":33,"address":[],"length":0,"stats":{"Line":1},"fn_name":null}],"covered":6,"coverable":6},{"path":["C:","\\","Users","rcarson1","Repositories","lavendeux_workspace","lavendeux_parser","src","syntax_tree","node","function.rs"],"content":"//! Function Nodes\r\n//!\r\n//! Node types for function calls\r\n//!\r\nuse super::*;\r\nuse crate::{Error, Rule, State, ToToken, Value};\r\nuse pest::iterators::Pair;\r\n\r\ndefine_node!(\r\n    FunctionCall {\r\n        name: String,\r\n        arguments: Vec\u003cNode\u003e\r\n    },\r\n    rules = [FUNCTION_CALL_EXPRESSION],\r\n\r\n    new = |input:Pair\u003cRule\u003e| {\r\n        let mut token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let name = children.next().unwrap().as_str().to_string();\r\n        children.next().unwrap(); // skip marker\r\n        let arguments = if name == \"help\" {\r\n            //\r\n            // Help function takes in an identifier as an argument\r\n            // and returns the help text for that function / category / etc.\r\n            // But we need to prevent lookups of the identifier\r\n            children\r\n            .map(|child| {\r\n                let ident = Identifier::from_pair(child)?;\r\n                let value_lit = ValueLiteral::new(Value::from(ident.token().input.clone()), ident.token().clone());\r\n                Ok(value_lit.boxed())\r\n            })\r\n            .collect::\u003cResult\u003cVec\u003cNode\u003e, Error\u003e\u003e()?\r\n        } else {\r\n            //\r\n            // Other functions take in expressions as arguments\r\n            children\r\n            .map(|child| Ok(child.to_ast_node()?))\r\n            .collect::\u003cResult\u003cVec\u003cNode\u003e, Error\u003e\u003e()?\r\n        };\r\n\r\n        // Function arguments can have variable references to the first argument in order to\r\n        // update values. This is especially useful for array functions like push, pop, etc.\r\n        let effective_reference = arguments.iter().next().and_then(|c| c.token().references.clone());\r\n        token.references = effective_reference;\r\n\r\n        Ok(Self {\r\n            name,\r\n            arguments,\r\n            token\r\n        }.boxed())\r\n    },\r\n\r\n    value = |call: \u0026FunctionCall, state: \u0026mut State| {\r\n        if call.name == \"help\" {\r\n            let filter = if let Some(s) = call.arguments.last() {\r\n                Some(s.get_value(state)?.to_string())\r\n            } else {\r\n                None\r\n            };\r\n\r\n            return Ok(Value::from(state.help(filter)));\r\n        }\r\n\r\n        let function = state.get_function(\u0026call.name).ok_or(Error::FunctionName {\r\n            name: call.name.clone(),\r\n            token: call.token().clone()\r\n        })?;\r\n\r\n        // Collect arguments\r\n        let mut arguments = Vec::new();\r\n        for argument in call.arguments.iter() {\r\n            arguments.push(argument.get_value(state) u003e {\r\n                let range = Str::index_value_to_range(\u0026index)?;\r\n                let value = s.substr(\u0026range.start()..=\u0026range.end())?;\r\n                Ok(Value::from(value))\r\n            }\r\n\r\n            // Range op indexing\r\n            _ if index.is_a(ValueType::Array) =\u003e {\r\n                let results = base.get_indices(\u0026index)?.as_a::\u003cArray\u003e()?;\r\n                let results = results.inner().iter().cloned().collect::\u003cVec\u003c_\u003e\u003e();\r\n                Ok(Value::from(results))\r\n            }\r\n\r\n            // Normal indexing\r\n            _ =\u003e Ok(base.get_index(\u0026index)?),\r\n        }\r\n    }\r\n);\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use super::*;\r\n    use crate::assert_tree;\r\n\r\n    #[test]\r\n    fn test_indexing_expr() {\r\n        assert_tree!(\r\n            \"a[0]\",\r\n            INDEXING_EXPRESSION,\r\n            IndexingExpression,\r\n            |node: \u0026mut IndexingExpression| {\r\n                assert_eq!(node.base.to_string(), \"a\");\r\n                assert_eq!(node.index.to_string(), \"0\");\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"a[0][1]\",\r\n            INDEXING_EXPRESSION,\r\n            IndexingExpression,\r\n            |node: \u0026mut IndexingExpression| {\r\n                assert_tree!(\r\n                    \u0026mut node.base,\r\n                    IndexingExpression,\r\n                    |node: \u0026mut IndexingExpression| {\r\n                        assert_eq!(node.base.to_string(), \"a\");\r\n                        assert_eq!(node.index.to_string(), \"0\");\r\n                    }\r\n                );\r\n                assert_eq!(node.index.to_string(), \"1\");\r\n            }\r\n        );\r\n    }\r\n}\r\n","traces":[{"line":20,"address":[],"length":0,"stats":{"Line":2},"fn_name":null},{"line":21,"address":[],"length":0,"stats":{"Line":2},"fn_name":null},{"line":22,"addr en, Value};\r\nuse pest::iterators::Pair;\r\nuse polyvalue::operations::IndexingMutationExt;\r\nuse polyvalue::{types::*, ValueTrait, ValueType};\r\nuse std::str::FromStr;\r\n\r\nfn parse_string(input: \u0026str) -\u003e String {\r\n    // Sanity check\r\n    if input.len() \u003c 2 {\r\n        return String::new();\r\n    }\r\n\r\n    // Remove the first and last characters - the quotes around our string\r\n    // This would not work great with graphemes like , but we know that it's\r\n    // either ' or \" so this should be safe\r\n    let mut c = input.chars();\r\n    c.next();\r\n    c.next_back();\r\n\r\n    // Now we split along our \\\\ backslash escapes, and rejoin after\r\n    // to prevent going over them twice. This method isn't super\r\n    // neat, there's likely a better way\r\n    c.as_str()\r\n        .split(\"\\\\\\\\\")\r\n        .map(|s| {\r\n            s.replace(\"\\\\'\", \"\\'\")\r\n                .replace(\"\\\\\\\"\", \"\\\"\")\r\n                .replace(\"\\\\n\", \"\\n\")\r\n                .replace(\"\\\\\\n\", \"\\n\")\r\n                .replace(\"\\\\\\r\", \"\\r\")\r\n                .replace(\"\\\\r\", \"\\r\")\r\n                .replace(\"\\\\t\", \"\\t\")\r\n        })\r\n        .collect::\u003cVec\u003cString\u003e\u003e()\r\n        .join(\"\\\\\")\r\n}\r\n\r\ndefine_node!(\r\n    ValueLiteral { value: Value },\r\n    rules = [\r\n        currency_literal,\r\n        fixed_literal,\r\n        sci_literal,\r\n        float_literal,\r\n        bool_literal,\r\n        regex_literal,\r\n        sized_literal,\r\n        string_literal\r\n    ],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let value = match input.as_rule() {\r\n            Rule::int_literal =\u003e I64::from_str(input.as_str())?.into(),\r\n            Rule::float_literal | Rule::sci_literal =\u003e Float::from_str(input.as_str())?.into(),\r\n\r\n            Rule::hex_literal | Rule::bin_literal | Rule::oct_literal =\u003e {\r\n                I64::from_str_radix(input.as_str())?.into()\r\n            }\r\n\r\n            Rule::string_literal =\u003e parse_string(input.as_str()).into(),\r\n            Rule::bool_literal =\u003e Bool::from_str(input.as_str())?.into(),\r\n\r\n            Rule::regex_literal =\u003e Str::new(input.as_str().to_string()).into(),\r\n\r\n            Rule::sized_literal =\u003e {\r\n                let input = input.as_str();\r\n\r\n                if let Some(integer) = input.strip_suffix(\"u8\") {\r\n                    polyvalue::types::U8::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"u16\") {\r\n                    polyvalue::types::U16::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"u32\") {\r\n                    polyvalue::types::U32::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"u64\") {\r\n                    polyvalue::types::U64::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"i8\") {\r\n                    polyvalue::types::I8::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"i16\") {\r\n                    polyvalue::types::I16::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"i32\") {\r\n                    polyvalue::types::I32::from_str(integer)?.into()\r\n                } else if let Some(integer) = input.strip_suffix(\"i64\") {\r\n                    polyvalue::types::I64::from_str(integer)?.into()\r\n                } else {\r\n                    polyvalue::types::I64::from_str(input)?.into()\r\n                }\r\n            }\r\n\r\n            Rule::fixed_literal =\u003e {\r\n                // remove the D suffix first\r\n                let input = \u0026input.as_str()[..input.as_str().len() - 1];\r\n                Fixed::from_str(input)?.into()\r\n            }\r\n            Rule::currency_literal =\u003e Currency::from_str(input.as_str())?.into(),\r\n\r\n            _ =\u003e Err(Error::Internal(format!(\r\n                \"Unexpected rule {:?} in ValueLiteral\",\r\n                input.as_rule()\r\n            )))?,\r\n        };\r\n\r\n        Ok(Self { value, token }.boxed())\r\n    },\r\n    value = |this: \u0026ValueLiteral, _state: \u0026mut State| { Ok(this.value.clone()) }\r\n);\r\n\r\nimpl ValueLiteral {\r\n    pub fn new(value: Value, token: Token) -\u003e Self {\r\n        Self { value, token }\r\n    }\r\n}\r\n\r\ndefine_node!(\r\n    ConstantValue { value: Value },\r\n    rules = [const_literal],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let text = input.as_str();\r\n\r\n        let value = match text {\r\n            \"pi\" =\u003e Value::from(std::f64::consts::PI),\r\n            \"e\" =\u003e Value::from(std::f64::consts::E),\r\n            \"tau\" =\u003e Value::from(std::f64::consts::TAU),\r\n\r\n            _ =\u003e {\r\n                return Err(Error::Internal(format!(\r\n                    \"Unexpected const literal {}\",\r\n                    text\r\n                )));\r\n            }\r\n        };\r\n\r\n        Ok(Self { value, token }.boxed())\r\n    },\r\n    value = |this: \u0026ConstantValue, _state: \u0026mut State| { Ok(this.value.clone()) }\r\n);\r\n\r\ndefine_node!(\r\n    Identifier { name: String },\r\n    rules = [identifier],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let mut token = input.to_token();\r\n        let name = input.as_str().to_string();\r\n        token.references = Some(name.clone());\r\n\r\n        Ok(Self { name, token }.boxed())\r\n    },\r\n    value = |this: \u0026Identifier, state: \u0026mut State| {\r\n        let value = state.get_variable(\u0026this.name).ok_or(Error::VariableName {\r\n            name: this.name.clone(),\r\n            token: this.token.clone(),\r\n        })?;\r\n        Ok(value)\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    ArrayValue {\r\n        elements: Vec\u003cNode\u003e\r\n    },\r\n    rules = [array_literal],\r\n\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let elements = input\r\n            .into_inner()\r\n            .map(|child| Ok(child.to_ast_node()?))\r\n            .collect::\u003cResult\u003cVec\u003cNode\u003e, Error\u003e\u003e()?;\r\n\r\n        Ok(Self { elements, token }.boxed())\r\n    },\r\n\r\n    value = |this: \u0026ArrayValue, state: \u0026mut State| {\r\n        let values = this.elements.iter().map(|node| node.get_value(state)).collect::\u003cResult\u003cVec\u003c_\u003e, _\u003e\u003e()?;\r\n        Ok(Value::Array(values.into()))\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    ObjectValue {\r\n        pairs: Vec\u003c(Node, Node)\u003e\r\n    },\r\n    rules = [object_literal],\r\n\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let mut pairs: Vec\u003c(Node, Node)\u003e = Vec::new();\r\n        while children.peek().is_some() {\r\n            let key = children.next().unwrap().to_ast_node()?;\r\n            let value = children.next().unwrap().to_ast_node()?;\r\n            pairs.push((key, value));\r\n        }\r\n\r\n        Ok(Self { pairs, token }.boxed())\r\n    },\r\n\r\n    value = |this: \u0026ObjectValue, state: \u0026mut State| {\r\n        let mut object = ObjectInner::new();\r\n        for (key, value) in \u0026this.pairs {\r\n            let key = key.get_value(state)?;\r\n            let value = value.get_value(state)?;\r\n            object.insert(key, value)?;\r\n        }\r\n\r\n        Ok(Value::Object(object.into()))\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    RangeValue {\r\n        start: Node,\r\n        end: Node\r\n    },\r\n    rules = [RANGE_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let start = children\r\n            .next()\r\n            .ok_or(Error::IncompleteRangeExpression {\r\n                token: token.clone(),\r\n            })?\r\n            .to_ast_node()?;\r\n\r\n        children.next().unwrap(); // Skip the ..\r\n\r\n        let end = children\r\n            .next()\r\n            .ok_or(Error::IncompleteRangeExpression {\r\n                token: token.clone(),\r\n            })?\r\n            .to_ast_node()?;\r\n\r\n        Ok(Self { start, end, token }.boxed())\r\n    },\r\n    value = |this: \u0026RangeValue, state: \u0026mut State| {\r\n        let start = this.start.get_value(state)?;\r\n        let end = this.end.get_value(state)?;\r\n\r\n        // We will enforce 3 things here:\r\n        // 1. The start and end must be the same type\r\n        // 2. The start and end must be integer or single character strings\r\n        // 3. The start must be less than or equal to the end\r\n        match (\u0026start, \u0026end) {\r\n            (Value::String(start), Value::String(end)) =\u003e {\r\n                if start.inner().len() != 1 || end.inner().len() != 1 {\r\n                    return Err(Error::InvalidRange {\r\n                        start: start.to_string(),\r\n                        end: end.to_string(),\r\n                        token: this.token.clone(),\r\n                    });\r\n                }\r\n\r\n                let start = start.inner().chars().next().unwrap();\r\n                let end = end.inner().chars().next().unwrap();\r\n\r\n                if start \u003e end {\r\n                    return Err(Error::InvalidRange {\r\n                        start: start.to_string(),\r\n                        end: end.to_string(),\r\n                        token: this.token.clone(),\r\n                    });\r\n                }\r\n\r\n                // as array spanning the range inclusively\r\n                let array = (start..=end)\r\n                    .map(|i| Value::from(i.to_string()))\r\n                    .collect::\u003cVec\u003c_\u003e\u003e();\r\n                Ok(Value::from(array))\r\n            }\r\n\r\n            (Value::I64(start), Value::I64(end)) =\u003e {\r\n                if start \u003e end {\r\n                    return Err(Error::InvalidRange {\r\n                        start: start.to_string(),\r\n                        end: end.to_string(),\r\n                        token: this.token.clone(),\r\n                    });\r\n                }\r\n\r\n                Ok(Value::from(*start.inner()..=*end.inner()))\r\n            }\r\n\r\n            _ =\u003e Err(Error::RangeTypeMismatch {\r\n                token: this.token.clone(),\r\n            }),\r\n        }\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    CastingExpression {\r\n        value: Node,\r\n        target_type: ValueType\r\n    },\r\n    rules = [CASTING_EXPRESSION],\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        let value = children.next().unwrap().to_ast_node()?;\r\n        let target_type = children.next().unwrap().as_str();\r\n        let target_type: ValueType = target_type.try_into()?;\r\n\r\n        Ok(Self {\r\n            value,\r\n            target_type,\r\n            token,\r\n        }\r\n        .boxed())\r\n    },\r\n    value = |this: \u0026CastingExpression, state: \u0026mut State| {\r\n        let value = this.value.get_value(state)?;\r\n        Ok(value.as_type(this.target_type)?)\r\n    }\r\n);\r\n\r\ndefine_node!(\r\n    DeleteExpression {\r\n        src: String,\r\n        indices: Vec\u003cNode\u003e\r\n    },\r\n    rules = [DELETE_EXPRESSION],\r\n\r\n    new = |input: Pair\u003cRule\u003e| {\r\n        let token = input.to_token();\r\n        let mut children = input.into_inner();\r\n\r\n        children.next(); // Skip the delete keyword\r\n        let src = children.next().unwrap().as_str().to_string();\r\n        let indices = children\r\n            .map(|child| Ok(child.to_ast_node()?))\r\n            .collect::\u003cResult\u003cVec\u003cNode\u003e, Error\u003e\u003e()?;\r\n\r\n        Ok(Self {\r\n            src,\r\n            indices,\r\n            token,\r\n        }\r\n        .boxed())\r\n    },\r\n\r\n    value = |this: \u0026DeleteExpression, state: \u0026mut State| {\r\n        let mut indices = this.indices.iter().map(|i| i.get_value(state)).collect::\u003cResult\u003cVec\u003c_\u003e, _\u003e\u003e()?;\r\n        if let Some(final_idx) = indices.pop() {\r\n            let mut value = state.get_variable(\u0026this.src).ok_or(Error::VariableName {\r\n                name: this.src.clone(),\r\n                token: this.token.clone(),\r\n            })?;\r\n\r\n            let mut pos = \u0026mut value;\r\n            for index in \u0026mut indices {\r\n                pos = pos.get_index_mut(index)?;\r\n            }\r\n\r\n            let removed = pos.delete_index(\u0026final_idx)?;\r\n            state.set_variable(\u0026this.src, value);\r\n            Ok(removed)\r\n        } else {\r\n            if let Some(function) = state.delete_user_function(\u0026this.src) {\r\n                Ok(function.to_std_function().signature().into())\r\n            } else {\r\n                state.delete_variable(\u0026this.src).ok_or(Error::VariableName {\r\n                    name: this.src.clone(),\r\n                    token: this.token.clone(),\r\n                })\r\n            }\r\n        }\r\n    }\r\n);\r\n\r\n#[cfg(test)]\r\nmod test {\r\n    use polyvalue::{\r\n        types::{Object, I64},\r\n        ValueTrait,\r\n    };\r\n\r\n    use super::*;\r\n    use crate::assert_tree;\r\n\r\n    macro_rules! assert_value {\r\n        ($input:literal, $rule:ident, $expected:literal) =\u003e {\r\n            assert_tree!($input, $rule, ValueLiteral, |tree: \u0026mut ValueLiteral| {\r\n                assert_eq!($expected, tree.value.to_string());\r\n            });\r\n        };\r\n    }\r\n\r\n    #[test]\r\n    fn test_currency_literal() {\r\n        assert_value!(\"$1\", currency_literal, \"$1\");\r\n        assert_value!(\"$1.20\", currency_literal, \"$1.20\");\r\n        assert_value!(\"1.20$\", currency_literal, \"$1.20\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_sci_literal() {\r\n        assert_value!(\"1e2\", sci_literal, \"100.0\");\r\n        assert_value!(\"1e-2\", sci_literal, \"0.01\");\r\n        assert_value!(\"1.2e2\", sci_literal, \"120.0\");\r\n        assert_value!(\"1.2e+2\", sci_literal, \"120.0\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_float_literal() {\r\n        assert_value!(\"1.2\", float_literal, \"1.2\");\r\n        assert_value!(\".2\", float_literal, \"0.2\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_hex_literal() {\r\n        assert_value!(\"0x1\", sized_literal, \"1\");\r\n        assert_value!(\"0x1a\", sized_literal, \"26\");\r\n        assert_value!(\"0x1A\", sized_literal, \"26\");\r\n        assert_value!(\"0x1Aa\", sized_literal, \"426\");\r\n        assert_value!(\"0xA0\", sized_literal, \"160\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_bin_literal() {\r\n        assert_value!(\"0b1\", sized_literal, \"1\");\r\n        assert_value!(\"0b10\", sized_literal, \"2\");\r\n        assert_value!(\"0b101\", sized_literal, \"5\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_oct_literal() {\r\n        assert_value!(\"0o1\", sized_literal, \"1\");\r\n        assert_value!(\"0o10\", sized_literal, \"8\");\r\n        assert_value!(\"0o101\", sized_literal, \"65\");\r\n        assert_value!(\"0101\", sized_literal, \"65\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_sized_literal() {\r\n        assert_value!(\"1\", sized_literal, \"1\");\r\n        assert_value!(\"10\", sized_literal, \"10\");\r\n        assert_value!(\"100\", sized_literal, \"100\");\r\n        assert_value!(\"100_000\", sized_literal, \"100000\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_bool_literal() {\r\n        assert_value!(\"true\", bool_literal, \"true\");\r\n        assert_value!(\"false\", bool_literal, \"false\");\r\n        assert_value!(\"TRUe\", bool_literal, \"true\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_string_literal() {\r\n        assert_value!(\"\\\"\\\"\", string_literal, \"\");\r\n        assert_value!(\"\\\"hello\\\"\", string_literal, \"hello\");\r\n        assert_value!(\"\\\"hello world\\\"\", string_literal, \"hello world\");\r\n        assert_value!(\"\\\"hello \\\\\\\"world\\\\\\\"\\\"\", string_literal, \"hello \\\"world\\\"\");\r\n    }\r\n\r\n    #[test]\r\n    fn test_identifier() {\r\n        assert_tree!(\"hello\", identifier, Identifier, |tree: \u0026mut Identifier| {\r\n            assert_eq!(\"hello\", tree.name);\r\n\r\n            let state = \u0026mut State::new();\r\n            state.set_variable(\"hello\", Value::from(1));\r\n            let value = tree.get_value(state).unwrap();\r\n            assert_eq!(1, *value.as_a::\u003cI64\u003e().unwrap().inner());\r\n        });\r\n    }\r\n\r\n    #[test]\r\n    fn test_array_literal() {\r\n        assert_tree!(\r\n            \"[1, 2, 3]\",\r\n            array_literal,\r\n            ArrayValue,\r\n            |tree: \u0026mut ArrayValue| {\r\n                assert_eq!(3, tree.elements.len());\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(\"[1, 2, 3]\", value.to_string());\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_object_literal() {\r\n        assert_tree!(\r\n            \"{'a': 1, 'b': 2, 3: 3}\",\r\n            object_literal,\r\n            ObjectValue,\r\n            |tree: \u0026mut ObjectValue| {\r\n                assert_eq!(3, tree.pairs.len());\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                let obj = value.as_a::\u003cObject\u003e().unwrap();\r\n                assert!(obj.inner().contains_key(\u0026Value::from(\"a\")));\r\n                assert!(obj.inner().contains_key(\u0026Value::from(\"b\")));\r\n                assert!(obj.inner().contains_key(\u0026Value::from(3i64)));\r\n            }\r\n        );\r\n    }\r\n\r\n    #[test]\r\n    fn test_range_expression() {\r\n        assert_tree!(\r\n            \"1..3\",\r\n            RANGE_EXPRESSION,\r\n            RangeValue,\r\n            |tree: \u0026mut RangeValue| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(\"1..3\", value.to_string());\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"'a'..'c'\",\r\n            RANGE_EXPRESSION,\r\n            RangeValue,\r\n            |tree: \u0026mut RangeValue| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(\"[a, b, c]\", value.to_string());\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"1..1\",\r\n            RANGE_EXPRESSION,\r\n            RangeValue,\r\n            |tree: \u0026mut RangeValue| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(\"1..1\", value.to_string());\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"'a'..'a'\",\r\n            RANGE_EXPRESSION,\r\n            RangeValue,\r\n            |tree: \u0026mut RangeValue| {\r\n                let value = tree.get_value(\u0026mut State::new()).unwrap();\r\n                assert_eq!(\"[a]\", value.to_string());\r\n            }\r\n        );\r\n\r\n        assert_tree!(\r\n            \"1..0\",\r\n            RANGE_EXPRESSION,\r\n            RangeValue,\r\n            |tree: \u0026mut RangeValue| {\r\n                let value = tree.get_value(\u0026mut State::new());\r\n                assert!(value.is_err());\r\n            }\r\n        );\r\n\r\n        ass fmt::Formatter\u003c'_\u003e) -\u003e std::fmt::Result {\r\n                write!(f, \"{}\", self.token().input)\r\n            }\r\n        }\r\n        impl crate::AstNode for $name {\r\n            fn from_pair(input: pest::iterators::Pair\u003ccrate::pest::Rule\u003e) -\u003e Result\u003ccrate::Node, crate::Error\u003e {\r\n                ($new_hnd)(input)\r\n            }\r\n\r\n            fn get_value(\u0026self, state: \u0026mut crate::State) -\u003e Result\u003ccrate::Value, crate::Error\u003e {\r\n                state.check_timer()?;\r\n                ($get_hnd)(self, state)\r\n            }\r\n\r\n            fn token(\u0026self) -\u003e \u0026crate::Token {\r\n                \u0026self.token\r\n            }\r\n\r\n            fn boxed(self) -\u003e crate::Node\r\n            where\r\n                Self: Sized + 'static,\r\n            {\r\n                Box::new(self)\r\n            }\r\n\r\n            fn as_any(\u0026self) -\u003e \u0026dyn std::any::Any {\r\n                self\r\n            }\r\n\r\n            fn as_any_mut(\u0026mut self) -\u003e \u0026mut dyn std::any::Any {\r\n                self\r\n            }\r\n        }\r\n    };\r\n}\r\n\r\npub type Node = Box\u003cdyn AstNode\u003e;\r\n\r\nimpl TryFrom\u003c\u0026str\u003e for Node {\r\n    type Error = Error;\r\n\r\n    fn try_from(value: \u0026str) -\u003e Result\u003cSelf, Self::Error\u003e {\r\n        crate::pest::parse_input(value, crate::pest::Rule::SCRIPT)\r\n    }\r\n}\r\n\r\nmod boolean;\r\npub use boolean::*;\r\n\r\nmod bitwise;\r\npub use bitwise::*;\r\n\r\nmod arithmetic;\r\npub use arithmetic::*;\r\n\r\nmod unary;\r\nuse lazy_static::lazy_static;\r\npub use unary::*;\r\n\r\nmod assignment;\r\npub use assignment::*;\r\n\r\nmod values;\r\npub use values::*;\r\n\r\nmod core;\r\npub use core::*;\r\n\r\nmod error;\r\npub use error::*;\r\n\r\nmod function;\r\npub use function::*;\r\n\r\nmacro_rules! include_node {\r\n    ($map:expr, $node:ident) =\u003e {\r\n        $map.extend($node::RULES.iter().map(|r| (*r, $node::from_pair as _)));\r\n    };\r\n}\r\n\r\nuse std::collections::HashMap;\r\nlazy_static! {\r\n    static ref NODES: HashMap\u003ccrate::Rule, fn(pest::iterators::Pair\u003ccrate::Rule\u003e) -\u003e Result\u003cNode, Error\u003e\u003e = {\r\n        let mut map = HashMap::new();\r\n\r\n        //\r\n        // Values\r\n        include_node!(map, ValueLiteral);\r\n        include_node!(map, ConstantValue);\r\n        include_node!(map, Identifier);\r\n        include_node!(map, ArrayValue);\r\n        include_node!(map, ObjectValue);\r\n        include_node!(map, RangeValue);\r\n        include_node!(map, CastingExpression);\r\n        include_node!(map, DeleteExpression);\r\n\r\n        //\r\n        // Unary\r\n        include_node!(map, IndexingExpression);\r\n\r\n        //\r\n        // Functions\r\n        include_node!(map, FunctionCall);\r\n\r\n        //\r\n        // Errors\r\n        include_node!(map, UnterminatedLinebreak);\r\n        include_node!(map, UnterminatedLiteral);\r\n        include_node!(map, UnterminatedComment);\r\n        include_node!(map, UnexpectedDecorator);\r\n        include_node!(map, IncompleteRangeExpression);\r\n        include_node!(map, IncompleteObject);\r\n\r\n        //\r\n        // Core\r\n        include_node!(map, Script);\r\n        include_node!(map, Line);\r\n        include_node!(map, TernaryExpression);\r\n        include_node!(map, ForLoopExpression);\r\n        include_node!(map, SwitchExpression);\r\n\r\n        //\r\n        // Boolean\r\n        include_node!(map, BooleanExpression);\r\n        include_node!(map, BooleanNotExpression);\r\n        include_node!(map, MatchingExpression);\r\n\r\n        //\r\n        // Bitwise\r\n        include_node!(map, BitwiseExpression);\r\n        include_node!(map, BitwiseNotExpression);\r\n\r\n        //\r\n        // Arithmetic\r\n        include_node!(map, ArithmeticExpression);\r\n        include_node!(map, ArithmeticNegExpression);\r\n\r\n        //\r\n        // Assignments\r\n        include_node!(map, FunctionAssignment);\r\n        include_node!(map, VariableAssignment);\r\n        include_node!(map, DestructuringAssignment);\r\n        include_node!(map, IndexAssignment);\r\n\r\n        map\r\n    };\r\n}\r\n\r\npub fn node_map(\r\n) -\u003e \u0026'static HashMap\u003ccrate::Rule, fn(pest::iterators::Pair\u003ccrate::Rule\u003e) -\u003e Result\u003cNode, Error\u003e\u003e {\r\n    \u0026NODES\r\n}\r\n","traces":[{"line":5,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":13,"address":[],"length":0,"stats":{"Line":40},"fn_name":null},{"line":14,"address":[],"length":0,"stats":{"Line":40},"fn_name":null},{"line":18,"address":[],"length":0,"stats":{"Line":307},"fn_name":null},{"line":19,"address":[],"length":0,"stats":{"Line":307},"fn_name":null},{"line":22,"address":[],"length":0,"stats":{"Line":200},"fn_name":null},{"line":23,"address":[],"length":0,"stats":{"Line":200},"fn_name":null},{"line":24,"address":[],"length":0,"stats":{"Line":200},"fn_name":null},{"line":27,"address":[],"length":0,"stats":{"Line":150},"fn_name":null},{"line":28,"address":[],"length":0,"stats":{"Line":150},"fn_name":null},{"line":31,"address":[],"length":0,"stats":{"Line":280},"fn_name":null},{"line":32,"address":[],"length":0,"stats":{"Line":280},"fn_name":null},{"line":33,"address":[],"length":0,"stats":{"Line":280},"fn_name":null},{"line":35,"address":[],"length":0,"stats":{"Line":280},"fn_name":null},{"line":38,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":39,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":42,"address":[],"length":0,"stats":{"Line":94},"fn_name":null},{"line":43,"address":[],"length":0,"stats":{"Line":94},"fn_name":null},{"line":48,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":56,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":57,"address":[],"length":0,"stats":{"Line":0},"fn_name":n ferences to variables it contains\r\n#[derive(Debug, Clone)]\r\npub struct Token {\r\n    pub rule: Rule,\r\n    pub input: String,\r\n\r\n    /// An optional variable reference, for pass-by-ref\r\n    pub references: Option\u003cString\u003e,\r\n}\r\n\r\n/// A trait used to convert a pest pair into a token\r\npub trait ToToken {\r\n    fn to_token(\u0026self) -\u003e Token;\r\n}\r\nimpl ToToken for Pair\u003c'_, Rule\u003e {\r\n    fn to_token(\u0026self) -\u003e Token {\r\n        Token {\r\n            rule: self.as_rule(),\r\n            input: self.as_str().to_string(),\r\n            references: None,\r\n        }\r\n    }\r\n}\r\n\r\nimpl std::fmt::Display for Token {\r\n    fn fmt(\u0026self, f: \u0026mut std::fmt::Formatter\u003c'_\u003e) -\u003e std::fmt::Result {\r\n        write!(f, \"{}\", self.input)\r\n    }\r\n}\r\n","traces":[{"line":21,"address":[],"length":0,"stats":{"Line":314},"fn_name":null},{"line":23,"address":[],"length":0,"stats":{"Line":314},"fn_name":null},{"line":24,"address":[],"length":0,"stats":{"Line":314},"fn_name":null},{"line":31,"address":[],"length":0,"stats":{"Line":0},"fn_name":null},{"line":32,"address":[],"length":0,"stats":{"Line":0},"fn_name":null}],"covered":3,"coverable":5},{"path":["C:","\\","Users","rcarson1","Repositories","lavendeux_workspace","lavendeux_parser","src","user_function.rs"],"content":"use once_cell::sync::OnceCell;\r\nuse std::cell::RefCell;\r\nuse std::collections::hash_map::Entry;\r\nuse std::rc::Rc;\r\nuse std::{collections::HashMap, fmt::Display};\r\n\r\nuse crate::Token;\r\nuse crate::{\r\n    flatten_arguments, pest, required_argument, state::State, std_functions::Function, Error, Node,\r\n    Value,\r\n};\r\nuse polyvalue::ValueType;\r\n\r\n// A cache of pre-compiled user function bodies\r\nthread_local! {\r\n    static USER_FUNCTION_CACHE: OnceCell\u003cRefCell\u003cHashMap\u003cString, Rc\u003cNode\u003e\u003e\u003e\u003e = OnceCell::new();\r\n}\r\n\r\nfn cached_fn_compile(src: \u0026str) -\u003e Result\u003cRc\u003cNode\u003e, Error\u003e {\r\n    USER_FUNCTION_CACHE.with(|once_lock| {\r\n        let rt_mut = once_lock.get_or_init(|| RefCell::new(HashMap::new()));\r\n        let mut cache = rt_mut.borrow_mut();\r\n\r\n        match cache.entry(src.to_string()) {\r\n            Entry::Occupied(o) =\u003e Ok(o.get().clone()),\r\n            Entry::Vacant(v) =\u003e {\r\n                let node = pest::parse_input(src, pest::Rule::TOPLEVEL_EXPRESSION)?;\r\n                Ok(v.insert(Rc::new(node)).clone())\r\n            }\r\n        }\r\n    })\r\n}\r\n\r\n#[derive(Debug, Clone)]\r\npub struct UserFunction {\r\n    name: String,\r\n    arguments: Vec\u003cString\u003e,\r\n    src: String,\r\n}\r\n\r\nimpl UserFunction {\r\n    /// Creates a new user function\r\n    pub fn new(name: \u0026str, arguments: Vec\u003cString\u003e, src: String) -\u003e Result\u003cSelf, Error\u003e {\r\n        // Check that the function is valid\r\n        cached_fn_compile(\u0026src)?;\r\n\r\n        let inst = Self {\r\n            name: name.to_string(),\r\n            arguments,\r\n            src,\r\n        };\r\n\r\n        Ok(inst)\r\n    }\r\n\r\n    /// Returns the name of this function\r\n    pub fn name(\u0026self) -\u003e \u0026str {\r\n        \u0026self.name\r\n    }\r\n\r\n    /// Returns the arguments of this function\r\n    pub fn arguments(\u0026self) -\u003e \u0026[String] {\r\n        \u0026self.arguments\r\n    }\r\n\r\n    /// Returns the source of this function\r\n    pub fn src(\u0026self) -\u003e \u0026str {\r\n        \u0026self.src\r\n    }\r\n\r\n    /// Returns the body of this function\r\n    pub fn body(\u0026self) -\u003e Rc\u003cNode\u003e {\r\n        cached_fn_compile(\u0026self.src).unwrap()\r\n    }\r\n\r\n    /// Executes this function\r\n    pub fn execute(\r\n        \u0026self,\r\n        state: \u0026mut State,\r\n        arguments: Vec\u003cValue\u003e,\r\n        token: \u0026Token,\r\n    ) -\u003e Result\u003cValue, Error\u003e {
